INSERT INTO `Experience` VALUES (1,35,2,4,2,6,'Second language font could be a bit bigger to improve the readability.  ','2019-10-08 15:34:33','2019-10-08 15:34:33'),(2,1002,6,4,3,3,NULL,'2019-10-17 15:33:49','2019-10-17 15:33:49'),(3,3545,6,4,3,5,NULL,'2019-10-25 11:02:54','2019-10-25 11:02:54'),(4,5890,4,6,2,2,NULL,'2019-10-25 13:35:45','2019-10-25 13:35:45'),(5,2128,5,5,4,5,'Because I\'m used to only seeing search results in one language, I didn\'t find it too useful to be presented results in two languages. I rather have all results in one, not because it\'s not easy to read but because I don\'t have to think back and forth in two langauges','2019-10-28 13:40:16','2019-10-28 13:40:16'),(6,4458,4,4,4,4,NULL,'2019-10-31 16:01:39','2019-10-31 16:01:39'),(7,2156,6,6,6,5,NULL,'2019-11-01 11:47:30','2019-11-01 11:47:30'),(8,5492,6,6,6,6,NULL,'2019-11-12 12:31:03','2019-11-12 12:31:03'),(9,132,5,4,5,4,NULL,'2019-11-13 10:39:30','2019-11-13 10:39:30'),(10,1586,5,4,2,3,'Since my first language is Chinese not English, Chinese always easier for me.','2019-11-14 12:44:50','2019-11-14 12:44:50'),(11,2899,5,6,5,6,NULL,'2019-11-14 15:16:44','2019-11-14 15:16:44'),(12,6673,5,4,4,5,NULL,'2019-11-19 11:19:21','2019-11-19 11:19:21'),(13,7734,4,4,3,3,NULL,'2019-11-19 12:29:30','2019-11-19 12:29:30'),(14,2068,1,5,3,3,'Strictly speaking, this test should have included a rating system for data relevancy: highly relevant / relevant / marginally relevant / least relevant / irrelevant. ','2019-11-19 15:25:06','2019-11-19 15:25:06'),(15,6515,2,4,3,4,NULL,'2019-11-21 15:38:32','2019-11-21 15:38:32'),(16,2660,1,1,1,1,'It\'s not about language but topics. It depends on topics I\'m going to research, if I\'m familiar with the subject, both English and Chinese are fine; if I have no idea of the subject I\'m going to search and I\'m in a hurry to get the information, I\'ll prefer Chinese searching. Plus, I\'m from Shanghai,','2019-11-25 10:40:07','2019-11-25 10:40:07'),(17,5385,3,2,3,2,NULL,'20