ow to protect your computer.','English'),(1144,39,4,'https://support.microsoft.com/en-us/help/129972/how-to-prevent-and-remove-viruses-and-other-malware','How to prevent and remove viruses and other malware','Note If you cannot access the Internet on your computer, use another computer to help you follow the steps in the “How to reset your Internet Explorer proxy settings” section on the computer that may be infected. To remove a computer virus and other malicious software, follow these steps in order. Install the latest updates from Microsoft Update ...','English'),(1145,39,5,'https://economictimes.indiatimes.com/definition/computer-virus','What is Computer Virus? Definition of Computer Virus ...','Computer Virus: A computer virus is a malicious software program loaded onto a user\'s computer without the user\'s knowledge and performs malicious actions. Description: The term \'computer virus\' was first formally defined by Fred Cohen in 1983. Computer viruses never occur naturally. They are always induced by people. Once created and ...','English'),(1146,39,6,'https://computer.howstuffworks.com/virus.htm','How Computer Viruses Work | HowStuffWorks','Viruses: A virus is a small piece of software that piggybacks on real programs.For example, a virus might attach itself to a program such as a spreadsheet program. Each time the spreadsheet program runs, the virus runs, too, and it has the chance to reproduce (by attaching to other programs) or wreak havoc.','English'),(1147,39,7,'https://www.avg.com/en/signal/what-is-a-computer-virus','What Is a Computer Virus? | The Ultimate Guide to PC ...','Not quite Sylvia Plath. Or the Ika-tako virus, which replaced your files and programs with pictures of squid.. Aaaaw. Or the Stoned virus, which randomly displayed the words “Your computer is stoned.Legalize marihuana!” on your screen (and stayed in stoner character throughout by doing absolutely nothing else).','English'),(1148,39,8,'http://typeslist.com/different-types-of-compu