e Guzman. What it did was use social engineering to get people to click on the attachment; in this case, a love confession.The attachment was actually a script that poses as a TXT file, due to Windows at the time hiding the actual extension of the file.','English'),(1159,39,19,'https://www.avg.com/en/signal/how-to-get-rid-of-a-virus-or-malware-on-your-computer','How to Get Rid of a Virus & Delete Viruses From Your ...','Realizing your PC or laptop might be infected with a virus or malware is worrying, but with careful and decisive action, removing a virus is quicker and easier than you might think. It’s not always obvious that your computer is infected. Some of the warning signs your PC or laptop might have a ...','English'),(1160,39,20,'https://en.wikipedia.org/wiki/List_of_computer_viruses','Comparison of computer viruses - Wikipedia','The compilation of a unified list of computer viruses is made difficult because of naming. To aid the fight against computer viruses and other types of malicious software, many security advisory organizations and developers of anti-virus software compile and publish lists of viruses. When a new virus appears, the rush begins to identify and understand it as well as develop appropriate counter ...','English'),(1161,39,21,'http://www.businessdictionary.com/definition/computer-virus.html','What is a computer virus? definition and meaning ...','Some are immediately active, others remain latent for weeks or months, or work slowly to avoid detection and cause destruction over long periods. Propagation of computer viruses is a serious crime in many countries. See also Trojan horse, and worm.','English'),(1162,39,22,'https://simple.wikipedia.org/wiki/Computer_virus','Computer virus - Simple English Wikipedia, the free ...','A computer virus is a program that is able to copy itself when it is run. Often, computer viruses are run as a part of other programs. Biological viruses also work that way, as they copy themselves as part of other organisms.This is how the computer virus got its name. In addition to copying itself, a computer virus can also execute instructions that cause harm. For this reason, computer ...','English'),(1163,39,23,'http://www.youngupstarts.com/2016/04/14/9-types-of-computer-viruses-that-you-should-know-about-and-how-to-avoid-them/','9 Types Of Computer Viruses That You Should Know About ...','There are some viruses that bypass the security system of your device. Thus, if you want to know what to do when such a situation arises, read on as we have got some very useful tips for you. Here are 9 Computer Viruses that you should know about.','English'),(1164,39,24,'https://factfile.org/10-facts-about-computer-viruses','10 Facts about Computer Viruses | Fact File','Facts about Computer Viruses talk about the malware program which disturbs the program of your computer. The viruses may infect the boot sector, data files or even computer programs for they can replicate themselves. There are various disadvantages that you can get from the viruses hidden in the computer.','English'),(1165,39,25,'https://www.malwarebytes.com/computer-virus/','Computer Virus – Virus protection and removal tips ...','What is a computer virus? As defined by Malwarebytes Labs, a computer virus is “malware attached to another program (such as a document), which can replicate and spread after an initial execution on a target system where human interaction is required. Many viruses are harmful and can destroy data, slow down system resources, and log keystrokes.”','English'),(1166,39,26,'https://techviral.net/create-a-virus/','How To Create Computer Virus In Few Seconds (Notepad virus ...','Learn how to create a computer virus in less than 60 seconds: Almost every computer or laptop user has faced virus attack at least once in their life for sure, and we all know what is virus.Today we are going to describe five ways to create a virus in less than a minute. Go through the post to know about it.','English'),(1167,39,