ns of classical antiquity. Of the original Seven Wonders, only one—the Great Pyramid of Giza—remains intact.','English'),(1172,40,2,'https://www.ancient.eu/The_Seven_Wonders/','The Seven Wonders - Ancient History Encyclopedia','OTHER WONDERS. The Seven Wonders of the Ancient World were, by no means, a comprehensive agreed-upon list of the most impressive structures of the day. Rather, the list was very much like a modern-day tourist pamphlet informing travelers on what to see on their trip.','English'),(1173,40,3,'https://en.wikipedia.org/wiki/Wonders_of_the_World','Wonders of the World - Wikipedia','Various lists of the Wonders of the World have been compiled from antiquity to the present day, to catalogue the world\'s most spectacular natural wonders and manmade structures.. The Seven Wonders of the Ancient World is the first known list of the most remarkable creations of classical antiquity; it was based on guidebooks popular among Hellenic sightseers and only includes works located ...','English'),(1174,40,4,'https://www.thoughtco.com/the-seven-wonders-of-the-world-4147695','The Ancient World\'s 7 Wonders - ThoughtCo','The seven wonders of the ancient world have been celebrated by scholars, writers, and artists since at least 200 B.C. These marvels of architecture, like Egypt\'s pyramids, were monuments of human achievement, built by Mediterranean and Middle Eastern empires of their day with little more than crude tools and manual labor.','English'),(1175,40,5,'https://www.wonderslist.com/10-wonders-of-the-ancient-world/','10 Wonders of the Ancient World - Wonderslist','We are now presenting our next ten wonders of the ancient world list. It is fortunate that the world is so full of wonderful things that we can keep you infotained with lists of this nature. If you wish to read the others, they are here: Top 10 Wonders of The World Top 10 Natural Wonders of the World 10 Engineering Wonders of The Modern World','English'),(1176,40,6,'https://www.britannica.com/top