asters-In-History.html','The 10 Worst Energy-Related Disasters Of Modern Times ...','Wildlife in the surrounding area was severely impacted -- oil-covered dead birds, fish, and mammals washed ashore. The incident spurred action by the U.S. Congress, which passed the Oil Pollution ...','English'),(1218,41,18,'https://academy.allaboutbirds.org/what-oil-spills-do-to-birds/','What Oil Spills do to Birds | Bird Academy • The Cornell Lab','Birds were oiled as the result of the Deepwater Horizon oil spill. Species seen include American White Pelican, Brown Pelican, Snowy Egret, Sanderling, terns, and gulls. There was a huge effort underway at the time to capture these birds and bring them to rehabilitation experts for treatment.','English'),(1219,41,19,'https://ashleyhannah2.wordpress.com/2014/04/16/oil-and-birds/','10 Ways Oil Affects Birds | Peep-Lo','We all know that oil spills are bad for birds, but why exactly are oil spills bad for birds? And what other oil and natural gas related issues do birds have? In this post I will look at how oil affects birds physically and what species are affected by oil. Why is Oil on a…','English'),(1220,41,20,'https://www.education.com/science-fair/article/effect-of-oil-on-birds/','What Effect Does Oil have on Birds? | Science project ...','When oil spills into waterways, birds that come in contact with the oil instantly lose their waterproofing and often do not survive without human help. Use this project to learn what makes a bird waterproof, how just a single drop of oil spilled into the environment damages a bird’s feather structure and other harmful effects of oil on birds.','English'),(1221,41,21,'https://www.nationalgeographic.org/activity/birds-feathers-and-oil/','Birds, Feathers, and Oil | National Geographic Society','Resource Library | Activity : 45 mins Birds, Feathers, and Oil Students are introduced to the 2010 Gulf of Mexico oil spill. Through a hands-on simulation, students explore how birds are affected by oil and how wildlife rescuers help oiled birds.','English'),(1222,41,22,'https://www.skybrary.aero/index.php/Accident_and_Serious_Incident_Reports:_Wildlife_Strike','Accident and Serious Incident Reports: Wildlife Strike ...','Definition. A selection of reports relating to accidents and serious incidents which involved a Wildlife Strike.. The accident and serious incident reports are grouped together below in subcategories based upon SKYbrary database tags.. Large Birds. A320, vicinity Auckland New Zealand, 2012 (On 20 June 2012, the right V2500 engine compressor of an Airbus A320 suddenly stalled on final approach.','English'),(1223,41,23,'https://www.popularmechanics.com/science/energy/g1765/biggest-oil-spills-in-history/','10 Biggest Oil Spills in History - Popular Mechanics','10 Biggest Oil Spills in History ... incident included firefighting efforts and the use of dispersants to treat the oil that spilled over the course of the accident and then while the Atlantic ...','English'),(1224,41,24,'https://www.investors.com/politics/commentary/windmills-and-solar-plans-kill-far-birds-than-oil-spills/','Which Kills More Birds? Oil Spills, or Windmills ...','Which Kills More Birds? Oil Spills, or Windmills? ... But oil spills the size of the BP accident don\'t happen every year. Deaths caused by wind turbines and solar farms, however, don\'t stop. ...','English'),(1225,41,25,'https://allnaturalpetcare.com/blog/2018/02/27/common-diffuser-essential-oils-may-toxic-dogs-cats-birds-pets/','Common Diffuser Essential Oils that may be Toxic to Dogs ...','The answer is complicated by the varying tolerance levels of each species or breed. Some essential oils are toxic to all pets, or only some dog breeds, or species such as cats, rabbits, birds, aquarium fish and other small animals. We don’t recommend using an essential oil diffuser with cats, rabbits, birds, fish and other small animals close by.','English'),(1226,41,26,'https://www.impactlaw.com/international-catastrophic/oil-spills/stati