greenpeace-continues-anti-drilling-protest-on-bp-oil-rig-in-north-sea','Greenpeace North Sea oil rig protest prompts injunction ...','The oil rig in Cromarty Firth, Scotland, as it was being towed out to sea. Photograph: Greenpeace/PA The French oil giant Total announced on Tuesday that it had brought a huge North Sea gas field ...','English'),(1231,42,1,'https://www.theguardian.com/environment/2011/aug/15/north-sea-oil-spill','North sea oil spill \'worst for a decade\' | Environment ...','The flow of oil from the worst spill in UK waters in the past decade, at one of Shell\'s North Sea platforms, has been \"greatly reduced\" but not yet stopped completely, the government said on ...','English'),(1232,42,2,'https://e360.yale.edu/features/as-north-sea-oil-wanes-removing-abandoned-rigs-stirs-controversy','As North Sea Oil Wanes, Removing Abandoned Rigs Stirs ...','With thousands of North Sea oil wells soon to be shut down, ecologists are warning that removing the gargantuan platforms could be more environmentally harmful than leaving them in place. The rigs, it turns out, have nurtured cold-water corals and other marine life.','English'),(1233,42,3,'https://en.wikipedia.org/wiki/North_Sea_oil','North Sea oil - Wikipedia','North Sea oil is a mixture of hydrocarbons, comprising liquid petroleum and natural gas, produced from petroleum reservoirs beneath the North Sea.. In the petroleum industry, the term \"North Sea\" often includes areas such as the Norwegian Sea and the area known as \"West of Shetland\", \"the Atlantic Frontier\" or \"the Atlantic Margin\" that is not geographically part of the North Sea.','English'),(1234,42,4,'https://en.wikipedia.org/wiki/North_Sea','North Sea - Wikipedia','The North Sea contains western Europe\'s largest oil and natural gas reserves and is one of the world\'s key non-OPEC producing regions. In the UK sector of the North Sea, the oil industry invested £14.4 billion in 2013, and was on track to spend £13 billion in 2014.','English'