t we should access and extract oil from below the earth\'s surface is a subject of frequent debate. Drilling for oil, both on land and at sea, can have a number of effects on the environment.','English'),(1258,42,28,'https://www.worldcat.org/title/north-sea-oil-and-the-environment-a-report-to-the-oil-development-council-for-scotland/oclc/21777894','North Sea oil and the environment : a report to the Oil ...','Get this from a library! North Sea oil and the environment : a report to the Oil Development Council for Scotland. [Scotland. Oil Development Council for Scotland. Committee on the Environment.;]','English'),(1259,42,29,'https://sedac.ciesin.columbia.edu/entri/texts/pollution.north.sea.by.oil.1969.html','Environmental Treaties and Resource Indicators (ENTRI ...','Agreement for Cooperation in Dealing with Pollution of the North Sea by Oil and Other Harmful Substances 13 September 1983. Summary of the \"Agreement for Cooperation in Dealing with Pollution of the North Sea by Oil\" is available from the UNEP Register of International Treaties and Other Agreements in the Field of the Environment.','English'),(1260,43,0,'https://www.reference.com/science/causes-damage-ozone-layer-95355f52a601550d','What Causes Damage to the Ozone Layer? | Reference.com','The ozone layer is being damaged by pollutants in the air that are mostly man-made, such as chlorine and bromine. The ozone damage occurs in the stratosphere and troposphere. The lower pollution in the troposphere has many of the same causes as the upper destruction, but causes more visible and health-related issues than the stratosphere damage.','English'),(1261,43,1,'https://www.nationalgeographic.com/environment/global-warming/ozone-depletion/','Ozone depletion facts and information - National Geographic','Over the past 30 years humans have made progress in stopping damage to the ozone layer by curbing the use of certain chemicals. But more remains to be done to protect and restore the atmospheric ...','English'),