er has been found to be affected by certain natural phenomena such as Sun-spots and stratospheric winds. But this has been found to cause not more than 1-2% depletion of the ozone layer and the effects are also thought to be only temporary.','English'),(1267,43,7,'https://www.quora.com/How-do-CFCs-damage-the-ozone-layer','How do CFCs damage the ozone layer? - Quora','This is a trick question! In layman\'s terms: Pollution from ground level all the way up to the highest levels of the atmosphere is neutralized by Ozone, which then turns back into pure oxygen. Where there is no Ozone, there is generally pollution,...','English'),(1268,43,8,'https://www.theguardian.com/environment/2018/nov/05/ozone-layer-healing-after-aerosols-un-northern-hemisphere','Ozone layer finally healing after damage caused by ...','The ozone layer is showing signs of continuing recovery from man-made damage and is likely to heal fully by 2060, new evidence shows. The measures taken to repair the damage will also have an ...','English'),(1269,43,9,'https://news.rpi.edu/content/2019/06/24/damage-ozone-layer-and-climate-change-forming-feedback-loop','Damage to the Ozone Layer and Climate Change Forming ...','Damage to the Ozone Layer and Climate Change Forming Feedback Loop New report finds that impacts of ozone-driven climate change span the ecosystem By Mary L. Martialay. Increased solar radiation penetrating through the damaged ozone layer is interacting with the changing climate, and the consequences are rippling through the Earth’s natural ...','English'),(1270,43,10,'https://www.epa.gov/ozone-layer-protection/health-and-environmental-effects-ozone-layer-depletion','Health and Environmental Effects of Ozone Layer Depletion ...','It is a cause of melanoma and other types of skin cancer. It has also been linked to damage to some materials, crops, and marine organisms. The ozone layer protects the Earth against most UVB coming from the sun. It is always important to protect oneself against UVB, even in the absence of ozone depletion, by wearing hats, sunglasses, and ...','English'),(1271,43,11,'https://www.eartheclipse.com/environment/causes-effects-solutions-of-ozone-layer-depletion.html','Causes, Effects and Solutions of Ozone Layer Depletion ...','The Ozone layer is a deep blanket in the stratosphere made up of comparatively high concentration of the ozone. As a result of its chemical composition, ozone is regarded as a special type of oxygen as it contains three oxygen molecules (O3) as opposed to the usual two oxygen molecules (O2).','English'),(1272,43,12,'https://sciencing.com/gases-affect-ozone-layer-5050.html','What Are the Gases That Affect the Ozone Layer? | Sciencing','The ozone layer is thin -- only about the thickness of two stacked pennies -- and certain gases interact with ozone to cause a seasonal thinning of the layer. Most of the gases responsible for these ozone holes are released as a result of human industrial or agricultural activity.','English'),(1273,43,13,'https://www.ucsusa.org/global-warming/science-and-impacts/science/ozone-hole-and-gw-faq.html','Is There a Connection Between the Ozone Hole and Global ...','Ozone (O 3) depletion does not cause global warming, but both of these environmental problems have a common cause: human activities that release pollutants into the atmosphere altering it. Global warming is caused primarily by putting too much carbon dioxide into the atmosphere when coal, oil, and ...','English'),(1274,43,14,'https://www.conserve-energy-future.com/causes-and-effects-of-ozone-hole.php','What is the Ozone Hole? - Conserve Energy Future','The effect of the ozone hole and the damage done to the layer is still not very well understood. Apart from the gradual decrease of the ozone layer all over the world, there is little quantifiable evidence of new holes appearing any time soon. Even so, a number of countries have been working towards mitigating the damage.','English'),(1275,43,15,'https://www.answers.com/Q/Which_chemical_damages_the_protective_ozone_layer','Which chemical damages the protective ozone layer ...','Ozone layer is very important in this world as it acts as a protective shield for the living organisms. It protects us from the harmful ultraviolet radiations of the sun which can cause some ...','English'),(1276,43,16,'https://www.answers.com/Q/What_damages_the_ozone_layer_the_most','What damages the ozone layer the most? - Answers.com','Ozone layer gets damages due to the use of ozone depleting substances.These ODS react with ozone and deplete it. What chemical damages the protective ozone layer?','English'),(1277,43,17,'https://www.smithsonianmag.com/science-nature/ozone-hole-was-super-scary-what-happened-it-180957775/','The Ozone Hole Was Super Scary, So What Happened To It ...','The Ozone Hole Was Super Scary, So What Happened To It? ... The ozone layer had been damaged more than scientists could have imagined before Farman discovered the hole. ... Ask Smithsonian: How ...','English'),(1278,43,18,'https://greentumble.com/what-affects-the-ozone-layer/','What Affects the Ozone Layer? | Greentumble','The ozone layer is a layer of ozone gas that is located in the stratosphere, approximately 6 to 10 miles (10-17 km) above the Earth’s surface, and is estimated to extend up approximately 30 miles (50 km). The ozone layer protects the Earth and all of its living creatures from the sun’s ultraviolet B (UVB) radiation.','English'),(1279,43,19,'http://www.environment.gov.au/protection/ozone/ozone-science/ozone-layer','Ozone and the ozone layer Australia','More about ozone layer depletion. The ozone layer is depleted in two ways. Firstly, the ozone layer in the mid-latitude (e.g. over Australia) is thinned, leading to more UV radiation reaching the earth. Data collected in the upper atmosphere have shown that there has been a general thinning of the ozone layer over most of the globe.','English'),(1280,43,20,'https://ecofriend.com/5-products-ozone-depletion.html','5 Products that cause ozone depletion and 5 alternatives ...','5 Products that cause ozone depletion. Though the list of ODS is not exhaustive, some commonly used products have been identified that have a substantial effect on the atmospheric ozone layer. Compiled by Dr Prem Jagyasi, here is a list of 5 most commonly used products that are detrimental for the health of ozone layer:','English'),(1281,43,21,'https://helpsavenature.com/ozone-layer-depletion-effects-causes','Causes and Effects of Ozone Layer Depletion That are ...','The ozone layer is responsible for absorbing harmful ultraviolet rays, and preventing them from entering the Earth\'s atmosphere. However, various factors have led to the depletion and damage of this protective layer. Learn more about the process, causes, and effects of ozone layer depletion.','English'),(1282,43,22,'https://www.nationalgeographic.org/encyclopedia/ozone-layer/','ozone layer | National Geographic Society','Ozone layer damage is more like a really thin patch than a hole. The ozone layer is thinnest near the poles. In the 1970s, people all over the world started realizing that the ozone layer was getting thinner and that this was a bad thing.','English'),(1283,43,23,'https://scied.ucar.edu/ozone-layer','The Ozone Layer | UCAR Center for Science Education','Near the ground, ozone is an air pollutant that causes lung damage and asthma attacks. But 10 to 30 miles above the Earth’s surface (16-48 km), ozone molecules protect life on Earth. They help shield our planet from harmful solar radiation. The ozone layer, in the stratosphere, is where about 90% of the ozone in the Earth system is found. But ...','English'),(1284,43,24,'https://www.reference.com/science/type-things-can-destroy-ozone-layer-4420661d4326014','What Type of Things Can Destroy the Ozone Layer ...','What Type of Things Can Destroy the Ozone Layer? ... Once it reaches the stratosphere, this destructive chemical reaction can continue to damage the earth\'s ozone for more t