 does oil prices rise and fall - pttplc.com','Why does oil prices rise and fall? Of all industries in the world, oil industry is indeed an international business which affects most countries in the world. As the oil is the most consumed energy, it plays a vital role in daily lives as well as economy and social development. Also, the oil industry leads to new','English'),(1482,50,12,'https://en.wikipedia.org/wiki/Price_of_oil','Price of oil - Wikipedia','The price of oil, or the oil price, generally refers to the spot price of a barrel of benchmark crude oil—a reference price for buyers and sellers of crude oil such as West Texas Intermediate (WTI), Brent Crude, Dubai Crude, OPEC Reference Basket, Tapis Crude, Bonny Light, Urals oil, Isthmus and Western Canadian Select (WCS). There is a differential in the price of a barrel of oil based on ...','English'),(1483,50,13,'https://www.frbsf.org/education/publications/doctor-econ/2007/november/oil-prices-impact-economy/','What are the possible causes and consequences of higher ...','As Blanchard and Gali (2007) note, the late 1990s and early 2000s were periods of large oil price fluctuations, which were comparable in magnitude to the oil shocks of the 1970s. However, these later oil shocks did not cause considerable fluctuations in inflation (Figure 4), real GDP growth (Figure 5), or the unemployment rate.','English'),(1484,50,14,'https://www.investopedia.com/articles/economics/08/determining-oil-prices.asp','What determines oil prices? - investopedia.com','With oil\'s stature as a high-demand global commodity comes the possibility that major fluctuations in price can have a significant economic impact.','English'),(1485,50,15,'http://theconversation.com/understanding-the-rollercoaster-ride-of-oil-prices-97848','Understanding the rollercoaster ride of oil prices','Gas prices usually rise heading into long weekends. The reasons behind wild oil price fluctuations, reflected at the pumps, is about a lot more than economics.',