ncing act between static and flexible global supply chain management strategies.','English'),(1490,50,20,'https://www.federalreserve.gov/econresdata/ifdp/2016/files/ifdp1173.pdf','Oil Price Elasticities and Oil Price Fluctuations','Oil Price Elasticities and Oil Price Fluctuations Dario Caldaray Michele Cavalloz Matteo Iacoviellox July 11, 2016 Abstract We study the identi cation of oil shocks in a structural vector autoregressive (SVAR) model of','English'),(1491,50,21,'https://www.tradefinanceglobal.com/posts/oil-prices-and-the-airline-industry/','Oil Prices and the Airline Industry - tradefinanceglobal.com','What causes the oil price fluctuations? The main source of oil price fluctuations is OPEC (Organization of Petroleum Exporting Countries) which controls over 40% of the global oil supplies. OPEC influences the price of oil by setting production levels to meet the global demand for crude oil; it can influence the demand by increasing or decreasing the production.','English'),(1492,50,22,'https://www.thebalance.com/oil-price-history-3306200','Crude Oil Price History: A Chart of Events Since 1974','The supply increase had driven global oil prices down to a 13-year low of $26.55/b on Jan. 20, 2016. As a result, prices responded to OPEC\'s actions more than seasonal variations. Six months before that, prices had been $60/b. Today\'s oil prices fluctuate due to these constantly changing conditions.','English'),(1493,50,23,'https://en.wikipedia.org/wiki/World_oil_market_chronology_from_2003','World oil market chronology from 2003 - Wikipedia','From the mid-1980s to September 2003, the inflation adjusted price of a barrel of crude oil on NYMEX was generally under $25/barrel. Then, during 2004, the price rose above $40, and then $60. A series of events led the price to exceed $60 by August 11, 2005, leading to a record-speed hike that reached $75 by the middle of 2006.','English'),(1494,50,24,'https://www.businessinsider.com/timeline-155-year-history-of-oil-prices-201