54040.html','电脑前久坐带来的危害 - jy135.com','在现代社会中，电脑已经成为人们生活和工作不可缺少的工具，但电脑也越来越成为一把“双刃剑”：它在给人们生活和工作带来方便、快捷的同时，久坐在电脑前工作的状态也在悄悄地危及人们的健康，引起人的视力衰退、关节损伤、辐射伤害、头部和肩膀疼痛。','Chinese'),(2186,73,28,'https://m.iask.sina.com.cn/b/11335443.html','躺在床上用笔记本危害真的很大吗？最近一直每 – 手机爱问','像你这种把笔记本放床上用的对你本身的身体和笔记本都是不好的，笔记本放在软的被褥上，会严重影响散热性能，时间长了，减少它的使用寿命，如果散热设计的不合理的机器，很可能因为过热导致火灾，这个不是危言耸听，大学寝室火灾就有这样发生的，对你自身，这样使用姿势很别扭，对身体 ...','Chinese'),(2187,73,29,'https://m.tmall.com/mblist/cp_yvOx6s3zzdC0tNLi.html','鼠标腕托创意【多图】_价格_图片- 天猫精选','天猫精选鼠标腕托创意专题，我们从价格、评价、销量出发，为您精选了和鼠标腕托创意相关的357个商品','Chinese'),(2188,74,0,'https://wenku.baidu.com/view/db7c4266caaedd3383c4d3fa.html','蔬菜水果与癌症的防治_百度文库 - wenku.baidu.com','蔬菜水果与癌症的防治_医学_高等教育_教育专区 975人阅读|5次下载. 蔬菜水果与癌症的防治_医学_高等教育_教育专区。蔬菜水果与癌症的防治 赵国华① 周亚平① 牟飞飞① 李杰茹② （注： ① 石家庄医学高等专科学校新华校区 河北 石家庄 050071 ② 石家庄卫生学校 河北 石家庄 050000） 摘要：癌症是目前','Chinese'),(2189,74,1,'https://zhidao.baidu.com/question/747930408824676212.html','为什么多吃蔬菜水果可以抗癌？_百度知道','据估计，如果能做到每人每天摄入400～800g新鲜水果和蔬菜，则可使肺癌和胃癌的发生减少50%。在膳食与癌症的关系中，蔬菜和水果对于癌症的预防作用应该是最具有说服力的了。 参考资料：百度知道日报，《除皱针能让你”返老还童“吗？','Chinese'),(2190,74,2,'https://zhidao.baidu.com/question/393832970.html','蔬菜与水果的区别 70 - 百度知道','蔬菜与水果的区别有： 1、一样成分不一样：水果中的矿物质和微量元素不如蔬菜丰富，维生素b、维生素a的含量也相对较低，所以如果完全以水果代替蔬菜，有可能会造成以上几种维生素和微量元素的缺乏。','Chinese'),(2191,74,3,'https://jingyan.baidu.com/article/7908e85cb88803af491ad251.html','有哪些水果和蔬菜可以抑制癌症-百度经验','有哪些水果和蔬菜可以抑制癌症,水果和蔬菜与我们额额生活息息相关，我们更是离不开水果和蔬菜，有一些水果和蔬菜可以抑制癌症的发生你知道吗？那么就和小编一起看一看有哪些吧','Chinese'),(2192,74,4,'http://www.sohu.com/a/190041345_464410','关于食物营养与肿瘤关系的权威解读 - sohu.com','蔬菜和水果越来越被证明是针对多种癌症的保护因素，在饮食、营养与癌症关系中，只有蔬菜和水果的保护作用最具有说服力和经得起时间考验。 有关156种水果、蔬菜与肿瘤的研究结果提出，水果与蔬菜所含成分差异很大，不同成分对于肿瘤不同形成阶段所起的 ...','Chinese'),(2193,74,5,'https://wenku.baidu.com/view/ec0bbe6a1eb91a37f1115c4a.html','水果和蔬菜降低癌症风险_图文_百度文库','水果和蔬菜降低癌症风险 一项新的调查显示， 数百万人因为没有吃足够的蔬菜和水果增加 了自己患癌症的风险。 世界癌症研究基金会指出，在英国，仅有五分之一的人每天摄入 的水果和蔬菜量达到推荐摄入量，即每日五份。','Chinese'),(2194,74,6,'https://jingyan.baidu.com/article/7e440953300f122fc0e2ef01.html','抑制癌症率的最佳蔬菜排行榜（抗癌、防癌榜单）-百度经验','抑制癌症率的最佳蔬菜排行榜（抗癌、防癌榜单）,各类蔬菜中，以既能提供丰富的养分，又有抗癌功效的蔬菜为最佳。美国、日本等科学研究证实，科学食用蔬菜对预防癌症有着积极作用。营养专家的测试资料表明，就抑癌率而言，排在第一位的是熟红薯。','Chinese'),(2195,74,7,'http://www.chinalowcarb.com/diet-and-cancer/','乳腺癌和脂肪有关？食物和癌症的关系？','癌症是人类的一大杀手，人们惧怕癌症，任何有关致癌的消息，不论是真是假，都能引起恐慌。 其实，人类很早就开始寻找癌症和食物之间的关系，大约公元前400年，希波克拉底就曾记载过，用饮食来治疗癌症。','Chinese'),(2196,74,8,'https://tech.sina.com.cn/d/f/2019-05-23/doc-ihvhiqay0735317.shtml','远离它们 癌症其实可以预防|癌症|高启龙|水果_新浪科技_新浪网','如多吃水果蔬菜，每天一斤蔬菜半斤水果，水果与蔬菜不能相互替换。 《中国居民膳食指南》提倡餐餐有蔬菜，推荐每天摄入蔬菜300—500克，深色 ...','Chinese'),(2197,74,9,'http://health.sohu.com/20120415/n340595215.shtml','多吃蔬菜水果能降低癌症风险吗？-搜狐健康','（一）多吃蔬菜、水果与降低癌症的风险有关吗？ 目前普遍认为，富含蔬菜和水果的膳食有利于健康，重要的原因是蔬菜、水果含多种微量营养素和其他生物活性物质，如类胡萝卜素（包括β胡罗卜素和番茄红素）、叶酸、维生素C、维生素D、维生素E、槲皮素 ...','Chinese'),(2198,74,10,'http://open.163.com/movie/2012/10/7/7/M8KB8IANT_M8KQLVP77.html','水果、蔬菜与癌症 - 网易公开课','课程简介: 本课程的目标是，向公众提供最新的有关营养方面的信息和话题，内容涵盖饮食因素对于癌症的影响作用，健康的饮食习惯，学校能提供的营养有哪些，咖啡因与癌症的联系，水果蔬菜与癌症预防等。通过本课程的学习，人们可以学习到健康的生活 ...','Chinese'),(2199,74,11,'https://www.wenkuxiazai.com/doc/db7c4266caaedd3383c4d3fa.html','蔬菜水果与癌症的防治_文库下载 - wenkuxiazai.com','提供蔬菜水果与癌症的防治文档免费下载，摘要:蔬菜水果与癌症的防治赵国华①周亚平①牟飞飞①李杰茹②（注：①石家庄医学高等专科学校新华校区河北石家庄050071②石家庄卫生学校河北石家庄050000）摘要：癌症是目前严重威胁人类健康和生命的“三大杀手”之一，在早期往往不易被发现，到了中晚','Chinese'),(2200,74,12,'https://zhuanlan.zhihu.com/p/46308864','注意！癌症病人吃药期间千万别吃这些水果，影响药效！ - 知乎','2017年，由美国癌症研究所、中国医学科学院肿瘤研究所等八家权威机构联合进行的一项涉及2.26亿中国人的大型研究表明，在所有生活方式和感染的各类因素中，与癌症关系最大的三种因素是： 1、吸烟. 2、hbv（乙肝病毒）感染. 3、蔬菜水果摄入不足','Chinese'),(2201,74,13,'http://www.sohu.com/a/76137580_119097','多吃水果蔬菜与防癌的故事 - sohu.com','多吃蔬菜水果，有益健康。这是大家的普遍观念，但具体有哪些益处呢？有没有降低癌症的作用？ 有科学家认为，食用大量果蔬不会降低罹患癌症的风险，相比而言，保持合理体重、戒烟戒酒更有防癌作用。不过，也有其他研...','Chinese'),(2202,74,14,'https://new.qq.com/omn/20190625/20190625A0ECOV.html','脂肪和乳腺癌有关？蔬菜水果抗癌？你知道的可能都是错的','此外，女性多吃蔬菜，可能对经前综合症有所帮助，但水果并没有这样的功效，对男性来说，十字花科蔬菜能降低前列腺癌。 让我们再来看看最新的研究，对象是350,000位女性，结果发现水果蔬菜的摄入，与乳腺癌之间没有关联。 很多类似的研究也得出同样的 ...','Chinese'),(2203,74,15,'https://www.youlai.cn/video/article/294359.html','癌症吃什么水果好 癌症病人能吃的水果有哪些_有来医生','其次，癌症患者在饮食上要注意饮食的均衡，避免吃比较油腻的食物、高脂肪的食物尽量避免或少吃，可以适当的多吃绿色的蔬菜和水果，这些含有维生素和纤维素比较多的绿色的植物，一方面可以补充人体需要的微量元素，另一方面也可以保持大便的通畅。','Chinese'),(2204,74,16,'https://iask.sina.com.cn/key/5ada0e2384ae31dc6d8bca04.html','癌症水果和蔬菜-鲜蔬菜和水果对癌症有什么影响？/鲜蔬菜和水果对癌-爱问知识人','癌症水果和蔬菜相关问答. 问： 鲜蔬菜和水果对癌症有什么影响？ 答： 新鲜蔬菜和水果含有多酚类、黄酮及类酮、花生四烯酸等物质，是致癌物的阻断剂和抑制剂 保健养生 1个回答 推荐. 问： 请问哪些水果或者蔬菜可以预防癌？ 答： 世界癌症研究基金会科学项目经理蕾切尔汤普森博士推荐了几种 ...','Chinese'),(2205,74,17,'http://www.cnki.com.cn/Article/CJFDTOTAL-ZMXB200804057.htm','蔬菜水果与癌症预防--《中国慢性病预防与控制》2008年04期','【摘要】：正新鲜蔬菜和水果已被公认为是最佳的防癌食物。世界癌症研究基金会(wcrf)和美国癌症研究所(aicr)总结世界各国的研究材料,认为有充分证据表明蔬菜和水果能降低口腔、咽、食管、肺、胃、结肠、直肠等癌症的危险性,且很可能降低喉、胰','Chinese'),(2206,74,18,'https://kangaiweishi.com/articles/e0e04001f24f41789351998917614344','食物与癌症二 | 抗癌 癌症 肿瘤 | 抗癌卫士','负相关食物——可能具有抗癌、抑癌或对人体有保护性 （一）蔬菜 每天从食物中可摄入很多有过氧化作用和引起癌症的有害物质，蔬菜水果含有丰富的矿物质，维他命，纤维素，含有多种抗氧化物，可以抑制这些致癌物质所产生的自由基和防止其对人体的损害进而降低癌症发生率。','Chinese'),(2207,74,19,'https://yiyuan.sdut.edu.cn/2014/1205/c1243a21068/page.htm','蔬菜水果与癌症预防 - yiyuan.sdut.edu.cn','蔬菜、水果的防癌作用与它们所含的营养成分, 包括抗氧化剂如类胡萝卜素、维生素 c 、类黄酮类化合物、异硫氰酸盐及有机硫化物等, 矿物质和其他活性成分等有关, 这些物质能使 dna 免受损伤, 促进其修复, 减少突变。另外, 蔬菜水果富含膳食纤维, 能缩短食物 ...','Chinese'),(2208,74,20,'http://tjhy21101.blog.sohu.com/109811068.html','蔬菜水果与疾病预防-健康是福-搜狐博客','蔬菜水果与疾病预防 （一）蔬菜水果与癌症预防. 新鲜蔬菜和水果已被公认是最佳的防癌食物。世界癌症研究基金会（wcrf）和美国癌症研究所（aicr）总结世界各国的研究材料，认为有充分证据表明蔬菜和水果能降低口腔、咽、食管、肺、胃、结肠、直肠等癌症的危险性，且很可能降低喉、胰腺 ...','Chinese'),(2209,74,21,'https://www.bkqs.com.cn/article/28295926.html','蔬菜水果是癌症的天然解药 / 百科全书网','蔬菜水果是癌症的天然解药 多吃蔬果能降低得癌症的机会,尤其经常吃蔬菜,水果和粗糙五谷的人得病机会比不常吃的人低二 三倍,所以蔬果被现代人视为是慢性病,癌症的天然解药. 专家建议只要每天至少吃两种水果和三种不同的蔬菜就能达到保健的功效,除此之外,蔬果对于美容塑身,美化肌肤,强健体格 ...','Chinese'),(2210,74,22,'http://cancer.39.net/0711/10/161671.html','防癌抗癌的蔬菜和水果_39健康网_癌症','癌症，截至今日，仍然是人见人怕的病症。尽管已有30％的患者能够控制或康复，但是, 大多数癌症患者最终还是离开了人世。癌症也是“富贵病”，是吃出来的病。我们可以再吃回去！或者通过吃来防癌、抗癌。那么，哪些蔬菜、水果有防癌、抗癌作用呢?','Chinese'),(2211,74,23,'http://www.ew9z.com/ciguofanlizhi-aizheng.html','刺果番荔枝与癌症 | 偏方大全','刺果番荔枝（Guanabana）是一种多刺的酸味热带水果，被视为治疗癌症的理想偏方。但它真的有效吗？这种水果的抗癌成分是什么？ 从外观上看，刺果番荔枝与番荔枝很相似。这种热带水果在世界各地有不同叫法。尽管幼果可以当做蔬菜食用，但成熟果肉能生吃或榨汁。','Chinese