_百度百科 - baike.baidu.com','臭氧层损耗与“臭氧洞”在大气层的平流层内离地面20～30km的地方是臭氧的集中层带，臭氧层是地球最好的保护伞，它吸收了来自太阳的大部分紫外线。然而，近20年的科学研究和大气观测发现：每年春季南极大气中的臭氧层一直在变薄，事实上在极地大气层中存在一个臭氧“洞”。','Chinese'),(2340,79,2,'https://wenku.baidu.com/view/46e882c389eb172ded63b7c2.html','臭氧层破坏的危害_百度文库','臭氧层破坏的危害 臭氧层耗减对全球环境造成的影响，只能是从最近 10 多年的环境情况与 10 多年前 或更早年代的情况相比，发现了某些特异的变化，就目前情况而言，还不能认为已 经产生了明显的严重 后果。','Chinese'),(2341,79,3,'https://wenku.baidu.com/view/6557b370650e52ea55189880.html','臭氧层破坏原因、危害及其防治对策_百度文库','环境化学学习与思考论文 标 专 班 学 姓 题： 业： 级： 号： 名： 臭氧层破坏原因、危害及其防治对策 应用化学 1201 班 2012310200101 徐永忠 胡先文 指导老师： 湖北·武汉 二〇一四年十一月 臭氧层破坏原因、危害及其防治对策 摘要： 臭氧层是指距离地表 15～ 50km 处 臭 氧 分 子 相 对 富 集 的 大 气 ...','Chinese'),(2342,79,4,'https://zhidao.baidu.com/question/7394630.html','臭氧层被破坏的危害 - 百度知道 - 全球最大 ...','臭氧层破坏是当前面临的全球性环境问题之一，自70年代以来就开始受到世界各国的关注。联合国环境规划署自1976年起陆续召开了各种国际会议，通过了一系列保护臭氧层的决议。','Chinese'),(2343,79,5,'https://zhidao.baidu.com/question/136386115861059125.html','臭氧层被破坏的主要原因是什么？_百度知道','人类过多地使用氯氟烃类化学物质（用CFCs表示）是臭氧层被破坏的主要原因。氯氟烃是一种人造化学物质。在第二次世界大战后，尤其是进入20世纪60年代以后，氯氟烃大量用作气溶胶、制冷剂、发泡剂、化工溶剂等。','Chinese'),(2344,79,6,'https://baike.so.com/doc/2486554-2627903.html','臭氧层_360百科','臭氧层,臭氧层是指大气层的平流层中臭氧浓度相对较高的部分，其主要作用是吸收短波紫外线。大气层的臭氧主要以紫外线打击双原子的氧气，把它分为两个原子，然后每个原子和没有分裂的氧合并成臭氧。臭氧分子不稳定，紫外线照射之后又分为氧气分子和氧原子，形成一个继续的过程臭氧氧气 ...','Chinese'),(2345,79,7,'http://www.people.com.cn/GB/huanbao/259/6404/6406/20010913/559613.html','臭氧层破坏的原因 - people.com.cn','越来越多的科学证据否定了前两种观点，而证实氯和溴在平流层通过催化化学过程破坏臭氧是造成南极臭氧洞的根本原因。 那么，氟里昂和哈龙是怎样进入平流层，又是如何引起臭氧层破坏的呢？','Chinese'),(2346,79,8,'http://wenda.tianya.cn/question/7c809c395a8eed3c','臭氧层被破坏的主要原因是什么？_地理_自然科学_地球_天涯问答_天涯社区','臭氧层破坏的原因 南极臭氧洞一经发现，立即引起了科学界及整个国际社会的高度重视。科学家需要对这一问题的许多现象和特征进行探索，如臭氧洞为什么发生在南极地区？','Chinese'),(2347,79,9,'http://www.baike.com/wiki/%E8%87%AD%E6%B0%A7%E5%B1%82','臭氧层_互动百科 - baike.com','臭氧层-臭氧层是大气层的平流层中臭氧浓度高的层次。浓度最大的部分位于20—25公里的高度处。若把臭氧层的臭氧校订到标准情况，则其厚度平均仅为3毫米左右。臭氧含量随纬度、季节和天气等变化而不同。紫外辐射在高空被','Chinese'),(2348,79,10,'https://www.xianjichina.com/news/details_98414.html','简述臭氧层破坏的原因、化学机理、形成机制、对策-贤集网资讯','大家可能都听说过臭氧层，臭氧层可以吸收大量紫外辐射，保护地球上的生物免受远紫外辐射的危害。而随着现在工业科技的发展，却对臭氧层带来的破坏，那么臭氧层破坏的原因是什么呢？本篇贤集网小编为大家简述臭氧层破坏的原因、臭氧层破坏的化学机理、臭氧层破','Chinese'),(2349,79,11,'https://gongyi.qq.com/a/20100602/000022.htm','臭氧层的耗损与破坏_腾讯公益_腾讯网','臭氧层的耗损与破坏. 在离地球表面10~50千米的大气平流层中集中了地球上90%的臭氧气体，在离地面25千米处臭氧浓度最大，形成了厚度约为3毫米的臭氧集中层，称为臭氧层。','Chinese'),(2350,79,12,'https://baike.so.com/doc/3786726-3977470.html','臭氧层破坏物质_360百科 - baike.so.com','臭氧层破坏物质,大气中的臭氧含量仅一亿分之一，但在离地面20至30公里的平流层中，存在着臭氧层，其中臭氧的含量占这一高度空气总量的十万分之一。臭氧层的臭氧含量虽然极其微少，却具有非常强烈的吸收紫外线的功能，可以吸收太阳光紫外线中对生物有害的部分(uv-b)。','Chinese'),(2351,79,13,'http://www.ccutu.com/36766.html','臭氧层被破坏的主要原因及危害_有途教育','臭氧层能够吸收太阳光，臭氧层阻挡紫外线，保护地球上的人类和动植物免遭短波紫外线的伤害。所以臭氧层犹如一件保护伞保护地球上的生物得以生存繁衍。现在地球的臭氧层已经很脆弱了，同学们知道臭氧层被破坏的原因是什么吗?又会有什么危害呢?下面有途网小编就来告诉你。','Chinese'),(2352,79,14,'http://cn.gwarming.com/link/ozon.html','全球变暖－臭氧层的破坏','很久以前，地球没有臭氧层的时代，因太阳的紫外线直接照射到地球，所以地球上没有任何生物。而当今，我们人类正在破坏臭氧层。我们将说明臭氧层被破坏的原因及对策，氟利昂等。','Chinese'),(2353,79,15,'http://wenda.so.com/q/1361741008066665','臭氧层被破坏的危害_360问答 - wenda.so.com','臭氧层被破坏的危害 具体点举出具体事例 首先，它会影响人类的健康。 臭氧层被破坏后，其吸收紫外线的能力大大降低，使得人类接受过量紫外线辐射的机会大大增加了。一方面，过量的紫外线辐射会破坏人的免疫系统，使人的自身免疫系统出现障碍，患呼吸道系统传染性疾病的人数大量增加；另 ...','Chinese'),(2354,79,16,'http://finance.ifeng.com/a/20090604/747029_0.shtml','2、臭氧层破坏 - 凤凰财经-离用户最近的 ...','2、臭氧层破坏. 实验表明，过量的紫外线辐射会使植物叶片变小，减少了植物进行光合作用的面积，从而影响作物的产量同时，过量紫外线辐射还会 ...','Chinese'),(2355,79,17,'https://iask.sina.com.cn/key/59af9c0c84aec7df125baf2a.html','臭氧层破坏- 臭氧层破坏是指什么？/ 臭氧层破坏是指什么？-爱问知识人','【臭氧层破坏】 臭氧层破坏是指什么？/ 臭氧层破坏是指什么？ 臭氧层是高空大气中臭氧浓度较高的气层，它能阻碍过多的太阳紫外线照射到地球表面，有效地保护地面一切生物的正常生长。臭','Chinese'),(2356,79,18,'https://zh.wikipedia.org/zh-hans/%E8%87%AD%E6%B0%A7','臭氧 - 维基百科，自由的百科全书','臭氧（分子式为O 3 ）是氧气（O 2 ）的同素异形体，在常温下，它是一种有特殊臭味的无色气体。 英文臭氧（Ozone）一词源自希腊语ozon，意为“嗅”。. 臭氧主要存在于距地球表面20公里的平流层下部的臭氧层中，含量约50ppm。 它吸收对人体有害的短波紫外线，防止其到达地球。','Chinese'),(2357,79,19,'https://zh.wikipedia.org/zh-hans/%E8%87%AD%E6%B0%A7%E5%B1%82%E7%A9%BA%E6%B4%9E','臭氧层空洞 - 维基百科，自由的百科全书','随着蒙特利尔议定书的严格执行，破坏臭氧层的气体释放趋势也得到缓解，经过1994年的峰值以后，一直是下降趋势，到2008年，氯原子等值气体（eeci，相当氯+45至60倍的溴），已经下降了10%，估计到2015年，南极臭氧层破洞会从目前的二千五百万平方千米减少约 ...','Chinese'),(2358,79,20,'https://iask.sina.com.cn/key/559dec45e4b0cab77fd3e688.html','臭氧层破坏物质-臭氧层破坏为什么会在两极上空？-爱问知识人','【臭氧层破坏物质】臭氧层破坏为什么会在两极上空？ 臭氧层空洞形成机制 臭氧层空洞的形成是一种与物理化学、大气化学、大气环流、气候环境和太阳紫外辐射等多种因素有关的、复杂的','Chinese'),(2359,79,21,'https://wenwen.sogou.com/question/q801704479.htm','臭氧层的破坏会造成什么样的严重后果','臭氧层是指距地球表面10至50公里的大气层中由臭氧构成的气层。臭氧是一种气体，其分子结构为三个氧原子，即o3。臭氧层的主要功能在于吸收来自宇宙的紫外线，使地球上的万物免受紫外线幅射的危害，所以，臭氧层被称之为地球的保护伞。','Chinese'),(2360,79,22,'https://www.huxiu.com/article/302375.html','臭氧空洞再度加剧，是谁在偷偷破坏臭氧层？-虎嗅网','但是，近年来的监测数据显示，又有一些未知的排放源正在偷偷破坏臭氧层。在南极洲的上空，出现了一个“臭氧层空洞”，并且逐渐扩大。议定书规定各缔约国必须逐步淘汰消耗臭氧层物质的生产使用。经过三十年的努力，臭氧层的恶化终于遏止。各国都先后推出替代方案，用对臭氧层危害更小 ...','Chinese'),(2361,79,23,'https://baike.sogou.com/v21886.htm?fromTitle=%E8%87%AD%E6%B0%A7%E5%B1%82','臭氧层 - 搜狗百科 - baike.sogou.com','臭氧层是大气层的平流层中臭氧浓度高的层次。浓度最大的部分位于20—25公里的高度处。若把臭氧层的臭氧校订到标准情况，则其厚度平均仅为3毫米左右。臭氧含量随纬度、季节和天气等变化而不同。紫外辐射在高空被臭氧吸收，对大气有增温作用，同时保护了地球上的生物免受远紫外辐射的伤害 ...','Chinese'),(2362,79,24,'https://wenda.so.com/q/1375575064064560','臭氧层的破坏会造成什么样的严重后果_360问答','臭氧层的破坏会造成什么样的严重后果 （1）色泽变化。天然水是无色透明的。水体受污染后可使水色发生变化， 从而影响感官。如印染废水污染往往使水色变红，炼油废水污染可使水色黑褐，等等，水色变化，不仅影响感官，破坏风景，有时还很难处理。','Chinese'),(2363,79,25,'https://max.book118.com/html/2016/1012/58740031.shtm','臭氧层的破坏(王雯雯).ppt - max.book118.com','臭氧层的破坏(王雯雯).ppt,什么在破坏臭氧层？ 大气平流层中距地面20-40公里的范围内有一圈特殊的大气层，这一层大气中臭氧含量特别高。大气平均臭氧含量大约是0.3ppm，而这里的臭氧含量接近10ppm，高空大气层中90%的臭氧集中在这里，所以叫它臭氧层。','Chinese'),(2364,79,26,'http://it.sohu.com/20060915/n245364693.shtml','臭氧层破坏的原因-搜狐IT','自从发现南极上空出现臭氧空洞以后，科学家们经过近十年的研究，最后得出一致的结论：臭氧层的破坏和臭氧空洞的出现，是人类自身行为造成的 ...','Chinese'),(2365,79,27,'http://cq.weather.com.cn/zt/tqztkz/2286622.shtml','臭氧层的耗损与破坏 - 重庆首页 -中国天气网','臭氧层的耗损与破坏 【字体：大 中 小】 2015-03-16 13:59:41 来源： 中国天气网重庆站 在离地球表面10~50千米的大气平流层中集中了地球上90%的臭氧气体，在离地面25千米处臭氧浓度最大，形成了厚度约为3毫米的臭氧集中层，称为臭氧层。','Chinese'),(2366,79,28,'http://www.duanmeiwen.com/zongjie/xuexi/42408.html','臭氧层破坏的原因_学习总结_短美文网','臭氧层破坏的原因-总结精选（1）： 臭氧层的破坏和臭氧空洞的出现，是人类自身行为造成的，也就是人们在生产和生活中超多地生产和使用消耗臭氧层物质(ods)以及向空气中排放超多的废气造成的。 ods的用途：用作制冷剂、喷雾剂、发泡剂、清洗剂等。 ods主要包括下列物质：cfcs','Chinese'),(2367,79,29,'https://zybang.com/question/692538bae63ab2077a52c067deffdb72.html','【破坏臭氧层的主要物质?】作业帮 - zybang.com','破坏臭氧层的主要物质? 优质解答 关于臭氧层变化及破坏的原因,一般认为,太阳活动引起的太阳辐射强度变化,大气运动引起的大气温度场和压力场的变化以及与臭氧生成有关的化学成分的移动、输送都将对臭氧的光化学平衡产生影响,从而影响臭氧的浓度和分布.而化学反应物的引人,则将直接地参与 ...','Chinese'),(2368,80,0,'https://zhidao.baidu.com/question/392002309.html','法拉利的总裁是谁?_百度知道 - zhidao.baidu.com','而Luca di Montezemolo总裁将负责法拉利母公司菲亚特的管理。影响这一变动的最主要的原因恐怕是F1车队明星车手Michael Schumacher的退役，他在上周举行的巴西大奖赛结束后正式离开，但是公司宣称他还有可能会在明年的法拉利参与一些事项。','Chinese'),(2369,80,1,'https://zhidao.baidu.com/question/688229966939162164.html','法拉利公司现任总裁是谁_百度知道','而Luca di Montezemolo总裁将负责法拉利母公司菲亚特的管理。 影响这一变动的最主要的原因恐怕是F1车队明星车手Michael Schumacher的退役，他在上周举行的巴西大奖赛结束后正式离开，但是公司宣称他还有可能会在明年的法拉利参与一些事项。','Chinese'),(2370,80,2,'https://www.yinhang123.net/zixun/renwu/2018/1175987.html','副总裁和总经理谁的职位和权力大？_银行信息港','11这个行政级别要看公司行政结构以及大小，一般小公司没有总裁，总经理即是最大行政级别和领导人，通常也是法人，法人即是在国家工商机关登记的法定负责人。 大的公司，比如很多跨国公司，会设立很多部门，行政级别','Chinese'),(2371,80,3,'http://wenda.so.com/q/1502277146213440','法拉利公司现任总裁是谁_360问答 - wenda.so.com','法拉利公司现任总裁是谁 法拉利董事会召开会议，将法拉利F1车队老总Jean Todt升职为法拉利公司CEO。 现年60岁的Todt从1994年开始就一直执掌着法拉利F1，现在据公司称他将过渡到F1董事会总经理的身份。而Luca di Montezemolo总裁将负责法拉利母公司菲亚特的管理。','Chinese'),(2372,80,4,'http://www.gaochengnews.net/wenti/24909.html','尤文图斯的老板是谁?尤文图斯的主教练叫什么？_藁城新闻网','尤文图斯的老板是谁? ... 2008年4月，阿涅利又被任命为Roveri皇家公园高尔夫乡村俱乐部的行政总裁 ... 2004年5月30日以来，他一直是菲亚特集团的董事局成员。安德雷亚-阿涅利早就被看做是尤文图斯主席潜在的接班人。','Chinese'),(2373,80,5,'http://auto.gasgoo.com/News/2017/08/17104856485670020720C102.shtml','吉利行政总裁桂生悦:无意收购FCA-盖世汽车资讯','吉利行政总裁桂生悦:无意收购fca据路透社报道，吉利汽车周三表示，它没有收购菲亚特克莱斯勒（fca）的计划，驳斥了媒体 ...','Chinese'),(2374,80,6,'http://www.sohu.com/a/165613967_612858','吉利、东风均否认收购，FCA的“接盘侠”究竟是谁？','不管“接盘侠”是谁，收购还是得保持理智. 2009年，陷入困境的克莱斯勒公司发表声明宣布申请破产保护，后来意大利汽车制造商菲亚特集团正式宣布入主。直到2014年，菲亚特才完成对克莱斯勒100%股权收购。','Chinese'),(2375,80,7,'http://www.pingxing.cn/cw/jx-esgosi/','中国法拉利总裁是谁_法拉利老总老婆_法拉利中国区总裁 - 平行之家','平行之家精选频道为广大买车用车用户精心推荐w的热门信息和流行资讯，让广大车友了解w的相关内容，学习w的相关知识，想找w的精准新闻就来平行之家！ ... 当前位置： 