/30845278.html','绿色和平组织主要机构的宗旨是什么_百度知道','绿色和平组织（green peace）是一个国际性环境保护组织，于1979年底在荷兰成立。其宗旨是保护地球生物的多样性；防止全球海洋、陆地、空气和淡水免受污染；结束所有核威慑、促进和平、全球性裁军。','Chinese'),(2429,82,1,'https://zhidao.baidu.com/question/54150166.html','除了红十字会还有什么类似的组织？做善事的？_百度知道','绿色和平独立于任何政府、组织和个人的影响，并严格不接受政府、财团或政治团体的资助。 所有费用全赖于热心市民和独立基金的直接捐助，以维持独立性。 国际上著明的绿色和平组织 ，是不是非营利性组织？ 国际绿色和平组织，其成员是全职拥护者吗？','Chinese'),(2430,82,2,'https://cn.mongabay.com/2018/06/%E7%BB%BF%E8%89%B2%E5%92%8C%E5%B9%B3%EF%BC%88%E5%9B%BD%E9%99%85%EF%BC%89%E7%BB%88%E6%AD%A2%E5%85%B6%E5%9C%A8%E6%A3%AE%E6%9E%97%E7%AE%A1%E7%90%86%E5%A7%94%E5%91%98%E4%BC%9A%E7%9A%84%E4%BC%9A%E5%91%98/','绿色和平（国际）终止其在森林管理委员会的会员资格 - 环境新闻','绿色和平（Greenpeace）的一些国际分支终止了其在森林管理委员会（FSC，以下简称森管会）的会员资格。 森管会是一个认证机构，旨在确保有效的森林管理。 “我们认为，对保护人权和完善森林管理来说，一个强健的林区作业认证体系是有益但不完善的。','Chinese'),(2431,82,3,'http://www.greenpeace.org/china/zh/about/faq/','常见问题 | 绿色和平','绿色和平是一个全球性环保组织，致力于以实际行动推进积极改变，保护地球环境与世界和平。 绿色和平成立于1971年，目前在世界40多个国家和地区设有分部，拥有超过300万名支持者。','Chinese'),(2432,82,4,'https://www.guancha.cn/Science/2014_04_18_223044.shtml','绿色和平组织人士被曝在海南夜盗科研单位水稻试验田','现在的绿色和平也有进行反捕鲸和反捕杀海豹的活动。 据绿色和平组织宣称，他们的使命是：“保护地球、环境及其各种生物的安全及持续性发展，并以行动作出积极的改变。” 他们认为，不论在科研或科技发明，都提倡有利于环境保护的解决办法。','Chinese'),(2433,82,5,'https://iask.sina.com.cn/b/414119.html','绿色和平组织-中国古代哪个学派的主张，与绿色和平组织的思想相近？ 爱问知识人','【绿色和平组织,绿色和平】中国古代哪个学派的主张，与绿色和平组织的思想相近？：4、中国古代哪个学派的主张，与绿色和平组织的思想相近？（单选） a、儒家 b、法家 c、佛家 ?','Chinese'),(2434,82,6,'http://www.greenpeace.org/china/zh/about/','关于我们 | 绿色和平','绿色和平是一个全球性环保组织，致力于以实际行动推进积极改变，保护地球环境与世界和平。 ... 来自五湖四海，为同一个梦想而走进同一个团队——在环保的道路上，绿色和平的每一位成员和志愿者都在书写着各自的精彩。 ... 绿色和平的理念是什么﹖绿色 ...','Chinese'),(2435,82,7,'https://baike.baidu.com/item/%E7%BB%BF%E5%85%9A/5901056','绿党（奥地利政党）_百度百科 - baike.baidu.com','绿党是提出保护环境的非政府组织发展而来的政党，绿党提出“生态优先”、非暴力、基层民主、反核原则等政治主张，积极参政议政，开展环境保护活动，对全球的环境保护运动具有积极的推动作用。世界上最早的绿党是1972年成立的新西兰价值党。绿党在二十世纪后半期开始在欧洲扩散，最著名 ...','Chinese'),(2436,82,8,'https://baike.baidu.com/item/%E5%85%AC%E7%9B%8A/109867','公益_百度百科 - baike.baidu.com','公益是公共利益事业的简称。这是为人民服务不求回报的一种通俗讲法。指有关社会公众的福祉和利益。“公益”一词至迟在1887年