inese'),(2563,86,15,'http://youjia.chemcp.com/YuanYouJiaGe.asp','今日国际原油价格,原油价格走势图,原油价格指数-油价网','提供今日最新国际油价及原油价格走势图,并提供国内石油,汽油,柴油最新价格及市场资讯','Chinese'),(2564,86,16,'https://www.ixueshu.com/document/ba7e545096bab254318947a18e7f9386.html','石油价格变动对中国工业经济的影响_爱学术','中国当前工业化进程严重依赖石油,作为世界制造业大国的中国现阶段对石油和以石油为原料的产品的需求具有刚性,而中国的出口产品多为一般的普通商品,其附加值相对较低,价格的上涨幅度有限。高油价产生的影响难以转移出国门,导致中国用油行业石油消费支出增长加速,利润增长减缓。','Chinese'),(2565,86,17,'http://futures.eastmoney.com/news/1522,2010052176283123.html','影响燃料油价格变动因素 _ 东方财富网','影响燃料油价格变动因素 ... 自80年代以来，非opec国家石油产量约占世界石油产量的三分之二，最近几年有所下降，但其石油剩余可采储量是有限的，并且各国的生产政策也不统一，因此其对原油价格的影响无法与opec组织相提并论。','Chinese'),(2566,86,18,'http://xbbjb.cufe.edu.cn/CN/abstract/abstract4104.shtml','石油价格变动对价格总水平的影响分析','关键词 ： 石油价格, 价格总水平, 影响 : Abstract：Crude oil is one of the most important strategic resources, and the fluctuation of crude oil price has an important influence on the general level of market prices and the economic development?I will analyze the specific influence of the fluctuation of crude oil price on the price of products of industries from input-output angle ...','Chinese'),(2567,86,19,'http://quote.eastmoney.com/qihuo/CONC.html','NYMEX原油(CL00Y) _ 期货行情 _ 东方财富网','由于该合约良好的流动性以及很高的价格透明度，nymex的轻质低硫原油期货价格被看作是世界石油市场上的基准价之一。该期货交割地位于俄克拉荷马州的库欣，这里也是美国石油现货市场的交割地。','Chinese'),(2568,86,20,'https://cn.oiloilprice.com/cn/','石油价格,油价,原油价格,石油走势图表','石油网-石油价格,最新石油价格,国际石油价格,今日石油价格,成品油价格 -中宇资讯 石油产品月度涨跌简析（2019 9） 本月国际原油市场整体呈现推涨走势，上半月美伊局势升级，令供应忧虑重燃，特别是沙特油田遇袭事件，令油价强势反','Chinese'),(2569,86,21,'https://www.zhihu.com/question/20096185','美元，原油和黄金之间的联动关系是什么？ - 知乎','在黄金、石油、美元这三者的关系里，黄金价格主要是用美元来计价，石油也同样是。上世纪70年代初，二战后搭建的世界货币体系——布雷顿森林体系崩溃之后，黄金价格与石油价格双双脱离了与美元的固定兑换比例，出现了价格大幅飙升的走势。','Chinese'),(2570,86,22,'https://zhuanlan.zhihu.com/p/49781271','影响国际原油价格的因素 - 知乎','一.供应1.opec石油输出国组织（欧佩克）的原油产量是影响油价的重要因素。该组织旨在通过制定生产目标积极管理其成员国的石油生产。从历史上看，原油价格在石油输出国组织的生产目标减少时有所增加。欧佩克成员国…','Chinese'),(2571,86,23,'https://energy.cngold.org/nybk/c2990288.html','2014年原油价格走势-金投原油网-金投网','2014年原油价格走势. 2014年原油价格雪崩式下跌，下面来分析下2014年原油价格走势到底为什么会这样。. 由于石油以美元计价，有“石油美元”之称，而随着美国11月份正式退出量化宽松货币政策，美元不断走强，以美元计价的石油价格随之走低，不仅石油价格，包括煤炭等在内的大宗商品也应声下跌。','Chinese'),(2572,86,24,'http://www.shfe.com.cn/upload/dir_20110517/15635_20110517.pdf','投机、期货市场与原油价格变动 ——正负反馈下的动态调整','投机、期货市场与原油价格变动 ——正负反馈下的动态调整 罗 呈 （上海期货交易所博士后科研工作站，上海 200122） 摘要：金融危机前后，国际原油市场剧烈的价格波动与同期有限的供需缺口的不匹配 使得原油期货市场中投机行为对油价的推高受到了高度关注。','Chinese'),(2573,86,25,'http://bbs.tianya.cn/post-develop-2017962-1.shtml','影响石油价格变动的因素_经济论坛_论坛_天涯社区','短期影响因素是通过对供求关系造成冲击或短期内改变人们对供求关系的预期而对石油价格发挥作用的。1. 石油库存变化 石油库存是石油供需关系的晴雨表。石油库存由一般性商业库存和国家战略储备构成。商业库存的主要目的是保证在石油需求出现季节...','Chinese'),(2574,86,26,'https://www.haojingui.com/opec/1193.html','OPEC成立前后至今原油价格历史数据 - 好金贵财经','1961年以前 原油价格历史数据 在国际石油市场的发展过程中,1960年9月opec成立以前,原油价格在美国和跨国公司的垄断控制下,为垄断价格. 1973年以前的低油价阶段 1960年opec成立以前,石油的生产和需求受西方国家控制,油价处于 1.5～1.8美元/桶 的垄断低水平.1960年9月,opec在伊拉克首都巴格达成立,成立后 ...','Chinese'),(2575,86,27,'https://baike.baidu.com/item/%E4%BB%B7%E6%A0%BC%E5%BC%B9%E6%80%A7/274891','价格弹性_百度百科 - baike.baidu.com','价格弹性指价格变动引起的市场需求量的变化程度。它是企业决定产品提价或降价的主要依据。一般地说，在需求曲线具有弹性的情况下，企业可以采取降价策略; 反之，企业可以采取提价策略，以保证企业收益不断增加。','Chinese'),(2576,86,28,'https://www.cngold.org/crude/','国际油价_原油价格_石油价格_汽油价格_柴油价格_中国石油网-中国黄金投资网(中国黄金网)-金投原油网-金投网','中国石油网提供今日最新国际原油价格,及国内石油价格,汽油价格,柴油价格实时查询,提供24小时国际油价实时走势图分析及 ...','Chinese'),(2577,86,29,'http://futures.eastmoney.com/news/1522,2010052176282121.html','影响天然橡胶价格变动因素 _ 东方财富网','(七)汇率变动因素 近几年由于全球经济的不稳定性，汇率变动频繁，对天然橡胶价格，尤其进出口业务有一定的影响。因此，在关注国际市场天胶行情的时候，一定要关注各国尤其是三大产胶国以及日元兑美元的汇率变动情况。','Chinese'),(2578,87,0,'http://edu.sina.com.cn/en/2014-09-19/110682226.shtml','盘点关于苏格兰的十部电影：勇敢的心(双语)_新浪教育_新浪网','梅尔·吉布森自编自导自演的史诗电影，改编自苏格兰民族英雄威廉‧华莱士的真实故事。华勒士和青梅竹马的恋人为逃避“初夜权”(贵族有权享有 ...','Chinese'),(2579,87,1,'https://baike.baidu.com/item/%E5%8B%87%E6%95%A2%E7%9A%84%E5%BF%83/26310','勇敢的心（美国1995年梅尔·吉布森执导电影）_百度百科','《勇敢的心》是派拉蒙影业公司出品的战争片，由梅尔·吉布森执导，梅尔·吉布森、苏菲·玛索、凯瑟琳·麦克马克等主演。影片以13-14世纪英格兰的宫廷政治为背景，以战争为核心，讲述了苏格兰起义领袖威廉·华莱士与英格兰统治者不屈不挠斗争的故事。1995年5月该片在美国上映。','Chinese'),(2580,87,2,'https://wenku.baidu.com/view/480dc8a7c77da26925c5b0e6.html',