对的是被同化 和吞并的命运，正是罗伯特.布鲁斯领导苏格兰人不断与英格兰进行着小规模的冲突，并在班诺克本之战中取得了 ...','Chinese'),(2590,87,12,'https://wenku.baidu.com/view/0eec2504b52acfc789ebc935.html','苏格兰经典电影欣赏_图文_百度文库','因为是英国影片，所以背景地为苏格兰，而那座偏僻的岛屿则叫做“夏日岛”，居住着一群孤傲 的苏格兰原住民，这群狂热异教徒的统治者的扮演者即是克里斯托弗·李，他们供奉的是凯尔特人的神灵，崇尚性开放， 认为性是神特别赐予的天赋，是为了缓和人类 ...','Chinese'),(2591,87,13,'http://www.mafengwo.cn/gonglve/ziyouxing/2744.html','《神奇动物在哪里》取景地&动物大盘点! - 马蜂窝','苏格兰高地是一片神奇的土地，绵延的海岸线、古老的城堡、起伏的山脉、自由生长的动物和穿着kilt裙吹风笛的男人，这里满足了你对苏格兰所有的想象。一路向北，高地的景色在天空岛达到了极致，阴晴不定的天气配搭无与伦比的美景，远离繁华喧嚣。','Chinese'),(2592,87,14,'https://max.book118.com/html/2017/0720/123082676.shtm','《勇敢的心》影片分析.doc - max.book118.com','并且，影片中时常出现苏格兰山川风光的大全景，配以苏格兰风笛的悠扬，使人感受到苏格兰的大好河山和自由空气的清新愉悦，更加了解了斗士们为何而战。 影片主色调为棕褐色，这主要是由战争场面所主导。','Chinese'),(2593,87,15,'https://www.zhihu.com/question/27006543','有哪些经典的影视背景音乐？ - 知乎 - zhihu.com','小时候真的以为这首歌是“万人迷”唱的，毕竟她太风情. 来易来去难去 数十载的人世游 分易分聚难聚 爱与恨的千古愁. 这个故事给我的印象很深刻，以至于想起《粉红女郎》脑海中只剩下这首歌和这个故事。','Chinese'),(2594,87,16,'http://www.9tour.cn/info/3054/327344.shtml','到苏格兰看《勇敢传说》中的壮丽风景_新闻资讯_九游网','《勇敢传说》在描述苏格兰惊险刺激的神话传说的同时，亦展现了那里奇异的风光、迷人的风土人情、独有的遗产、雄伟的城堡以及壮丽的景观。 《勇敢传说》以古老的苏格兰作为历史背景，影片中不乏苏格兰高地开满石楠花的山丘和雄伟的山巅。','Chinese'),(2595,87,17,'http://baike.so.com/doc/3250863-3425349.html','勇敢的心_360百科','勇敢的心,《勇敢的心》（Braveheart）是派拉蒙影业公司出品，由梅尔·吉布森执导，梅尔·吉布森、苏菲·玛索、凯瑟琳·麦克马克等主演的战争片。 影片以13-14世纪英格兰的宫廷政治为背景，以战争为核心，讲述了苏格兰起义领袖威廉·华莱士与英格兰统治者不屈不挠斗争的故事。','Chinese'),(2596,87,18,'https://zhidao.baidu.com/question/135806714.html','勇敢的心 苏格兰取得自由了吗_百度知道','影片以13-14世纪英格兰的宫廷政治为背景，以战争为核心，讲述了苏格兰起义领袖威廉·华莱士与英格兰统治者不屈不挠斗争的故事。 扩展资料. 1、创作背景','Chinese'),(2597,87,19,'http://travel.sina.com.cn/world/2012-07-04/1524177964.shtml','苏格兰赋予迪士尼冒险动画片《勇敢传说》灵感_新浪旅游_新浪网','《勇敢传说》在描述苏格兰惊险刺激的神话传说的同时，亦展现了这里奇异的风光、迷人的风土人情、独有的遗产、雄伟的城堡以及壮丽的景观。 《勇敢传说》以古老的苏格兰作为历史背景，影片中不乏苏格兰高地开满石楠花的山丘和雄伟的山巅。','Chinese'),(2598,87,20,'http://cul.qq.com/a/20140919/016084.htm','三部电影读懂苏格兰和英格兰的爱恨情仇_文化_腾讯网','三部电影读懂苏格兰和英格兰的爱恨情仇 风云际会的大时代，艺术从未缺席。以苏格兰与英格兰“爱恨情仇”为背景的文艺作品一直连绵不绝。从 ...','Chinese'),(2599,87,21,'https://baike.baidu.com/item/%E5%8B%87%E6%95%A2%E4%BC%A0%E8%AF%B4','勇敢传说_百度百科 - baike.baidu.com','影片于2012年6月19日在中国内地上映。影片以中世纪的苏格兰为舞台，讲述主人公梅莉达抗争传统束缚，为争取自己获得真爱的权利，从而改变自己命运的故事。影片获得了第85届奥斯卡金像奖最佳动画长片奖和第70届金球奖最佳动画长片奖两大桂冠。','Chinese'),(2600,87,22,'http://group.mtime.com/killyou/discussion/1185390/','《百夫长》：苏格兰的风情画 《镜中虚度》官方论坛 电影','久而久之，屡屡的小规模败退使得罗马损失惨重，鉴于此，派出了屡创奇功的第九军团要不惜一切代价清剿皮克特人，妄图一举平定苏格兰。在这个背景之下，影片的故事由一个名为昆图斯·迪亚斯的百夫长开始讲述，正如他所说的，这既不是开始，也不是结束。','Chinese'),(2601,87,23,'https://bbs.tiexue.net/post_8299121_1.html','[原创]苏格兰独立，美国人罪魁祸首 - 世界历史 - 铁血社区','影片以13-14世纪英格兰的宫廷政治为背景，以战争为核心，讲述了苏格兰起义领袖威廉·华莱士与英格兰统治者不屈不挠斗争的故事。 这下估计大家都清楚了吧？在这部影片当时在全球热播的时候，英国政府大为愤怒。','Chinese'),(2602,87,24,'https://bbs.qyer.com/thread-3092846-1.html','【逆光英国】电影与摇滚乐中的大不列颠｜伦敦、苏格兰与利物浦的笔记＋Vlog - 英国/爱尔兰 | 环游欧洲 - 论坛 ...','从没有一部电影的背景乐我每首都能跟着唱出来，从没有一部电影让我泪如雨下，《波西米亚狂想曲》是个例外。这部电影讲述了英国摇滚乐队The Queen主唱Freddie Mercury的生平，他的传奇故事与他的嗓音一样让人着迷。 ... 这几天在苏格兰的好运气看来是用到头了 ...','Chinese'),(2603,87,25,'https://bbs.qyer.com/thread-1360644-1.html','苏格兰高地两日游 - 环游欧洲 | 穷游折扣 | 旅行摄影 - 论坛 - 穷游网','看过影片《勇敢的心》( Braveheart )吗？它就是是以苏格兰高地旅游胜景斯特灵城堡为拍摄主要背景的。 影片算得上是了解苏格兰与英格兰关系简史的入门级电影。 这座城堡在整个苏格兰乃至大不列颠都是标志性的建筑。','Chinese'),(2604,87,26,'http://www.baike.com/wiki/%E8%8B%8F%E6%A0%BC%E5%85%B0%E7%8E%9B%E4%B8%BD%E5%A5%B3%E7%8E%8B%5B%E7%94%B5%E5%BD%B1%5D','苏格兰玛丽女王[电影]_互动百科','苏格兰玛丽女王[电影]-《玛丽女王》是由乔希·罗克执导，西尔莎·罗南、玛格特·罗比主演的剧情片，于2018年11月15日在美国电影学会电影节首映 。 该片改编自约翰·盖伊的人物传记《忠于内心：玛丽女王的生活》，讲述了16岁的','Chinese'),(2605,87,27,'https://movie.douban.com/subject/1294639/','勇敢的心 (豆瓣) - movie.douban.com','影片中的华莱士本来就是一个美国式的英雄，他的意识形态和做事方式非常美国。而历史上的他，我相信在文化层面也很难是一个英国式的反抗者--罗宾汉才是。 故事的背景无非是一个舞台，用来让导演表达自己内心的舞台。','Chinese'),(2606,87,28,'http://sports.sohu.com/20170608/n496236801.shtml','追溯英苏大战历史背景 先谈苏格兰近代独立始末-搜狐体育','20世纪英国首相撒切尔夫人的去工业政策对苏格兰打击极大，影响持续至今，让苏格兰经济难以恢复（影片《猜火车》讲述的就是那个背景）。 ...','Chinese'),(2607,87,29,'https://www.zhihu.com/question/20327564','如何评价电影《勇敢的心》？ - 知乎 - zhihu.com','在《勇敢的心》中，Horner选择了苏格兰的民族乐器风笛来为整部电影做铺垫，悠扬的风笛将观众在电影开头就完全带入了苏格兰那高高的群山峻岭之间，大气而缠绵。Main Title是影片的序曲，同时也是华莱士一生的写照。','Chinese'),(2608,88,0,'https://movie.douban.com/celebrity/1008070/','基努·里维斯 (豆瓣) - movie.douban.com','基努·里维斯出生在黎巴嫩首都贝鲁特，父亲山谬·里维是美国地质学家，母亲派翠西亚·泰勒是英国人，曾以夜总会舞女为职。他的父亲出生在夏威夷，祖母有中国、夏威夷、葡萄牙血统，而祖父是田纳西州出生的爱尔兰裔美国人。','Chinese'),(2609,88,1,'https://baike.baidu.com/item/%E5%9F%BA%E5%8A%AA%C2%B7%E9%87%8C%E7%BB%B4%E6%96%AF','基努·里维斯_百度百科 - baike.baidu.com','基努·里维斯（Keanu Reeves），1964年9月2日出生于黎巴嫩贝鲁特，加拿大演员、制作人、导演。1980年，16岁的他以一支可口可乐广告进入演艺圈，然后他在舞台剧《狼孩》中得到了平生第一个角色。1994年，他主演的《生死时速》上映。1999年，他开始主演《黑客帝国》系列电影。','Chinese'),(2610,88,2,'https://zhidao.baidu.com/question/63928411.html','基努里维斯主演的电影，所有的，谢谢_百度知道','1994年基努-里维斯凭着《生死时速》一举成名，他与生俱来的优雅气质使他迅速成了美国及亚洲各地亿万观众心目中的偶像。 基努·里维斯是一个混血儿，身高183公分，1964年9月2日出生于黎巴嫩的贝鲁特。','Chinese'),(2611,88,3,'https://www.zhihu.com/question/334515207','如何评价基努里维斯的电影《疾速备战》？ - 知乎','“疾速”系列与基努·里维斯是两相成全的关系。基努靠着三部片子让观众重新注意到他，“疾速”也因为颇具新意的风格与基努的话题效应，成为喜闻乐见的系列动作电影。','Chinese'),(2612,88,4,'https://baike.baidu.com/item/%E9%BB%91%E5%AE%A2%E5%B8%9D%E5%9B%BD/34564','黑客帝国（基努·里维斯主演的系列电影）_百度百科','《黑客帝国》是由华纳兄弟公司发行的系列动作片，该片由沃卓斯基兄弟执导，基努·里维斯、凯莉·安妮·莫斯、劳伦斯·菲什伯恩等主演。影片已上映的有三部，为《黑客帝国》、《黑客帝国2：重装上阵》、《黑客帝国3：矩阵革命》，分别于1999年3月31日、2003年5月15日、2003年11月5日在美国上映。','Chinese'),(2613,88,5,'https://baike.so.com/doc/2430465-2569377.html','基努·里维斯_360百科 - baike.so.com','基努·里维斯 基努·里维斯生父在他幼年时便离开，因贩卖毒品入狱；女友塞姆于1999年生下他们的女儿，但不幸的是女儿出生时便是死胎；两年后，塞姆在车祸中丧生；而他从小相依为命的妹妹得了白血病；1988年，他在驾驶重型摩托车时，因车祸撞断肋骨 。','Chinese'),(2614,88,6,'http://people.mtime.com/913928/filmographies/','基努·里维斯 参与影片及作品列表 – Mtime时光网','饰 Himself - #68: Box Office Hit to Box Office Flop: Johnny Mnemonic (archive footage) 主演： Chad Doreck Matt Weinhold','Chinese'),(2615,88,7,'http://news.sina.com.cn/o/2018-11-27/doc-ihpevhck8898692.shtml','《克隆人》：浅尝辄止的科幻伦理片|克隆人|基努|李维斯_新浪新闻','《克隆人》当然是一部虚构电影，但剧情有意无意地让人联想到对基努·李维斯真实生活的指涉，倒让影片有了超出于浅尝辄止的b级科幻伦理片的 ...','Chinese'),(2616,88,8,'http://people.mtime.com/913928/','基努·里维斯 Keanu Reeves - 时光网','基努·里维斯高中时期曾以两年时间研修表演艺术课程，还成为学校剧团的台柱。16岁那年（1981年），里维斯以一支可口可乐广告进入演艺圈，而后参加多伦多电视台.. 1989 美国青少年偶像. 里维斯在20岁那年，只身前往他所向往的好莱坞发展。','Chinese'),(2617,88,9,'http://www.iqiyi.com/lib/s_214833405.html','基努·李维斯 