cds/1cp/doc4 限量分发 巴黎，2006 年 12 月 1 日 原件：英 文 临时议程项目 5 批准 2007 年《禁用清单--国际标准》 概 要 文件： 《反对在体育运动中使用兴奋剂国际公约 ...','Chinese'),(2738,92,10,'https://zhuanlan.zhihu.com/p/21951244','我国运动员使用兴奋剂的历史，现况和未来。 - 知乎','再更新：孙杨没有进入1500米决赛。希望那些喷子口下留情。游泳要么远程占优，要么短程占优。孙杨这种长短都拿过冠军打破记录的寥寥无几。他已经很伟大了。别出现那种骂刘翔“刘残废”类似的二逼言论。另外，仔细看…','Chinese'),(2739,92,11,'https://www.zhihu.com/question/49429377','中国运动员游泳运动员到底有没有使用兴奋剂？ - 知乎','很多运动队吃兴奋剂都是群体有组织行为，特别是游泳队，不吃都不行。创新和科学训练的本质其实就是研究如何吃药。其实这是世界性的问题，大家都心照不宣，煞有介事的反兴奋剂而已。','Chinese'),(2740,92,12,'http://bjgy.chinacourt.gov.cn/article/detail/2011/04/id/881056.shtml','《反对在体育运动中使用兴奋剂国际公约》的由来及其影响-北京法院网','制定《反对在体育运动中使用兴奋剂国际公约》的一个重要成果就是加强了与反对在体育运动中使用兴奋剂的体育团体和其他组织的联系。这表明，在国际法的某些领域，政府可以和非政府的民间团体进行合作，为了全社会的利益而共同制定某些国际法规则。','Chinese'),(2741,92,13,'https://www.ixueshu.com/document/f14eebe3c0c96356.html','体育运动中“兴奋剂使用”的伦理思考_爱学术','兴奋剂使用已经成为现代体育运动 ,特别是高水平体育运动与竞赛中最大的问题。由于兴奋剂使用的历史时期长 ,使用背景复杂 ,使用药物和技术日益高科技化 ,国际反兴奋剂使用的斗争面临许多的困难。虽然“反”和“堵”是世界体坛的主旋律 ,但也不乏建议“堵”与“疏”并举的声音。','Chinese'),(2742,92,14,'https://zhuanlan.zhihu.com/p/22448700','为什么运动员会使用糖皮质激素作为兴奋剂？ - 知乎','我搬运了点东西解释一下运动员究竟为什么使用糖皮质激素。 众所周知，急性运动后皮质醇的水平是升高的，即身体是主动提高皮质醇分泌的。这是运动应激过程的一部分，目的是维持运动表现。','Chinese'),(2743,92,15,'http://baike.so.com/doc/4473213-4682153.html','兴奋剂_360百科','兴奋剂,兴奋剂在英语中称\"Dope\"，原义为\"供赛马使用的一种鸦片麻醉混合剂\"。由于运动员为提高成绩而最早服用的药物大多属于兴奋剂药物刺激剂类，所以尽管后来被禁用的其他类型药物并不都具有兴奋性(如利尿剂)，甚至有的还具有抑制性(如b-阻断剂)，国际上对禁用药物仍习惯沿用兴奋剂的称谓。','Chinese'),(2744,92,16,'https://max.book118.com/html/2017/0427/102827027.shtm','《反对在体育运动中使用兴奋剂国际公约》.PDF','使用兴奋剂已成为当今体育运动的主要威胁 之一。它伤害运动员、破环公平竞赛与竞争、给体育运动的信誉带来不可弥补的损害。然 而，使用兴奋剂不仅给相关运动员或体育运动本身带来伤害，它破坏了体育运动内在的价 值观，因此影响到社会的各个层面。','Chinese'),(2745,92,17,'https://iask.sina.com.cn/key/5a18db6a84aedabb5c0907d7.html','运动的坏处-使用兴奋剂运动减肥可以么？/使用兴奋剂运动减肥可以么-爱问知识人','运动的坏处相关问答. 问： 使用兴奋剂运动减肥可以么？ 答： 兴奋剂是禁药 吃多了会有瘾的 而且破坏身体机能的 容易引发肥胖症和糖尿病 答： 使用兴奋剂会对人的身心健康产生许多直接的危害。 使用不同种类和不同剂量的禁用药物，对人体的损害程度也不相同。一般说来，使用兴奋剂的主要 ...','Chinese'),(2746,92,18,'http://www.sohu.com/a/110325326_100663','浅谈体育运动中的兴奋剂 - sohu.com','兴奋剂做为一种短期提高体育成绩，但对身体造成极度危害的药物，已经象幽