756,92,28,'http://www.chinada.cn/contents/704/11138.html','《反对在体育运动中使用兴奋剂哥本哈根宣言》','注意到使用兴奋剂侵蚀了体育运动的价值； 为运动员在体育运动中使用违禁物质和违禁方法，以及由此对未来体育运动产生的影响感到忧虑； 不曾忘记各国体育组织和国际体育组织制定的反兴奋剂规章、政策和通过的多次反兴奋剂宣言；','Chinese');
