du.com/article/e52e361543f1ee40c60c5111.html','皮肤过敏能吃什么不能吃什么-百度经验','皮肤过敏能吃什么不能吃什么,皮肤过敏是一种很常见的过敏形式，有20%的人有皮肤过敏现象。皮肤过敏又称为“敏感性”皮肤。从医学角度讲，皮肤过敏主要是指当皮肤受到各种刺激如不良反应的化妆品、化学制剂、花粉、某些食品、污染的空气等等，导致皮肤出现红肿、发痒、脱皮及过敏性皮炎 ...','Chinese'),(2857,96,9,'https://zhidao.baidu.com/question/40871709.html','什么叫做食物过敏？_百度知道','食物过敏，即食物变态反应，是一种特殊的病种。通俗地说，就是指某些人在吃了某种食物之后，引起身体某一组织、某一器官甚至全身的强烈反应，以致出现各种各样的功能障碍或组织损伤。','Chinese'),(2858,96,10,'https://baike.pcbaby.com.cn/qzbd/9195.html','【食物过敏】宝宝食物过敏症状_婴儿食物过敏症状_如何预防食物过敏_亲子百科_太平洋亲子网','宝宝们由于肠胃道黏膜的保护功能不完全成熟，外来蛋白极易通过，同时由于免疫功能不完善，容易发生呕吐、皮肤红斑、气喘等食物过敏症状。下面我们就为大家具体介绍与宝宝食物过敏症状相关的内容。','Chinese'),(2859,96,11,'https://zhuanlan.zhihu.com/p/30201435','食物过敏原检测：抽一管血就能查得准？ - 知乎','51岁的张大叔接连出现了三次急性过敏。[1]每一次，他的嘴唇都肿成了两瓣大香肠。每一次，他的胃部都剧烈地抽搐。每一次，他都出现哮喘和低血压。 张大叔仔细回忆了自己吃的食物；他发现，每一次过敏都是在他吃了「…','Chinese'),(2860,96,12,'http://bbs.foodmate.net/thread-839382-1-1.html','八大类食品过敏原的食物 - 食品安全与风险分析 - 食品论坛 - Powered by Discuz!','八大类食品过敏原的食物因进食某种正常状态的食物引起的不正常反应，如荨麻疹、湿疹、哮喘、过敏性鼻炎、血管性水肿、皮炎、腹胀、腹泻或腹痛、偏头痛等，而且这些反应只在 ... 八大类食品过敏原的食物 ,食品论坛','Chinese'),(2861,96,13,'http://www.xinhuanet.com/politics/2019-08/11/c_1124861784.htm','食物过敏增多 如何化解“舌尖上的危险”？-新华网','新华社北京8月11日电（记者田晓航）每年8月的第二周是“中国过敏防治周”，今年的主题为“关注食物过敏”。随着社会经济发展和生活方式不断变化，食物过敏有所增加，如何化解“舌尖上的危险”？ 北京协和医院尹佳教授 ...','Chinese'),(2862,96,14,'http://www.sohu.com/a/253340540_451210','食物过敏(1)_过敏原 - sohu.com','食物本来是为人体提供营养的,但有些人却在食用某些食物时遇到了麻烦,轻则出现胃肠不适、皮肤瘙痒或皮疹，重则危及生命,这就是食物过敏。 花生过敏是食物过敏导致死亡的首要原因，而且患者往往是终生的，只有10%的过…','Chinese'),(2863,96,15,'https://www.pingguolv.com/bj/100981.html','抗过敏的食物_抗过敏吃什么好_抗皮肤过敏的食物有哪些_食谱推荐_苹果绿','如果你是过敏体质的话，在易过敏的季节，最好是服用一些具有抗过敏效用的食物或者药物。 怎么才能抗过敏. 1、远离过敏原. 过敏原是过敏发生的必要条件，离开了过敏原就可以避免过敏的发生，这是一种经济而有效的办法，但不是对所有的过敏病人都有用。','Chinese'),(2864,96,16,'http://www.sohu.com/a/200563048_99915752','科普：8种最常见的食物过敏？ - sohu.com','大多数人吃饭的最糟糕的事情是消化不良的恶性病例。但是对于某些人来说，吃错的东西可能会导致荨麻疹，肿胀，呕吐甚至死亡。 根据食品过敏倡议组织，多达1,200万美国人患有食物过敏，其中包括每13名18岁以下的儿童中有1 ...','Chinese'),(2865,96,17,'https://e.thecover.cn/shtml/tfzb/20190808/112619.shtml','这些食物过敏 你必须了解一下 - e.thecover.cn','”杨医生表示，食物过敏需用药或尝试脱敏治疗，“但目前都没有特别有效的根治方法，只能达到临床控制。” 食物过敏 食物过敏是指机体摄入食物后引起的异常免疫反应。 桃子是水果中的第一位过敏原，对桃过敏的人，最好的办法就是不要吃','Chinese'),(2866,96,18,'http://news.bioon.com/article/6742330.html','食物过敏增多如何化解“舌尖上的危险”？ - 医疗健康专区 - 生物谷','每年8月的第二周是“中国过敏防治周”，今年的主题为“关注食物过敏”。随着社会经济发展和生活方式不断变化，食物过敏有所增加，如何化解 ...','Chinese'),(2867,96,19,'http://www.baike.com/wiki/%E9%A3%9F%E7%89%A9%E8%BF%87%E6%95%8F','食物过敏_互动百科','食物过敏-食物过敏会出现多种症状，包括皮肤、消化道、呼吸道及心血管系统等不适。任何食物都有可能成为过敏原。','Chinese'),(2868,96,20,'http://zzk.fh21.com.cn/symptom/detail/6477.html','食物过敏,食物过敏是怎么引起的,食物过敏吃什么好,食物过敏如何治疗_症状库_飞华健康网','食物过敏也称为食物变态反应或消化系统变态反应、过敏性胃肠炎等，是由于某种食物或食品添加剂等引起的IgE介导和非IgE介导的免疫反应，而导致消化系统内或全身性的变态反应。','Chinese'),(2869,96,21,'https://baike.pcbaby.com.cn/long/30342.html','哪些食物容易过敏_亲子百科_太平洋亲子网','除此之外，食物中所含的过敏原可能存在一定的相互交叉性。简单地说，就是对某种食物过敏的人对另一种食物也会过敏，这是因为这两种食物含有相同的致敏原，从而导致了不同的食物会发生相同的食物变态反应。','Chinese'),(2870,96,22,'https://www.cndzys.com/renqun/teshu/1745770.html','【食物过敏会引起发烧吗】_影响_危害-大众养生网','食物过敏在日常生活中是比较常见的现象，不少人对于一些特定的食物，都会有过敏反应，对于抵抗力比较低的婴幼儿来说，尤其如此。不少人都想知道，食物过敏会不会导致患者出现发烧的症状，其实食物过敏一般不会引起发烧的。','Chinese'),(2871,96,23,'https://www.youlai.cn/ask/514710.html','食物过敏怎么办-有来医生 - youlai.cn','如果发现对某种食物过敏，其处理如下：第一、要停止食用该种食物。第二、要禁食海鲜和辛辣的食物。第三、注意避免热刺激，比如不要热水洗澡，居住的环境也不能太热。第四、要根据皮损的严重程度使用药物，如果皮损比较轻，可以仅外涂炉甘石洗剂。','Chinese'),(2872,96,24,'https://www.wukong.com/question/6407713049146294530/','婴儿对哪些食物容易过敏？如何避开这些过敏食物？-悟空问答','婴儿对哪些食物容易过敏？如何避开这些过敏食物？食物过敏，不可不防。要绕开食物过敏首先要知道过敏源在哪里，巧妙地绕开过敏源才是王道。婴儿对哪些食物容易过敏？如何避开这些过敏食物？:前几天，和一个好朋友带娃聚餐，本想找一个适合孩子的餐厅。','Chinese'),(2873,96,25,'https://www.cndzys.com/yinshi/changshi/1590679.html','【抗过敏食物第一名】_怎么吃_营养饮食-大众养生网','想要解决皮肤过敏问题，我们可以通过一些食物来预防下，那么抗过敏食物第一名是哪种食物呢？ 炎炎夏日，高温的天气容易让过敏的肌肤在表皮越演越多，同时，强烈的紫外线辐射，都对我们的肌肤造成伤害，导致过敏。','Chinese'),(2874,96,26,'https://www.zhihu.com/question/20008817','过敏有禁忌的食物吗？ - 知乎 - zhihu.com','食物过敏的话禁忌食物很明显吧，过敏测试一目了然了。 不是食物过敏但是对花粉、冷空气、粉尘之类的过敏的人（好吧，也就是过敏体质，也叫特禀体质）一般肝功能也不好，保证饮食清淡的同时，多吃点养肝护肝的食物吧。','Chinese'),(2875,96,27,'https://www.youlai.cn/yyk/article/14754.html','何谓食物过敏？-有来医生 - youlai.cn','一般情况下，食物过敏反应在婴幼儿中的发病率明显高