是在城市环境中。 在同一国家内、同一社区内甚至同一家庭内营养不良和肥胖共存的情况并不罕见。','Chinese'),(2942,99,4,'https://zhidao.baidu.com/question/1509788899035883340.html','肥胖会导致什么疾病呢？_百度知道','肥胖会导致如下疾病： 1、肥胖易导致各种血管疾患. 身体肥胖的人除了皮下脂肪堆积过多之外，内脏和遍布全身的血管内也都堆满了脂肪，所以容易引起多种血管疾患，特别是对健康和生命危害严重的心脑血管疾患。','Chinese'),(2943,99,5,'https://baike.baidu.com/item/%E8%82%A5%E8%83%96/223046','肥胖_百度百科 - baike.baidu.com','肥胖是指一定程度的明显超重与脂肪层过厚，是体内脂肪，尤其是甘油三酯积聚过多而导致的一种状态。由于食物摄入过多或机体代谢的改变而导致体内脂肪积聚过多造成体重过度增长并引起人体病理、生理改变或潜伏。评定标准：肥胖度=（实际体重-标准体重）÷标准体重×±100%。','Chinese'),(2944,99,6,'https://zhidao.baidu.com/question/691372691239020964.html','肥胖会引起什么疾病 10 - 百度知道','1. 心血管疾病:肥胖者更容易患上高血压、心脏病等心脑血管疾病. 2. 肝病:肥胖症由于体内脂肪在肝脏的堆积,从而形成脂肪肝,又称作脂肪肝变形.严重的是,脂肪肝还会进一步恶化,引发肝炎、肝硬化疾病.','Chinese'),(2945,99,7,'http://fitness.39.net/special/htcz/ht11/','肥胖会引起哪些疾病_肥胖与疾病_39健康网','肥胖会引起哪些疾病？肥胖与疾病的关系是怎样的？研究数据显示，超一半肥胖者有慢性病，肥胖容易导致糖尿病、高血压、冠心病等，同时肥胖还会影响一个人的寿命，而减肥是治疗这些疾病的基础。下面39减肥编辑教你如何健康地控制体重和预防疾病。','Chinese'),(2946,99,8,'https://jingyan.baidu.com/article/c910274b48cf8dcd371d2d57.html','肥胖导致的疾病有哪些-百度经验','肥胖导致的疾病有哪些,肥胖会导致很多疾病发生，那么有哪些疾病呢？下面就走进看看吧。','Chinese'),(2947,99,9,'https://www.who.int/topics/obesity/zh/','世界卫生组织 | 肥胖','超重和肥胖是包括糖尿病、心血管疾病和癌症在内的若干慢性病的主要风险因素。超重和肥胖问题一度被视为仅限于高收入国家，如今在低收入和中等收入国家，尤其是城市环境中，呈急剧上升的趋势。','Chinese'),(2948,99,10,'http://www.sohu.com/a/257900109_400759','肥胖其实是一种疾病！_研究 - sohu.com','肥胖其实是一种疾病. 世界肥胖协会在2017年正式宣布肥胖是一种疾病，因为它会导致诸多健康问题。 2017年8月，瑞典的一项研究对130万男性进行了30年的追踪，该研究发现，在18岁的时候最健康的人相比于这个年龄最不健康的人，过早死亡的风险低51%。','Chinese'),(2949,99,11,'https://jingyan.baidu.com/article/a378c960998a4bb3282830c1.html','肥胖带来的八大危害-百度经验','肥胖是发生糖尿病的重要危险因素之一。在2型糖尿病病人中,80%都是肥胖者。而且,发生肥胖的时间越长,患糖尿病的几率就越大。 引起骨关节疾病. 肥胖可能引起的骨关节疾病主要有三种:骨性关节炎、糖尿病性骨关节病和痛风性骨关节病。','Chinese'),(2950,99,12,'https://blog.csdn.net/deepgener/article/details/84572549','Science| 深度解析肠道菌群与肥胖 - deepgener的博客 - CSDN博客','肥胖是多种疾病共存的主要危险因素，包括Ⅱ型糖尿病、非酒精性脂肪肝和缺血性心血管疾病。因此，肥胖流行对人预期寿命，生活质量和保健费用有着深远的影响。 那么到底是什么导致了肥胖在不超过一代人里迅速增长呢 ？本文是转化医学大奖得主Christoph A ...','Chinese'),(2951,99,13,'https://zhuanlan.zhihu.com/p/34448002','营养几何：解决肥胖和心血管疾病的新方法 - 知乎','近几十年来oacd（肥胖和心血管疾病）研究的升级，外加技术进步，产生了大量的数据和知识，然而限制在于如何才能有形成马让迪的“推测和巧妙假设”的理论，它有助于统一观察结果，确定未来的研究的侧重点，并更好地指导预防和管理oacd的研究成果的应用。','Chinese'),(2952,99,14,'http://www.360doc.com/content/16/1112/08/6228831_605800440.shtml','中国成人超重和肥胖症预防控制指南（试行）','前言 肥胖目前在全世界呈流行趋势。肥胖既是一个独立的疾病, 又是 2 型糖尿病、心血管病、高血压、中风和多种癌症的危险因素，被世界卫生组织列为导致疾病负担的十大危险因素之一。 我国目前体重超重者已达 22.4%, 肥胖者为 3.01%, 因此预防和控制肥胖症已成为刻不容缓的任务。','Chinese'),(2953,99,15,'https://news.mydrivers.com/1/640/640303.htm','体内脂肪对心血管疾病和糖尿病的发展具有重要意义-脂肪,心血管疾病,糖尿病,肥胖 ——快科技(驱动之家旗下媒体 ...','近日据外媒报道，一个国际研究小组发表在《柳叶刀糖尿病与内分泌学》上的一份立场声明指出，体内脂肪过多是心血管疾病和2型糖尿病发展的关键 ...','Chinese'),(2954,99,16,'https://baike.pcbaby.com.cn/qzbd/953809.html','【肥胖】肥胖的原因_肥胖的危害_怎样预防肥胖症_亲子百科_太平洋亲子网','儿童期肥胖95%以上属于单纯性肥胖。儿童单纯性肥胖是一种与生活方式密切相关，以过度营养、体力活动不足导致全身脂肪组织过度增生性的疾病。单纯性婴儿肥胖症的治疗原则主要是饮食和运动。实际上，治疗的强度要比预防的强度要大一些。','Chinese'),(2955,99,17,'https://jf.99.com.cn/fpyjb/244-6.htm','肥胖与疾病_99健康网','介绍与肥胖有关的各种疾病，例如肥胖与糖尿病，肥胖与高血压，肥胖与心脏病等肥胖的危害。 帮助人们重视健康减肥，树立良好的生活饮食习惯。 99健康网首页 男性 女性 育儿 老人 新闻 工具 中医 保健 减肥 美容 饮食 心理 急救 自测 查疾病 找医生 找医院 ...','Chinese'),(2956,99,18,'https://new.qq.com/omn/20190806/20190806A02TJA00.html','《柳叶刀》子刊：确诊肥胖与30种疾病有关！肥宅还能快乐多久？','谈到肥胖，人们或多或少都能意识到其对健康状况的不良影响。但具体和哪些疾病相关，有多大程度的影响却所知不详。 近日，《柳叶刀》子刊The Lancet Digital Health发表了一项针对体重指数（BMI）和多种疾病关联的研究。这项 ...','Chinese'),(2957,99,19,'http://fitness.39.net/a/160715/4901030.html','肥胖的危害 哪些疾病和肥胖有关_39健康网_减肥','此外，肥胖还会引起很多其他疾病： 肥胖的人由于血中胆固醇含量较高，胆汁浓度相对增加，再加上腹部脂肪的压迫，胆汁排法障碍，最易引起胆结石。 肥胖者往往伴有肝脏内脂肪堆积，易引起脂肪肝、肝硬化。','Chinese'),(2958,99,20,'http://www.biomed.ecnu.edu.cn/98/d1/c9347a104657/page.htm','肥胖与代谢性疾病实验室 - biomed.ecnu.edu.cn','阐明棕色和米色脂肪代谢调控的信号通路网络，确定机体和细胞在不同生理状况和环境因素下维持代谢稳态的分子机制，成为防治肥胖和代谢性疾病，以及肿瘤和衰老等重大疾病的重要理论基础。 图1. 脂肪细胞分类和特性. 1.','Chinese'),(2959,99,21,'https://zhuanlan.zhihu.com/p/38270649','肥胖症也是心理疾病 - 知乎 - zhuanlan.zhihu.com','肥胖和肥胖症是两个完全不同的概念。前者是常态性的饮食或行为习惯的结果，只要靠认知和毅力即可控制（管住嘴和脚）；后者属于病态性的心理习惯，秋水理论称之为反习惯，如失眠症、手淫症、口吃病、强迫症等。与失…','Chinese'),(2960,99,22,'http://baijiahao.baidu.com/s?id=1632060431738777492','肚子赘肉怎么减，腹型肥胖与疾病的相关性！','然而，更可怕的是，它竟跟这么多的病症扯上了关系。近日，英国医学杂志上发表了一篇关于腹型肥胖与疾病相关性的文章，研究涉及近2290万亚洲成年人，评价了腹部肥胖和人体23个特定部位疾病的相关性。瞧！肚子上长赘肉，是多么可怕的一件事！','Chinese'),(2961,99,23,'https://www.zhihu.com/question/38735379','孩子肥胖会导致生理疾病吗？ - 知乎 - zhihu.com','3.呼吸系统疾病. 肥胖者的胸壁和腹部堆积了大量脂肪,使膈肌运动受限和胸腔顺应性下降,进而影响肺部的功能,出现氧气贮备容积减少和动脉血氧饱和度降低,严重时还会出现阻塞性睡眠呼吸暂停和肥胖性低通气量综合征。','Chinese'),(2962,99,24,'http://www.sohu.com/a/156736658_451210','肥胖与代谢性疾病 - sohu.com','肥胖是滋生许多疾病的温床，由肥胖而引起的疾病可谓遍及全身各个系统，但是尤以代谢性疾病如糖尿病、高脂血症、高尿酸血症等与肥胖关系更为密切。 血糖升高 胰岛素非依赖性糖尿病患者中以肥胖或以往肥胖的人居多 ...','Chinese'),(2963,99,25,'http://www.xinhuanet.com/talking/2018-06/01/c_129884695.htm','肥胖和超重有啥区别？揭开儿童肥胖的真相-新华网','新华网北京6月1日电（记者 袁晗）随着人们生活水平的不断提高，儿童肥胖问题日益严峻。儿童肥胖主要有些啥原因？父母胖，孩子就一定胖吗？小时候胖不算胖，真的是这样吗？超重or肥胖，究竟咋判断？记者采访了北京大学 ...','Chinese'),(2964,99,26,'https://www.biomart.cn/infosupply/35729983.htm','肥胖和激素相关疾病大鼠(高脂饲养诱发的肥胖)(DMZ56Ra01)','武汉云克隆诊断试剂研究所有限公司发布在丁香通的肥胖和激素相关疾病大鼠(高脂饲养诱发的肥胖)(DMZ56Ra01)报价、型号、品牌等供应信息介绍，丁香通致力为您提供最优质的肥胖和激素相关疾病大鼠(高脂饲养诱发的肥胖)(DMZ56Ra01)厂商信息。肥胖和激素相关疾病大鼠(高脂饲养诱发的肥胖)(DMZ56Ra01 ...','Chinese'),(2965,99,27,'http://news.bioon.com/article/6742147.html','Nature突破：为什么易患肥胖和糖尿病？可能是这些遗传因素在捣鬼 - 组学专区 - 生物谷','Nature突破：为什么易患肥胖和糖尿病？可能是这些遗传因素在捣鬼. 来源：本站原创 2019-08-07 07:57','Chinese'),(2966,99,28,'https://drvoice.cn/article/4897','“心”资讯112期｜EHJ 专栏： 肥胖和心血管疾病，女性胖在哪儿比胖多少更重要 -- 严道医声网','女性腿粗，心血管疾病风险反而较低. 既往肥胖和体重变化过大，房颤风险均会增加. 低碳水饮食降低心血管病及癌症. 血清中30种代谢产物与动脉粥样硬化相关. 预测模型帮助判断2型糖尿病患者的临床预后，筛选需要预防治疗的患者','Chinese'),(2967,99,29,'https://med.sina.com/health/article_detail_101_2_4737.html','2型糖尿病与肥胖的九大真相_新浪健康养生','中心性肥胖，即脂肪主要集中在腹部，它是代谢综合征的主要指标之一。肥胖会伴随着胰岛素受体减少，从而导致胰岛素抵抗。胰岛素抵抗长期下去将会发展为2型糖尿病，同时它还是糖尿病相关心血管疾病发病率和死亡率增加的关键因素。','Chinese'),(2968,100,0,'http://www.haodf.com/wenda/zhangweiyishi_g_1623279639.htm','感冒_有预防感冒的疫苗吗_介绍疫苗_好大夫在线网上咨询','您好，预防感冒的关键是提高机体自身的免疫力。一是通过药物，如针剂注射用胸腺五肽等，口服药物如匹多莫德口服液等及中医中药的整体调理；二是通过运动锻炼，做好防寒保暖，增强机体的抵抗力。','Chinese'),(2969,100,1,'https://wenku.baidu.com/view/0b852845185f312b3169a45177232f60dccce77c.html','预防针接种知识培训_图文_百度文库','预防针接种知识培训_基础医学_医药卫生_专业资料。妈妈课堂 预防接种知识培训 内容概要 一、为什么要接种疫苗 二、宝宝出生后如何办理预防接种