101,27,'http://hhscenic.zhengzhou.gov.cn/','郑州市黄河生态旅游风景区管理委员会','郑州市黄河生态旅游风景区管委会召开主题教育第一专题学习研讨会; 我区召开“不忘初心、牢记使命”主题教育动员部署会; 门票管理所党支部开展7月份“党员活动日”活动','Chinese'),(3026,101,28,'http://www.lwcj.com/stly/','生态旅游规划设计_绿维文旅（原绿维创景）_旅游运营网','创意经典·落地运营,旅游规划甲级、建筑设计乙级,10余年实战经验,数百个度假区落地案例,形成了“策划+可研+顾问+规划+设计”一体化服务体系,为各类度假区提供高效率的酒店咨询整合服务。','Chinese'),(3027,101,29,'https://www.douban.com/note/312455364/','生态旅游的定义、特点及与其他旅游方式的比较','(2)生态旅游vs自然旅游 生态旅游是自然旅游的一种形式。它们两者既有相同之处，也有诸多本质区别。两者开展的地域、对环境的保护等方面是一致或相似的，但在开发与经营管理、社区参与程度等方面却有些不同。','Chinese'),(3028,102,0,'https://zhidao.baidu.com/question/7789867.html','空气污染的原因_百度知道','空气的污染主要有两方面的原因，分别是自然和人为两大原因。 一，人们的一些生活和生产活动造成的。比如说汽车尾气的大量排放，火车、飞机等大量燃烧汽油排放的有毒气体等。','Chinese'),(3029,102,1,'https://baike.baidu.com/item/%E7%A9%BA%E6%B0%94%E6%B1%A1%E6%9F%93','空气污染_百度百科 - baike.baidu.com','空气污染，又称为大气污染，按照国际标准化组织（iso）的定义，空气污染通常是指:由于人类活动或自然过程引起某些物质进入大气中，呈现出足够的浓度，达到足够的时间，并因此危害了人类的舒适、健康和福利或环境的现象。换言之，只要是某一种物质其存在的量、性质及时间足够对人类或 ...','Chinese'),(3030,102,2,'https://wenku.baidu.com/view/5934f41f866fb84ae45c8d4c.html','造成大气污染的原因_百度文库','造成大气污染的原因 - （1）工业：工业是大气污染的一个重要来源。工业排放到大气中的污染物种类繁多， 有烟尘、硫的氧化物、氮的氧化物、有机化合物、卤化物、碳化合物等。其中有的是 烟尘，有的是气体...','Chinese'),(3031,102,3,'https://jingyan.baidu.com/article/72ee561a78e66ae16138dfb9.html','什么原因导致空气污染-百度经验','什么原因导致空气污染,空气污染可以由人类和自然的行为。污染空气的自然事件包括森林火灾、火山爆发、风力侵蚀、花粉散布、有机化合物蒸发和自然放射性。自然灾害的污染不是很经常。','Chinese'),(3032,102,4,'https://wenku.baidu.com/view/4a434c86360cba1aa811da83.html','大气污染严重的主要原因及分类_百度文库','大气污染严重的主要原因及分类_化学_自然科学_专业资料。造成我国大气污染严重的主要原因 大气污染的原因 气体污染物在大气中平均停留时间少至几分钟，多至几十年、百余年。','Chinese'),(3033,102,5,'https://baike.so.com/doc/1253437-1325632.html','空气污染_360百科','空气污染,空气污染，又称大气污染，按照国际标准化组织(iso)的定义，空气污染指由于人类活动或自然过程引起某些物质进入大气中，呈现出足够的浓度，达到足够的时间，并因此危害了人类的舒适、健康和福利或环境的现象。换言之，只要是某一种物质其存在的量、性质及时间足够对人类或其他 ...','Chinese'),(3034,102,6,'http://www.tianqi.com/news/20365.html','空气污染的原因 - 天气网 - tianqi.com','换言之，只要是某一种物质其存在的量、性质及时间足够对人类或其他生物、财物产生影响者，我们就可以称其为空气污染物;而其存在造成之现象，就是空气污染。 以上就是小编为大家详解的空气污染原因是什么，现在你们懂了吗?','Chinese'),(3035,102,7,'https://jingyan.baidu.com/article/624e74599138d134e8ba5a22.html','室内空气污染的原因及治理方案-百度经验','室内空气污染的原因及治理方案,解决室内空气的污染首先必须对室内空气质量的标准以及污染的原因，然后通过最合适的室内空气污染治理方案来净化空气，从而达到适宜人居住的空气指标。下面就跟大家分享的是室内空气污染的原因及治理方案。','Chinese'),(3036,102,8,'http://wenda.so.com/q/1361572681068388?src=130','空气污染的原因_360问答 - wenda.so.com','空气污染的原因 可以从汽车尾气，工厂排放大量有毒物质回答 大气污染源大气污染源可分为自然的和人为的两大类。自然污染源是由于自然原因（如火山爆发，森林火灾等）而形成，人为污染源是由于人们从事生产和生活活动而形成。在人为污染源中，又可分为固定的（如烟囱、工业排气筒）和 ...','Chinese'),(3037,102,9,'http://www.chachaba.com/news/zhuanti/huanjing/wuran/20101105_15835.html','造成我国大气污染的原因是什么？_查查吧','环境保护专题，造成我国大气污染的原因是什么？，造成我国大气污染严重的主要原因 大气污染的定义 在干洁的大气中，痕量气体的组成是微不足道的。但是在一定范围的大气中，出现了原来没有的微量物质，其数量和持续时间，都有。','Chinese'),(3038,102,10,'https://baike.baidu.com/item/%E5%AE%A4%E5%86%85%E7%A9%BA%E6%B0%94%E6%B1%A1%E6%9F%93','室内空气污染_百度百科 - baike.baidu.com','室内空气污染是有害的化学性因子、物理性因子和（或）生物性因子进入室内空气中并已达到对人体身心健康产生直接或间接，近期或远期，或者潜在有害影响的程度的状况。2017年10月27日，世界卫生组织国际癌症研究机构公布的致癌物清单初步整理参考，家用燃料燃烧的室内排放在2a类致癌物清单中。','Chinese'),(3039,102,11,'https://wenwen.sogou.com/question/q781466894.htm','北京造成大气污染的主要原因是什么','专家分析北京空气污染原因: 北京昨天再遭大雾围困，该市气象台发布了入秋后第三个大雾黄色预警，京城空气质量半年来也首次下降到五级重度污染。工人日报引述家住北京东城区青年湖旁的一位退休职工的话说“北京快变成‘雾都’了！” 报道说，气象专家表示，北京这种空气质量超标的天气将 ...','Chinese'),(3040,102,12,'https://wenwen.sogou.com/z/q863050019.htm','空气污染的原因是什么? - wenwen.sogou.com','人类无节制地向空气中排放废气和固体废弃物。所以空气污染，一般是指人为原因所引起的空气污染。 燃料燃烧排放的废气和烟尘、工业废气和汽车尾气。生活中燃烧香烟、建筑装饰材料等也会释放一些有毒气体。 烟尘、二氧化硫、碳氧化物（二氧化碳和一氧化碳）、氮氧化物（主要是一氧化氮和 ...','Chinese'),(3041,102,13,'https://zhuanlan.zhihu.com/p/24757339','浅谈成都空气污染——原因、后果以及治理 - 知乎','如果您认同本文的观点或认为本文能够提高人们对于空气污染的认识，希望您能够在社交媒体上将本文进行转发，以便让更多的人能够阅读。本文旨在从客观的角度指出成都空气污染所面临的严重形势和政府的部分失责。本文…','Chinese'),(3042,102,14,'https://iask.sina.com.cn/key/5adb543584ae31dc6d9a03d0.html','空气污染最大的原因-空气污染的原因有什？/空气污染的原因有什么-爱问知识人','空气污染最大的原因相关问答. 问： 空气污染的原因有什？ 答： 另外，燃煤和食用油造成的室内空气污染每年使大约30万中国人非正常死亡 环境学 1个回答 推荐. 问： 空气污染的原因有哪些？ 答： 1、氧气量：氧气含量低于人体健康需要，不是必然会有的问题，但在封闭的空间就很是个问题。','Chinese'),(3043,102,15,'https://www.zybang.com/question/716dba2e562e1f437dc8798834e91dbd.html','10条造成空气污染的主要原因重要性从高到低排列,