表现\"、\"态势语\"、\"动作语言\"等，是人际交往中一种传情达意的方式。在日常人际交往中，体态语言是有一定规律可循的。了解这一点，不仅有助于理解别人的意图，而且能够使自己的表达方式更加丰富，表达效果更加直接，进而使人与人之间更 ...','Chinese'),(3101,104,13,'https://baike.baidu.com/item/%E8%89%BE%E6%96%AF%E4%BC%AF%E6%A0%BC%E7%97%87%E5%80%99%E7%BE%A4','艾斯伯格症候群_百度百科 - baike.baidu.com','艾斯伯格症候群（Asperger\'s syndrome）： 在20世纪40年代，来自维也纳的一位儿科医师汉斯·艾斯伯格研究一群和一般孩子不大一样的小男孩。这些男孩在社交和沟通上与自闭症的孩子有相似的问题。然而，他们跟一般孩子一样聪明，甚至更聪明，并且具有很好的语言技能。','Chinese'),(3102,104,14,'http://www.zgyejsw.roboo.com/web/497202/432215.htm','灵活采用多种教学方法，培养幼儿的语言能力 - 教学经验','灵活采用多种教学方法，培养幼儿的语言能力 幼儿的语言是主体与客体相互作用的产物，语言能促进幼儿认知和思维的发展。 近几年来，随着家庭中独生子女的增多及居住环境的城镇化、封闭化，幼儿日渐缺乏语言交往的环境和机会。','Chinese'),(3103,104,15,'http://edu.sina.com.cn/zxx/2015-04-17/1140465523.shtml','教养女孩父母不能错过的三大教育_新浪教育_新浪网','一直以来，女孩的教养被富养遮盖着教育的本质。不管是精神层面的富养还是物质层面的富养，我都认为这不过是一种华丽的说法罢了，就好比为 ...','Chinese'),(3104,104,16,'https://www.51test.net/show/636089_2.html','灵活采用多种教学方法，培养幼儿的语言能力','对于幼儿来说，语言能力仅是指其口语能力，也就是利用口语、说话来表达思想，交流信息的能力，因此，灵活采用多种游戏方法，发展幼儿语言能力，从小培养幼儿敢说、愿说、会说是至关重要的。 关键词：口语能力；表达；发展游戏。','Chinese'),(3105,104,17,'http://edu.sina.com.cn/zl/oversea/2016-03-10/10013410.shtml','俞敏洪：教养比富有更重要更受人尊重_新浪教育_新浪网','俞敏洪:教养比富有更受人尊重 ... 不是来赞美演出的，而是来谈一下和国人一起看演出的经历。在演出之前，服务人员反复用多种语言，包括中文 ...','Chinese'),(3106,104,18,'https://zhidao.baidu.com/question/21419851.html','为什么中国会有这么多种的方言_百度知道','二者的相同点：第一，都是语言分化的结果，是语言发展不平衡性的体现；第二，都没有全民性特点，社会方言通行于某个阶层，地域方言通行于某个地域，当然，就地域而言，地域方言在一定的范围内是有一定的全民性的；第三，都要使用全民语言的材料构成。','Chinese'),(3107,104,19,'https://jp.hjenglish.com/ribenliuxue/p537417/','日本留学_日本留学：早稻田大学国际教养学部简介_沪江日语','同时，国际教养学部十分重视语言学习，规定大一大二学生需每学期修满一定数量的日语学分，同时提供其他多种语言课程。 接下来就为大家详细介绍一下早稻田大学国际教养学部2014年秋季入学的招生情况。 预计招收人数：125人. 选拔方式：书面材料审查','Chinese'),(3108,104,20,'https://zhidao.baidu.com/question/219835606.html','幼儿园小班教养计划 - 百度知道 - 全球最大 ...','班级方面：本班共有39 名幼儿，其中有23 名男小朋友， 16名女小朋友。大多数为独生子女。通过两年来师生的共同努力，绝大部分幼儿养成了较好的生活卫生习惯，生活自理能力，及进餐习惯，同时能积极参加多种体育活动。','Chinese'),(3109,104,21,'http://www.mygx.net/yuojiao/y/99394.htm','多种培养小学生语感的方法_每日学习网','【前言多种培养小学生语感的方法摘要】这是一篇教养心得的幼教模式，怎样多种培养小学生语感的方法的幼教内容。一、对“在语文教学中，尤其要重视培养良好的语感和整体把握的能力”这一新理念的理解汉语言文字特别具有灵性。','Chinese'),(3110,104,22,'https://book.douban.com/subject/25792556/','心理学 (豆瓣) - book.douban.com','【内容提要】 戴维•迈尔斯的《心理学》是美国众多大专院校心理学教学所采用的教材，自出版以来深受广大师生和心理学爱好者的喜爱，并被翻译成多种语言，有着广泛的影响力。','Chinese'),(3111,104,23,'https://www.zhihu.com/question/29421891','儿童的语言关键期是不是伪概念？ - 知乎','- 积极教养 - 知乎专栏 里面有一位叫七律的评论提到，发展心理学里认为语言关键期是存在的，但有知友反驳说这种事一直有争议…事实是怎样的？语言关键期是不是伪概念？如果想让孩子学习第二语言，到底应该从什么时候开始比较好？','Chinese'),(3112,104,24,'http://www.age06.com/Age06.Web/Detail.aspx?CategoryID=e4b37c4b-499b-4cdc-bb5e-e76d24ba0701&InfoGuid=4bf7a591-305c-4eaa-9f48-5f24c9808bd6','上海市03岁婴幼儿教养方案 - 上海学前教育网','上海市教育委员会关于印发 《上海市 0 — 3 岁婴幼儿教养方案》的通知. 各区县教育局、托幼办，浦东新区社会发展局： 为了进一步推进本市 0 － 3 岁婴幼儿早期教养工作，提高早期教养指导工作的质量，特修订《上海市 0 － 3 岁婴幼儿教养方案》。 现印发给你们。','Chinese'),(3113,104,25,'http://bbs.tianya.cn/post-284-678575-1.shtml','成都小学教育关于女孩的教养，父母不能错过的四个方面(转载)_成都_论坛_天涯社区','3，语言早开发的多种好处 女孩的语言细胞通常比男孩更胜一筹，她们更容易接受多种语言，一般来说能熟练掌握四种语言。 有条件的情况下，女孩的父母可以给女孩提供多语言的条件，让女孩对多种语言更加的敏感，这也会帮助女孩以后学习多种语言打下脑部 ...','Chinese'),(3114,104,26,'https://max.book118.com/html/2018/0620/173680981.shtm','婴幼儿语言发展及教养要点ppt课件.pptx','婴幼儿语言发展及教养要点ppt课件.pptx 16页 本文档一共被下载： 次 ,您可全文免费在线阅读后下载本文档。','Chinese'),(3115,104,27,'http://www.sohu.com/a/23323641_133516','6种让孩子EQ更差的教养语言! - sohu.com','教养策略：孩子两岁以后，自主性就会愈来愈高，愈多的禁止会让孩子与家长的距离变远，亲子关系变差。此时，父母应该开放一些选择权给孩子，例如吃饭时，可以提供多种菜色，但是由孩子自己选择吃什么。','Chinese'),(3116,104,28,'https://bbs.pcbaby.com.cn/topic-3234720.html','灵活采用多种教学方法，培养幼儿的语言能力_早教幼教_论坛_太平洋亲子网','尤其是农村幼儿语言能力大幅度滑坡。幼儿的词语贫乏，语言的完整性、连贯性、流畅性非常不够。影响幼儿语言能力发展的因素是多种多样的，诸如：幼儿先天的生理发展与认知发展水平，周围环境及成人的影响等等，其中幼儿园教育是重要的因素。','Chinese'),(3117,104,29,'https://fishhueystory.blogspot.com/2015/10/25102015.html','慧话~连篇: 教育教养读书会”好好生活就是教育“ 25/10/2015-用优良正确的语言，做孩子的沟通榜样','分际失守的缺失，同样反映在语言的教导上 上一代的缺失 = 威权 （只准听不准说，大人用词严厉） 教养方式过度修正 = 把经验不足的孩子提升到本不该有的人际位置 + 自己本应该为孩子做示范的标准降低到跟他们一样 大小事先问过孩子的意见','Chinese'),(3118,105,0,'https://jingyan.baidu.com/article/ca2d939d42830aeb6c31cefc.html','如何给孩子布置房间-百度经验 - jingyan.baidu.com','如何给孩子布置房间,随着我们生活水平的提高，很多的家庭在购买房子的时候都会为孩子考虑一个单独的房间，让孩子也可以有独处的空间，那么应该如何给孩子装饰布置房间呢？','Chinese'),(3119,105,1,'https://zhidao.baidu.com/question/1515589803371407740.html','孩子房间墙面怎样装饰_百度知道 - zhidao.baidu.com','可以考虑装饰一下孩子的画，把孩子的画裱起来装饰啊，就特别有童趣又好看，小孩子的画有时候会有一种艺术张力和想象力在里面的。也可以用一些定制软件，把画给定制成专门的装饰，有个寸心定制的小程序，可以做。','Chinese'),(3120,105,2,'https://zhishi.fang.com/jiaju/qg_217419.html?from=ask','男孩房怎么设计好?男孩子的房间怎么装修? - 房天下装修知识','2,小男孩的卧室装修风格要活泼、明亮,风格和色系都要男性化一点,这点对孩子的性别认知和心理健康很重要。 当我们看到上述文字对于男孩房怎么设计好?男孩子的房间怎么装修?的介绍之后,我们知道男孩子房间该如何装修了,我们要知道,现在的孩子都有想法 ...','Chinese'),(3121,105,3,'http://www.sohu.com/a/338194887_354109','怎么布置孩子的房间 儿童房装饰讲究 - sohu.com','儿童房间的装饰材料选择,在通常情况下应当考虑几个因素:比如,有的孩子由于年龄较小,倘若父母及其它家庭成员或保姆稍不留意,墙壁上、地面上便会因宝宝好动而出现很不雅观的脏手印,或者铅笔、蜡笔、圆珠笔甚至毛笔…','Chinese'),(3122,105,4,'https://jingyan.baidu.com/article/e4d08ffdca54500fd2f60d8d.html','儿童房间怎么装饰-百度经验 - jingyan.baidu.com','4、儿童房间装饰,整体线条和色彩都以简洁为基调,重要的是桌腿两边增加的收纳格,把零碎的杂物都包容起来,充分释放出桌面空间。 儿童房装饰一些注意点:儿童房间装饰首先要注意材质柔软圆润,不容易伤害小孩子娇嫩的皮肤。','Chinese'),(3123,105,5,'https://know.baidu.com/question/17568dafee869bada2e9fa58d92571aa1d32150','如何装饰宝宝的房间？ - know.baidu.com','窗户的设计要既能通风照明，同时还要保证孩子的人身安全。 房间内的装饰要简单，不要放很多装饰物。由于孩子的活动力强，所以要多选用柔软、自然的家装材料，地毯、原木都是好的选择。','Chinese'),(3124,105,6,'http://www.sohu.com/a/81072575_395105','如何布置孩子的房间？创意妙招大揭秘！','很多父母是否都会头疼如何给孩子布置一个温馨的小天地呢？ 儿童房的布置跟其他空间的装饰有很大的区别。 如何才能又有趣又美观地布置孩子房间是一项技术活，不过还是有很多妙招可以参考的。 1明亮的颜色—提高孩子的 ...','Chinese'),(3125,105,7,'https://zhuanlan.zhihu.com/p/21344628','非常规｜容易被忽视的孩子房间装修要点 - 知乎','孩子的房间应设定在父母视线所能及的地方. 孩子房间的方位首先不应该设在从玄关就能到达的地方，这样的话小孩从学校回来，表情和身体状况作为家长很难察觉，若小孩放学回家后保持沉默，或许不知道他已经在家；孩子的房间方位尽量使用经过客厅、与 ...','Chinese'),(3126,105,8,'http://www.4399.com/flash/130390_2.htm','为孩子布置房间小游戏,在线玩,4399小游戏','为孩子布置房间小游戏在线试玩,小游戏下载及攻略,更多好玩小游戏尽在www.4399.com','Chinese'),(3127,105,9,'http://www.3lian.com/edu/2017/05-31/9e4c5027bf738f19fab837102e622677.html','怎样布置孩子的房间_家居装饰_三联','关于怎样布置孩子的房间的问题解答 儿童房间布置一 在设计儿童房间时,考虑到儿童活泼好动的天性,需要确保孩子房间一定要预留一块活动空间,在布置家具时,儿童房一般以靠墙为主,留出较大块的活动空间。','Chinese'),(3128,105,10,'https://zixun.jia.com/article/528891.html','儿童房间装修效果图 给孩子一个美好童年时光_按空间查看_