o protect your computer.','English'),(3302,111,4,'https://support.microsoft.com/en-us/help/129972/how-to-prevent-and-remove-viruses-and-other-malware','How to prevent and remove viruses and other malware','Note If you cannot access the Internet on your computer, use another computer to help you follow the steps in the “How to reset your Internet Explorer proxy settings” section on the computer that may be infected. To remove a computer virus and other malicious software, follow these steps in order. Install the latest updates from Microsoft Update ...','English'),(3303,111,5,'https://economictimes.indiatimes.com/definition/computer-virus','What is Computer Virus? Definition of Computer Virus ...','Computer Virus: A computer virus is a malicious software program loaded onto a user\'s computer without the user\'s knowledge and performs malicious actions. Description: The term \'computer virus\' was first formally defined by Fred Cohen in 1983. Computer viruses never occur naturally. They are always induced by people. Once created and ...','English'),(3304,111,6,'https://computer.howstuffworks.com/virus.htm','How Computer Viruses Work | HowStuffWorks','Viruses: A virus is a small piece of software that piggybacks on real programs.For example, a virus might attach itself to a program such as a spreadsheet program. Each time the spreadsheet program runs, the virus runs, too, and it has the chance to reproduce (by attaching to other programs) or wreak havoc.','English'),(3305,111,7,'https://www.avg.com/en/signal/what-is-a-computer-virus','What Is a Computer Virus? | The Ultimate Guide to PC ...','Not quite Sylvia Plath. Or the Ika-tako virus, which replaced your files and programs with pictures of squid.. Aaaaw. Or the Stoned virus, which randomly displayed the words “Your computer is stoned.Legalize marihuana!” on your screen (and stayed in stoner character throughout by doing absolutely nothing else).','English'),(3306,111,8,'http://typeslist.com/different-types-of-computer-viruses/','The Different Types of Computer Viruses – Types List','A computer virus is a program designed to harm or cause harm on an infected computer. Its spreads through e-mail attachments, portable devices, websites containing malicious scripts and file downloads.','English'),(3307,111,9,'https://www.microsoft.com/en-us/security/pc-security/virus-whatis.aspx','Computer Virus: What It Is and What It Does - microsoft.com','Learn about computer viruses, including what a virus is, how viruses are spread, and how to help prevent viruses on your own computer with information from the Microsoft Security website.','English'),(3308,111,10,'https://us.norton.com/internetsecurity-malware-what-is-a-computer-virus.html','What Is A Computer Virus? - Norton','A computer virus, much like a flu virus, is designed to spread from host to host and has the ability to replicate itself. Similarly, in the same way that flu viruses cannot reproduce without a host cell, computer viruses cannot reproduce and spread without programming such as a file or document.','English'),(3309,111,11,'https://www.makeuseof.com/tag/types-computer-viruses-watch/','7 Types of Computer Viruses to Watch Out For and What They Do','4. Multipartite Virus. While some viruses are happy to spread via one method or deliver a single payload, multipartite viruses want it all. A virus of this type may spread in multiple ways, and it may take different actions on an infected computer depending on variables, such as the operating system installed or the existence of certain files.','English'),(3310,111,12,'https://us.norton.com/','Norton AntiVirus','Norton™ provides industry-leading antivirus and security software for your PC, Mac, and mobile devices. Download a NEW Norton™ 360 plan - protect your devices against viruses, ransomware, malware and other online threats.','English'),(3311,111,13,'https://www.youtube.com/watch?v=BMbGdyZiHWU','Most Dangerous Computer Viruses In The World - YouTube','Many of us at some point in time have had a computer start acting very strange; there are a lot of threats out there, and many come in the form of viruses. Computer viruses got their name because ...','English'),(3312,111,14,'https://searchsecurity.techtarget.com/definition/virus','What is a Computer Virus? - Definition from WhatIs.com','virus (computer virus): A computer virus is malicious code that replicates by copying itself to another program, computer boot sector or document and changes how a computer works. The virus ...','English'),(3313,111,15,'https://www.webopedia.com/TERM/V/virus.html','What is a Computer Virus? Webopedia Definition','A computer virus is a program or piece of code that is loaded onto your computer without your knowledge and runs against your wishes. Viruses can also replicate themselves. All computer viruses are man-made. Some people distinguish between general viruses and worms. A worm is a special type of virus ...','English'),(3314,111,16,'https://www.mcafee.com/enterprise/en-us/threat-center.html','McAfee Threat Center – Latest Cyberthreats | McAfee','What is Threat Center? Threat Center is McAfee’s cyberthreat information hub. From here, you can learn about top cybersecurity threats in our continuously curated Threat Landscape Dashboard, search our McAfee GTI database of known security threats, read in-depth threat research reports that detail significant attacks and how to protect against them, access a variety of free security tools ...','English'),(3315,111,17,'https://www.youtube.com/watch?v=zqwXpQn93Po','Top 10 Damaging Computer Viruses - YouTube','Be careful what you click on. For this list, we’re taking a look at the most damaging computer viruses, worms, and malware to ever bring down the Internet. Whether they crippled a network or ...','English'),(3316,111,18,'https://www.hongkiat.com/blog/famous-malicious-computer-viruses/','10 Deadliest Computer Viruses of All Time - Hongkiat','The virus was created by two Filipino programers, Reonel Ramones and Onel de Guzman. What it did was use social engineering to get people to click on the attachment; in this case, a love confession.The attachment was actually a script that poses as a TXT file, due to Windows at the time hiding the actual extension of the file.','English'),(3317,111,19,'https://www.avg.com/en/signal/how-to-get-rid-of-a-virus-or-malware-on-your-computer','How to Get Rid of a Virus & Delete Viruses From Your ...','Realizing your PC or laptop might be infected with a virus or malware is worrying, but with careful and decisive action, removing a virus is quicker and easier than you might think. It’s not always obvious that your computer is infected. Some of the warning signs your PC or laptop might have a ...','English'),(3318,111,20,'https://en.wikipedia.org/wiki/List_of_computer_viruses','Comparison of computer viruses - Wikipedia','The compilation of a unified list of computer viruses is made difficult because of naming. To aid the fight against computer viruses and other types of malicious software, many security advisory organizations and developers of anti-virus software compile and publish lists of viruses. When a new virus appears, the rush begins to identify and understand it as well as develop appropriate counter ...','English'),(3319,111,21,'http://www.businessdictionary.com/definition/computer-virus.html','What is a computer virus? definition and meaning ...','Some are immediately active, others remain latent for weeks or months, or work slowly to avoid detection and cause destruction over long periods. Propagation of computer viruses is a serious crime in many countries. See also Trojan horse, and worm.','English'),(3320,111,22,'https://simple.wikipedia.org/wiki/Computer_virus','Computer virus - Simple English Wikipedia, the free ...','A computer virus is a program that is able to copy itself when it is run. Often, computer viruses are run as a part of other programs. Biological viruses also work that way, as they copy themselves as part of other organisms.This is how the computer virus got its name. In addition to copying itself, a computer virus can also execute instructions that cause harm. For this reason, computer ...','English'),(3321,111,23,'http://www.youngupstarts.com/2016/04/14/9-types-of-computer-viruses-that-you-should-know-about-and-how-to-avoid-them/','9 Types Of Computer Viruses That You Should Know About ...','There are some viruses that bypass the security system of your device. Thus, if you want to know what to do when such a situation arises, read on as we have got some very useful tips for you. Here are 9 Computer Viruses that you should know about.','English'),(3322,111,24,'https://factfile.org/10-facts-about-computer-viruses','10 Facts about Computer Viruses | Fact File','Facts about Computer Viruses talk about the malware program which disturbs the program of your computer. The viruses may infect the boot sector, data files or even computer programs for they can replicate themselves. There are various disadvantages that you can get from the viruses hidden in the computer.','English'),(3323,111,25,'https://www.malwarebytes.com/computer-virus/','Computer Virus – Virus protection and removal tips ...','What is a computer virus? As defined by Malwarebytes Labs, a computer virus is “malware attached to another program (such as a document), which can replicate and spread after an initial execution on a target system where human interaction is required. Many viruses are harmful and can destroy data, slow down system resources, and log keystrokes.”','English'),(3324,111,26,'https://techviral.net/create-a-virus/','How To Create Computer Virus In Few Seconds (Notepad virus ...','Learn how to create a computer virus in less than 60 seconds: Almost every computer or laptop user has faced virus attack at least once in their life for sure, and we all know what is virus.Today we are going to describe five ways to create a virus in less than a minute. Go through the post to know about it.','English'),(3325,111,27,'https://www.computerhope.com/jargon/v/virus.htm','What is a Virus? - computerhope.com','A computer virus is a program, script, or macro designed to cause damage, steal personal information, modify data, send e-mail, display messages, or some combination of these actions.. When the virus is executed, it spreads by copying itself into or over data files, programs, or boot sector of a computer\'s hard drive, or potentially anything else writable.','English'),(3326,111,28,'https://www.reference.com/technology/examples-computer-virus-17cde8ca64b62451','What Are Examples of a Computer Virus? | Reference.com','Some examples of computer viruses include the Storm Virus, Sasser Virus and Melissa Virus. A computer virus is a program that causes some sort of harmful activity to a computer and then attempts to replicate and spread itself to other computers.','English'),(3327,111,29,'https://www.smithsonianmag.com/science-nature/top-ten-most-destructive-computer-viruses-159542266/','Top Ten Most-Destructive Computer Viruses | Science ...','Computer viruses have come a long way from the early days of personal computers, when teenage hackers competed for bragging rights, creating malware designed for mischief or random mayhem. Now ...','English'),(3328,112,0,'https://en.wikipedia.org/wiki/Seven_Wonders_of_the_Ancient_World','Seven Wonders of the Ancient World - Wikipedia','The Seven Wonders of the World or the Seven Wonders of the Ancient World is a list of remarkable constructions of classical antiquity given by various authors in guidebooks or poems popular among ancient Hellenic tourists. Although the list, in its current form, did not stabilise until the Renaissance, the first such lists of seven wonders date from the 2nd-1st century BC.','English'),(3329,112,1,'https://www.history.com/topics/ancient-history/sevens-wonders-of-the-ancient-world','Sevens Wonders of the Ancient World - List & Timeline ...','The Seven Wonders of the Ancient World is a list of remarkable constructions of classical antiquity. Of the original Seven Wonders, only one—the Great Pyramid of Giza—remains intact.','English'),(3330,112,2,'https://www.ancient.eu/The_Seven_Wonders/','The Seven Wonders - Ancient History Encyclopedia','OTHER WONDERS. The Seven Wonders of the Ancient World were, by no means, a comprehensive agreed-upon list of the most impressive structures of the day. Rather, the list was very much like a modern-day tourist pamphlet informing travelers on what to see on their trip.','English'),(3331,112,3,'https://en.wikipedia.org/wiki/Wonders_of_the_World','Wonders of the World - Wikipedia','Various lists of the Wonders of the World have been compiled from antiquity to the present day, to catalogue the world\'s most spectacular natural wonders and manmade structures.. The Seven Wonders of the Ancient World is the first known list of the most remarkable creations of classical antiquity; it was based on guidebooks popular among Hellenic sightseers and only includes works located ...','English'),(3332,112,4,'https://www.thoughtco.com/the-seven-wonders-of-the-world-4147695','The Ancient World\'s 7 Wonders - ThoughtCo','The seven wonders of the ancient world have been celebrated by scholars, writers, and artists since at least 200 B.C. These marvels of architecture, like Egypt\'s pyramids, were monuments of human achievement, built by Mediterranean and Middle Eastern empires of their day with little more than crude tools and manual labor.','English'),(3333,112,5,'https://www.wonderslist.com/10-wonders-of-the-ancient-world/','10 Wonders of the Ancient World - Wonderslist','We are now presenting our next ten wonders of the ancient world list. It is fortunate that the world is so full of wonderful things that we can keep you infotained with lists of this nature. If you wish to read the others, they are here: Top 10 Wonders of The World Top 10 Natural Wonders of the World 10 Engineering Wonders of The Modern World','English'),(3334,112,6,'h