ds-on simulation, students explore how birds are affected by oil and how wildlife rescuers help oiled birds.','English'),(3380,113,22,'https://www.skybrary.aero/index.php/Accident_and_Serious_Incident_Reports:_Wildlife_Strike','Accident and Serious Incident Reports: Wildlife Strike ...','Definition. A selection of reports relating to accidents and serious incidents which involved a Wildlife Strike.. The accident and serious incident reports are grouped together below in subcategories based upon SKYbrary database tags.. Large Birds. A320, vicinity Auckland New Zealand, 2012 (On 20 June 2012, the right V2500 engine compressor of an Airbus A320 suddenly stalled on final approach.','English'),(3381,113,23,'https://www.popularmechanics.com/science/energy/g1765/biggest-oil-spills-in-history/','10 Biggest Oil Spills in History - Popular Mechanics','10 Biggest Oil Spills in History ... incident included firefighting efforts and the use of dispersants to treat the oil that spilled over the course of the accident and then while the Atlantic ...','English'),(3382,113,24,'https://www.investors.com/politics/commentary/windmills-and-solar-plans-kill-far-birds-than-oil-spills/','Which Kills More Birds? Oil Spills, or Windmills ...','Which Kills More Birds? Oil Spills, or Windmills? ... But oil spills the size of the BP accident don\'t happen every year. Deaths caused by wind turbines and solar farms, however, don\'t stop. ...','English'),(3383,113,25,'https://allnaturalpetcare.com/blog/2018/02/27/common-diffuser-essential-oils-may-toxic-dogs-cats-birds-pets/','Common Diffuser Essential Oils that may be Toxic to Dogs ...','The answer is complicated by the varying tolerance levels of each species or breed. Some essential oils are toxic to all pets, or only some dog breeds, or species such as cats, rabbits, birds, aquarium fish and other small animals. We don’t recommend using an essential oil diffuser with cats, rabbits, birds, fish and other small animals close by.','English'),(338