),(3397,114,9,'https://www.bcg.com/publications/2017/energy-environment-north-sea-decommissioning-challenge.aspx','The North Sea’s $100 Billion Decommissioning Challenge - BCG','It’s a $100 billion problem—in the North Sea alone. And the bill could double or even triple depending on decisions oil and gas operators make now. Shareholders, employees, suppliers, governments, and taxpayers are all on the hook for the tab. The problem is the decommissioning of oil and gas ...','English'),(3398,114,10,'https://www.crystolenergy.com/assessing-future-north-sea-oil-gas/','Assessing the future of North Sea oil and gas - Crystol Energy','Recently, however, this decade-long decline in oil output has reversed. In the words of the International Energy Agency (IEA), the North Sea continues to surprise: In Norway, the production increase has lasted for two consecutive years (2014 and 2015) and exceeded estimates, while gas production also bounced back after a short-lived dip.','English'),(3399,114,11,'https://oilprice.com/Energy/Energy-General/UK-North-Sea-Oil-Production-Set-To-Resume-Decline-In-2019.html','UK North Sea Oil Production Set To Resume Decline In 2019','UK North Sea’s oil production is expected to revert to a decline again next year, after a brief period of growth since 2015, according to consultants at Bernstein.. Since peaking at 2.6 million ...','English'),(3400,114,12,'https://www.sciencedirect.com/science/article/pii/S0308597X18302355','Data challenges and opportunities for environmental ...','For the North Sea, the oil and gas industry has been a dominant presence for over 50 years that has contributed to a wealth of knowledge about the environment. As the industry begins to decommission its offshore structures, this information will be critical for avoiding duplication of effort in data collection and ensuring best environmental ...','English'),(3401,114,13,'https://www.independent.co.uk/environment/north-sea-oil-rigs-abandoned-shell-environment-climate-pollutio