 of these little guys left in the wild. In honor of upcoming Red Panda Day on September 21st, learn more facts about ...','English'),(3544,119,6,'http://wwf.panda.org/knowledge_hub/endangered_species/giant_panda/panda/how_many_are_left_in_the_wild_population/','How many are left in the wild? | WWF - wwf.panda.org','How many are left in the wild? ... The latest census in 2014 found that there were 1,864 giant pandas alive in the wild. While still very low, this represents a real success story, with numbers increasing from around 1,000 in the late 1970s. In the past decade, giant panda numbers have risen by 17 percent. ...','English'),(3545,119,7,'https://www.answers.com/Q/How_many_giant_panda\'s_are_left_in_the_wild_today','How many giant panda\'s are left in the wild today ...','The new reports indicated there were 2,000 to 2,500 Giant Pandas living in the wild. The Giant Panda is listed by the International Union for Conservation of Nature, \"IUCN\" Red list as \"endangered ...','English'),(3546,119,8,'https://www.answers.com/Q/How_many_giant_pandas_left_in_the_world','How many giant pandas left in the world? - Answers.com','The new reports indicated there were 2,000 to 2,500 Giant Pandas living in the wild. The Giant Panda is listed by the International Union for Conservation of Nature, \"IUCN\" Red list as \"endangered ...','English'),(3547,119,9,'https://en.wikipedia.org/wiki/Giant_Pandas_Around_the_World','Giant pandas around the world - Wikipedia','In total there have been eight live births at the zoo. The most famous panda to have lived at the zoo is Tohui. Currently, two female giant pandas live at the zoo: Shuan Shuan and Xin Xin. The pandas at Chapultepec are special in that China does not have ownership.','English'),(3548,119,10,'https://www.theguardian.com/science/animal-magic/2015/jan/20/how-many-giant-pandas-china-census-survey','How many giant pandas are there? | Science | The Guardian','How many giant pandas are there? ... For what it’s worth, I suspect there really are somewhere between 1500 and 2500 pandas left in the wild and if this is what China announces, I will be ...','English'),(3549,119,11,'https://www.nathab.com/asia-adventure-travel/wild-china-panda-tour/','Panda Bear Tour | China Adventure Travel | Natural Habitat','Our unique itinerary is carefully crafted to reveal rarely seen panda habitat and wild China at its most entrancing. We\'ll also have up-close encounters with pandas at China\'s famous research bases, plus a visit to ancient Xi\'an where the Terracotta Army has guarded the tomb of China\'s first emperor for more than 2,200 years.','English'),(3550,119,12,'https://www.reference.com/pets-animals/many-giant-pandas-left-world-900355eae24c862a','How Many Giant Pandas Are Left in the World? | Reference.com','How Many Giant Pandas Are Left in the World? There are approximately 1,000 to 2,000 giant pandas living in the wild. Close to 300 pandas live in zoos or centers where breeding is encouraged with the intention of returning more pandas to their natural habitat.','English'),(3551,119,13,'https://www.msn.com/en-ca/lifestyle/pets/how-many-red-pandas-are-left-in-the-wild/ss-AAFTUNe','How Many Red Pandas Are Left in the Wild? - msn.com','How Many Red Pandas Are Left in the Wild? Dani Walpole, RD.com ... the red panda is an endangered species, and there are only a few of these little guys left in the wild. ... and central China ...','English'),(3552,119,14,'https://www.worldwildlife.org/species/giant-panda','Panda WWF','Despite their exalted status and relative lack of natural predators, pandas are still at risk. Severe threats from humans have left just over 1,800 pandas in the wild. This peaceful creature with a distinctive black and white coat is adored by the world and considered a national treasure in China ...','English'),(3553,119,15,'http://www.howmanyarethere.net/how-many-pandas-are-there-in-the-world/','How Many Pandas Are There In The World?','How Many Pandas Are There In The World? Pandas are kind of bears which are endangered. Today, mankind pays a great effort to keep these animals alive. Many authorities in China do their best in order to breed these animals under their controls. In this article, we are going to talk about the amount of the pandas left in the world. ...','English'),(3554,119,16,'https://www.wonderopolis.org/wonder/why-are-pandas-rare','Why Are Pandas Rare? | Wonderopolis','Estimates of wild panda populations vary wildly. Some experts believe there are as few as 1,000 giant pandas left in the wild. Other scientists believe there are about 1,600 pandas left. A recent study using DNA analysis, however, concludes that there could be as many as 3,000 pandas still in the wild. In addition to wild pandas, there are ...','English'),(3555,119,17,'https://www.chinahighlights.com/giant-panda/','Giant Pandas, All things you want to know about Giant ...','A wild giant panda typically stands at 75 centimeters (2½ feet) tall and 1.5 meters (5 feet) long. Read more about Giant Pandas\' Characteristics and Appearance. It Is a Vulnerable Species — Less than 2,000 in the Wild According to the census of 2014, there are only 1,864 giant pandas alive in the wild. It is one of the rarest and most ...','English'),(3556,119,18,'http://wwf.panda.org/what_we_do/endangered_species/giant_panda/panda/panda_survey/','WWF - Panda','Camera traps in China have captured images and video footage of giant pandas that are often difficult to see in the wild. The photographs and video are some of the most amazing images ever of pandas and other species in their remote habitat, which were caught on film as part of long-term wildlife monitoring projects set up in panda nature reserves by the Chinese government and WWF.','English'),(3557,119,19,'https://www.pandasinternational.org/panda-reserves/','Panda Reserves | Pandas International','Today there are approximately 40 panda reserves across Southwestern China. Some are Nature Reserves providing a safe habitat for wild Giant Pandas, like a National Park Other reserves protect the wild Giant Pandas while having scientific research centers to study their behavior and for breeding captive Giant Pandas.','English'),(3558,119,20,'https://www.youtube.com/watch?v=OL1cuDAOkFA','Panda Sighting in the Wild - YouTube','With less than 1,600 giant pandas remaining in the wild, spotting a wild giant panda is rare. After 10 days of waiting, our film crew\'s patience pays off.','English'),(3559,119,21,'https://nationalzoo.si.edu/animals/giant-panda','Giant panda | Smithsonian\'s National Zoo','The Smithsonian\'s National Zoo and Conservation Biology Institute is a leader in giant panda conservation. Ever since these charismatic bears arrived at the Zoo in 1972, animal care staff and scientists have studied giant panda biology, behavior, breeding, reproduction and disease.','English'),(3560,119,22,'https://www.telegraph.co.uk/travel/destinations/asia/china/articles/Pandas-where-to-see-them-in-China/','Pandas: where to see them in China - Telegraph','Trekking to see pandas in the wild is difficult. A clutch of tour companies claim to offer the experience, but there are no guarantees of sightings. Panda China Tour is one ( www.pandachinatour.com ).','English'),(3561,119,23,'https://www.nationalgeographic.com/magazine/2016/08/giant-pandas-wild-animals-national-parks/','Pandas Get to Know Their Wild Side - nationalgeographic.com','How many wild pandas are out there? Researchers have been trying to count them since the 1970s, when it is thought there were roughly 2,500 animals. ... To set the mood, breeders in China have ...','English'),(3562,119,24,'https://www.worldwildlife.org/species/red-panda','Red Panda | Species | WWF','Red pandas are often killed when they get caught in traps meant for other animals such as wild pigs and deer. They are also poached for their distinctive pelts in China and Myanmar. Red panda fur caps or hats have been found for sale in Bhutan.','English'),(3563,119,25,'https://www.onthegotours.com/China/Visiting-Pandas-in-China','The best places to see pandas in China | On The Go Tours','Best Places to See Pandas in China. Many of China\'s panda research bases are located in the Sichuan province where wild pandas still exist today. The city of Chengdu is known as the panda capital of the world thanks to the important conservation centres situated here and it makes an obvious choice for those wanting a chance to see the cuddly ...','English'),(3564,119,26,'https://www.pandasinternational.org/reserves-zoos/','Reserves & Zoos | Pandas International','Today there are approximately 40 panda reserves across Southwestern China. Some are Nature Reserves providing a safe habitat for wild Giant Pandas, like a National Park Other reserves protect the wild Giant Pandas while having scientific research centers to study their behavior and for breeding captive Giant Pandas.','English'),(3565,119,27,'https://www.activewild.com/panda-facts-kids/','Panda Facts For Kids & Adults: Information, Pictures & Video','Pandas have been an endangered species for a many years. This is because much of the panda’s natural habitat has been cleared to make way for farms and other development. Once there were wild pandas living throughout China, but now they are restricted to the mountains. How Many Pandas Are Left In The Wild?','English'),(3566,119,28,'http://infomory.com/numbers/number-of-giant-pandas-in-the-world/','Number of Giant Pandas in the World - A Knowledge Archive','Number of Giant Pandas in the World. April 16, 2010, charm, Leave a comment. How many Giant Pandas are alive in the world? Approximately 3,239 pandas. Giant pandas have become national icons in China. To date, there are 239 giant pandas bred in captivity, according to a 2007 news report in a Chinese online news journal.','English'),(3567,119,29,'https://www.reference.com/pets-animals/pandas-live-64dff22c2fe56e9','Panda Habitats in the Wild | Reference.com','Conservation efforts seem to be making successful strides in increasing the panda population. In the 1970s there were as few as 1,000 pandas living in their natural habitat. A 2014 census found more than 1,800 pandas now living in the wild.','English'),(3568,120,0,'https://www.reference.com/science/unit-frequency-dce3518eabd09c40','What Is the Unit for Frequency? | Reference.com','The unit for frequency in the International System of Units is hertz, which is abbreviated as Hz. One hertz is defined as a frequency of one cycle per second. The clock rate of computer central processing units are measured in megahertz or gigahertz, which allow consumers to compare CPU performance.','English'),(3569,120,1,'https://en.wikipedia.org/wiki/Frequency','Frequency - Wikipedia','Frequency is the number of occurrences of a repeating event per unit of time. It is also referred to as temporal frequency, which emphasizes the contrast to spatial frequency and angular frequency. The period is the duration of time of one cycle in a repeating event, so the period is the reciprocal of the frequency.','English'),(3570,120,2,'https://www.quora.com/What-is-the-unit-used-to-measure-frequency','What is the unit used to measure frequency? - Quora','Hertz, unit of frequency. The number of hertz (abbreviated Hz) equals the number of cycles per second. The frequency of any phenomenon with regular periodic variations can be expressed in hertz, but the term is used most frequently in connection w...','English'),(3571,120,3,'https://en.wikipedia.org/wiki/Hertz','Hertz - Wikipedia','The hertz (symbol: Hz) is the derived unit of frequency in the International System of Units (SI) and is defined as one cycle per second. It is named after Heinrich Rudolf Hertz, the first person to provide conclusive proof of the existence of electromagnetic waves.','English'),(3572,120,4,'http://www.qrg.northwestern.edu/projects/vss/docs/Communications/1-what-is-frequency.html','What is frequency? - Northwestern University','Usually frequency is measured in the hertz unit, named in honor of the 19th-century German physicist Heinrich Rudolf Hertz. The hertz measurement, abbreviated Hz, is the number of waves that pass by per second. For example, an \"A\" note on a violin string vibrates at about 440 Hz (440 vibrations per second). What are radio waves? ...','English'),(3573,120,5,'https://www.britannica.com/science/frequency-physics','frequency | Definition, Symbols, & Formulas | Britannica.com','Omega is usually used to describe the angular frequency—that is, how much an object rotates or revolves in radians per unit time. Usually frequency is expressed in the hertz unit, named in honour of the 19th-century German physicist Heinrich Rudolf Hertz, one hertz being equal to one cycle per second, abbreviated Hz; one kilohertz (kHz) is ...','English'),(3574,120,6,'https://www.answers.com/Q/What_is_frequency_measured_in','What is frequency measured in? - Answers.com','== Frequency speaks to the number of oscillations per unit of time. Oscillations or cycles per unit of time is a concept applied to some kind of repeating or harmonic motion or wave, and it could ...','English'),(3575,120,7,'https://www.convertunits.com/type/frequency','Frequency unit conversion - SI derived quantity','››SI derived quantity: frequency. This category of measurement units is defined by the \"frequency\" type, which is an SI derived quantity. ›› SI unit: hertz The SI derived unit for frequency is the hertz.','English'),(3576,120,8,'https://answers.yahoo.com/question/index?qid=20090122154413AApXkQR','what is the unit of frequency? | Yahoo Answers','Frequency is the speed of a wave divided by its wavelength. That would be a (m / s) / m, which is simply 1/s. We call this a Hz, but I have no idea why we wouldn\'t want to leave it as \"per second\".','English'),(3577,120,9,'https://www.reference.com/science/frequency-measured-c6c595096c2dd3e0','What Is Frequency Measured In? | Reference.com','The most common unit used to measure frequency is hertz (Hz), which refers to cycles per second; however, there are some other ways to measure frequency, such as revolutions per minute (RPM) for a motor or beats per minute (BPM) for a person\'s heartbeat.','English'),(3578,120,10,'https://www.dictionary.com/browse/frequency','Frequency | Definition of Frequency at Dictionary.com','Frequency definition, the state or fact of being frequent; frequent occurrence: We are alarmed by the frequency of fires in the neighborhood. See more.','English'),(3579,120,11,'https://whatis.techtarget.com/definition/frequency','What is frequency? - Definition from WhatIs.com','frequency: For an oscillating or varying current , frequency is the number of complete cycles per second in alternating current direction. The standard unit of frequency is the hertz , abbreviated Hz. If a current completes one cycle per second, then the frequency is 1 Hz; 60 cycles per second equals 60 Hz (the standard alternating-current ...','English'),(3580,120,12,'https://www.merriam-webster.com/dictionary/frequency','Frequency | Definition of Frequency by Merriam-Webster','Frequency definition is - the fact or condition of occurring frequently. How to use frequency in a sentence. the fact or condition of occurring frequently… See the full definition. SINCE 1828. Menu. ... the number of times that a periodic function repeats the same sequence of values during a unit variation of the independent variable. b: the ...','English'),(3581,120,13,'https://www.mathsisfun.com/algebra/amplitude-period-frequency-phase-shift.html','Amplitude, Period, Phase Shift and Frequency - Math Is Fun','Amplitude, Period, Phase Shift and Frequency . Some functions (like Sine and Cosine) repeat forever and are called Periodic Functions.. The Period goes from one peak to the next (or from any point to the next matching point):. The Amplitude is the height from the center line to the peak (or to the trough). Or we can measure the height from highest to lowest points and divide that by 2.','English'),(3582,120,14,'http://pages.uoregon.edu/soper/Light/frequency.html','Wavelength and Frequency','We denote wavelength by Frequency is how many complete waves go by per second. We denote frequency by Frequency is measured in Hertz = Hz = 1/seconds. If a wave with a wavelength of 2 meters is going by at a speed of 6 meters/second, then 3 complete waves go by in 1 second. That is, the frequency is 6/2 = 3 waves/second, or 3 Hz. (See units ).Thus','English'),(3583,120,15,'https://www.answers.com/Q/What_is_the_SI_Unit_for_Frequency','What is the SI Unit for Frequency? - Answers.com','Frequency f is a measure of the number of occurrences of a repeating event per unit time. It is also referred to as temporal frequency. The period is the duration of one cycle in a repeating event ...','English'),(3584,120,16,'https://www.asknumbers.com/FrequencyConversion.aspx','Frequency Converter - Convert Hz, kHz, MHZ, GHz','Frequency is defined as the measure of the number of occurrences of a repeating event per unit time. To calculate the frequency, the number of occurrences of the event within a fixed time interval are counted and then it\'s divided by the length of the time interval. Ex: 1 Hz means that an event repeats once per second, 2 Hz is twice per second.','English'),(3585,120,17,'http://www.gohz.com/hertz','What is Hertz (Hz)? Frequency 50/60 Hz Converter | GoHz.com','kHz is frequency unit of alternating current (AC) or electromagnetic wave (EM), equal to 1000 hertz (1000 Hz). This unit is also used for measuring and describing the signal bandwidth. 1 kHz frequency AC signal is within the human auditory sensation area. The EM wavelength of 1 kHz signal is 300 km, which is about 190 miles.','English'),(3586,120,18,'http://www.emc2-explained.info/Speed-Frequency-and-Wavelength/','Speed, Frequency and Wavelength - How they are related ...','The frequency, f, of a wave is the number of times a wave\'s crests pass a point in a second.If you watch a water wave in the bath pass over one of your toes twice every second the frequency of the wave is 2 Hz. The unit \"Hz\" is short for hertz, named after the German physicist Heinrich Hertz (1857 – 94). A more mathematically useful way to write 2 Hz is 2s –1.','English'),(3587,120,19,'http://www.earthguide.ucsd.edu/wav/frequency.html','Frequency - earthguide.ucsd.edu','Units Frequency is expressed in units of cycles per unit time. Although frequency is a measurement of rate of movement, it is not identical to velocity. For example, if we think of a car that moves at 60 miles per hour, we mean just that. However, if we say that a wave has a frequency of 60 cycles per hour, points on the wave may be traveling ...','English'),(3588,120,20,'https://socratic.org/questions/what-are-the-units-for-frequency','What are the units for frequency? | Socratic','What are the units for frequency? Physics. 2 Answers Giuseppe Longo Ragusa Mar 31, 2018 It is the inverse of a time. In SI it is the inverse of a second: the Hertz [Hz]. Gió Mar 31, 2018 Answer: We have: Hertz (Hz) corresponding to #s^-1#. Explanation: Frequency tels us how many complete oscillations are performed in one second. ...','English'),(3589,120,21,'https://courses.lumenlearning.com/physics/chapter/16-2-period-and-frequency-in-oscillations/','Period and Frequency in Oscillations | Physics','A concept closely related to period is the frequency of an event. For example, if you get a paycheck twice a month, the frequency of payment is two per month and the period between checks is half a month. Frequency f is defined to be the number of events per unit time. For periodic motion, frequency is the number of oscillations per unit time.','English'),(3590,120,22,'https://www.lorecentral.org/2018/10/what-is-the-difference-between-frequency-and-wavelength.html','What is the difference between frequency and wavelength ...','frequency = speed / wavelength. The wavelength is usually represented by the Greek letter lambda (?) and in the International System of Units it is measured in meters . The frequency is usually represented by the letter v or f and is measured in hertz or cycles per second (Hz).','English'),(3591,120,23,'http://kentchemistry.com/links/AtomicStructure/waveequations.htm','Wavelegnth, Frequency and Energy Calculations','In other words, all energy is a multiple of this constant multiplied by the frequency of the wave of light. Energy is therefore quantized, it is always a multiple of a single packet of energy. Now on to the equations. Wavelength (l) and Frequency (n) Relationships. c=ln , where l is wavelength in meters. n is frequency in hertz, 1/s or s-1','English'),(3592,120,24,'https://www.convertworld.com/en/frequency/hertz.html','Convert Frequency, Hertz - Unit Conversion Online','Share Hertz (Hz - Frequency), frequency. The hertz (symbol: Hz) is the SI unit of frequency. Its base unit is s-1 (also called inverse seconds, reciprical seconds, or 1/s). In English, hertz is used as both singular and plural.','English'),(3593,120,25,'https://www.thoughtco.com/definition-of-frequency-605149','Frequency Definition in Science - ThoughtCo','In the most general sense, frequency is defined as the number of times an event occurs per unit of time. In physics and chemistry, the term frequency is most often applied to waves, including light, sound, and radio.Frequency is the number of times a point on a wave passes a fixed reference point in one second.','English'),(3594,120,26,'http://mriquestions.com/angular-frequency-omega.html','Angular frequency (ω) - Questions and Answers in MRI','Regular or linear frequency (f), sometimes also denoted by the Greek symbol \"nu\" (ν), counts the number of complete oscillations or rotations in a given period of time.Its units are therefore cycles per second (cps), also called hertz (Hz). Angular frequency (ω), also known as radial or circular frequency, measures angular displacement per unit time.','English'),(3595,120,27,'https://dosits.org/science/measurement/what-units-are-used-to-measure-sound/','What units are used to measure sound? – Discovery of Sound ...','What units are used to measure sound? The sciences involve quantitatively measuring properties of the natural world. When a scientist is making measurements, they must first identify the specific properties they will measure, how those measurements will be made, and what units they will use.','English'),(3596,120,28,'https://www.britannica.com/science/hertz','Hertz | unit of measurement | Britannica.com','Hertz, unit of frequency. The number of hertz (abbreviated Hz) equals the number of cycles per second. The frequency of any phenomenon with regular periodic variations can be expressed in hertz, but the term is used most frequently in connection with alternating electric currents, electromagnetic waves (light, radar, etc.), and sound.','English'),(3597,120,29,'https://answers.yahoo.com/question/index?qid=20090126160623AAh9pVy','What is the orbital frequency? | Yahoo Answers','Best Answer: Orbital frequency is the number of orbits a certain object makes around another object in a specified time, or simply the number of things something does in a certain amount of time. To find frequency, just use the formula 1/T, in which T is the amount of time given (not t, that is different).','English'),(3598,121,0,'https://www.investopedia.com/ask/answers/120314/who-are-microsofts-msft-main-competitors.asp','Who are Microsoft\'s (MSFT) Main Competitors? - Investopedia','Microsoft Corporation’s primary competitors include some of the most prominent technology companies in the industry.The list includes well-known brands such as Apple (), Google (), SAP, IBM and ...','English'),(3599,121,1,'https://imaginecup.microsoft.com/','Student Developer Competitions | Imagine Cup','For nearly two decades, students from around the world have competed in the Imagine Cup, Microsoft’s global technology competition just for students, for the chance to win mentorship, networking opportunities, free trav