y splitting apart the nuclei of atoms : nuclear energy.','English'),(3752,126,4,'https://www.iaea.org/','International Atomic Energy Agency | Atoms for Peace and ...','The IAEA is the world\'s centre for cooperation in the nuclear field, promoting the safe, secure and peaceful use of nuclear technology. It works in a wide range of areas including energy generation, health, food and agriculture and environmental protection.','English'),(3753,126,5,'https://www.dictionary.com/browse/atomic-energy','Atomic energy | Definition of Atomic energy at Dictionary.com','Atomic energy definition, nuclear energy. See more. Tick, Tock: What Is The “Doomsday Clock?” What is the Doomsday Clock?','English'),(3754,126,6,'https://www.nei.org/fundamentals/what-is-nuclear-energy','What Is Nuclear Energy? - nei.org','Nuclear Energy Provides More Than Electricity. The benefits of nuclear energy extend far beyond carbon-free electricity too. Nuclear powers space exploration, sterilizes medical equipment, provides potable water through desalination, supplies radioisotopes for cancer treatment and much more.','English'),(3755,126,7,'https://whatisnuclear.com/nuclear-energy.html','What is Nuclear Energy?','Fission and Fusion. There are two fundamental nuclear processes considered for energy production: fission and fusion. Fission is the energetic splitting of large atoms such as Uranium or Plutonium into two smaller atoms, called fission products. To split an atom, you have to hit it with a neutron.','English'),(3756,126,8,'https://www.nationalgeographic.org/encyclopedia/nuclear-energy/','nuclear energy | National Geographic Society','Nuclear energy is the energy in the nucleus, or core, of an atom. Nuclear energy can be used to create electricity, but it must first be released from the atom. Nuclear energy can be used to create electricity, but it must first be released from the atom. In the process of nuclear fission, atoms are ...','English'),(3757,126,9,'https://www.conserve-energy-future