 energy is still considered very controversial and a hot issue.','English'),(3762,126,14,'https://www.energy.gov/science-innovation/energy-sources/nuclear','Nuclear | Department of Energy','Nuclear power, the use of sustained nuclear fission to generate heat and electricity, contributes nearly 20 percent of the electricity generated in America.','English'),(3763,126,15,'https://en.wikipedia.org/wiki/Nuclear_power','Nuclear power - Wikipedia','Nuclear power is the use of nuclear reactions that release nuclear energy to generate heat, which most frequently is then used in steam turbines to produce electricity in a nuclear power plant.Nuclear power can be obtained from nuclear fission, nuclear decay and nuclear fusion reactions. Presently, the vast majority of electricity from nuclear power is produced by nuclear fission of uranium ...','English'),(3764,126,16,'https://legcounsel.house.gov/Comps/Atomic%20Energy%20Act%20Of%201954.pdf','ATOMIC ENERGY ACT OF 1954','ATOMIC ENERGY ACT OF 1954 4 4 Section 3173(a) of Public Law 107–314 (116 Stat. 2743) inserts after section 234B a new section 234C. There was no conforming amendment made to add a new item for this section to the table of sections. Sec. 183.','English'),(3765,126,17,'https://www.encyclopedia.com/science-and-technology/physics/physics/atomic-energy','Atomic Energy | Encyclopedia.com','ATOMIC ENERGY. The Soviet Union had an extensive atomic energy program. The program included the use of isotopes as tracers for agricultural research and as ionizing sources for food irradiation, extensive applications in medicine, so-called peaceful nuclear explosions, and an ambitious effort to build scores of reactors to produce electrical energy.','English'),(3766,126,18,'http://www.nnr.co.za/what-is-nuclear-energy/','What is Nuclear Energy? - National Nuclear ...','Nuclear energy is energy in the nucleus (core) of an atom. Atoms are tiny particles that make up every object in the universe. There is enormous energy in the bonds