he 2017 Solar Eclipse','English'),(3798,127,20,'https://spaceplace.nasa.gov/eclipses/en/','Lunar Eclipses and Solar Eclipses | NASA Space Place ...','A solar eclipse happens when the moon gets in the way of the sun’s light and casts its shadow on Earth. That means during the day, the moon moves over the sun and it gets dark. Isn’t it strange that it gets dark in the middle of the day? This total eclipse happens about every year and a half ...','English'),(3799,127,21,'https://eclipse.gsfc.nasa.gov/SEgoogle/SEgoogle2001/SE2017Aug21Tgoogle.html','NASA - Total Solar Eclipse of 2017 Aug 21','Predictions for the Total Solar Eclipse of 2017 Aug 21 were generated using the JPL DE405 solar and lunar ephemerides and a value of ΔT = 68.4 seconds. The eclipse predictions presented here DO NOT include the effects of mountains and valleys along the edge of the Moon.','English'),(3800,127,22,'https://www.merriam-webster.com/dictionary/solar%20eclipse','Solar Eclipse | Definition of Solar Eclipse by Merriam-Webster','Solar eclipse definition is - an eclipse of the sun by the moon.','English'),(3801,127,23,'https://terraria.gamepedia.com/Solar_Eclipse','Solar Eclipse - The Official Terraria Wiki','\"A solar eclipse is happening!\" A Solar Eclipse is a Hardmode event that occurs rarely after at least one mechanical boss has been defeated. A Solar Eclipse has a 1/20 (5%) chance of occurring upon any particular dawn.On the Desktop version, Console version, and Mobile version, it is also possible to summon a Solar Eclipse using a Solar Tablet (legitimately obtainable only after defeating ...','English'),(3802,127,24,'https://www.nasa.gov/audience/forstudents/5-8/features/nasa-knows/what-is-an-eclipse-58/','What Is an Eclipse? | NASA','An eclipse takes place when Earth or the moon passes through a shadow of another heavenly body. An eclipse takes place when Earth or the moon passes through a shadow of another heavenly body. ...','English'),(3803,127,25,'https://simple.wikipedia.org/wiki/Solar_eclipse','Solar eclipse - Simple English Wikipedia, the free ...','As seen from Earth, a solar eclipse /ee-klips/ happens when the Moon is directly between the Earth and the Sun.This makes the Moon fully or partially (partly) cover the sun. Solar eclipses can only happen during a new moon.Every year about two solar eclipses occur.Sometimes there are even five solar eclipses in a year.','English'),(3804,127,26,'https://www.skyandtelescope.com/observing/solar-and-lunar-eclipses-in-2019/','Solar and Lunar Eclipses in 2019 - Sky & Telescope','A solar eclipse, such as the one in August 2017, occurs only at new Moon, when the lunar disk passes directly between us and the Sun and the Moon\'s shadow falls somewhere on Earth\'s surface.','English'),(3805,127,27,'http://mreclipse.com/Special/SEprimer.html','Solar Eclipses for Beginners','Annular Solar Eclipse and the Path of Annularity. Annular Solar Eclipses. Unfortunately, not every eclipse of the Sun is a total eclipse. Sometimes, the Moon is too small to cover the entire Sun\'s disk. To understand why, we need to talk about the Moon\'s orbit around Earth. That orbit is not perfectly round but is oval or elliptical in shape.','English'),(3806,127,28,'https://twitter.com/nasasun','NASA Sun & Space (@NASASun) | Twitter','The latest Tweets from NASA Sun & Space (@NASASun). We study the Sun and how it affects space around Earth and other worlds, producing key knowledge to protect astronauts, satellites and robotic missions. NASA Goddard, Greenbelt, MD','English'),(3807,127,29,'https://space-facts.com/solar-eclipse/','Solar Eclipse Facts - Total, Annular & Partial Solar Eclipses','Total Solar Eclipse. A total solar eclipse occurs when the Moon completely blocks the solar disk. In a total solar eclipse, the narrowest part of the path (where the Sun is completely blocked and the Moon casts its darkest shadow (called the umbra)) is called the “zone of totality”.','English'),(3808,128,0,'https://en.wikipedia.org/wiki/Doping_in_sport','Doping in sport - Wikipedia','Doping existed in other countries, says the expert Jean-Pierre de Mondenard, both communist and capitalist, but the difference with East Germany was that it was a state policy. The Sportvereinigung Dynamo (English:Dynamo Sports Club) was especially singled out as a center for doping in the former East Germany.','English'),(3809,128,1,'https://www.bbc.com/sport/athletics/33997246','Doping in sport: What is it and how is it being tackled ...','The issue of doping in sport has been widely discussed in recent weeks, but what exactly is it? BBC Sport explains what it means, why it has become a hot topic, what the types of doping are and ...','English'),(3810,128,2,'https://www.forbes.com/sites/roomykhan/2017/12/31/doping-in-sports-cheating-or-leveling-of-the-playing-field/','Doping In Sports - Cheating Or Leveling Of The Playing Field?','Forbes Daily Cover Stories ... Doping In Sports - Cheating Or Leveling Of The Playing Field? ... weightlifting, boxing, wrestling, ice hockey, rugby, and other sports, all have a track record of ...','English'),(3811,128,3,'http://www.theathlete.org/doping-in-sport.htm','Doping in sports - a deadly game - theathlete.org','Doping in Sports - A deadly Game \"The potential benefits to society and to the individual from sport will only be maximised where fair play is centre stage\" Council of Europe Introduction. Sport goes beyond a measure of athletic excellence and the winning of trophies and medals.','English'),(3812,128,4,'https://www.ncbi.nlm.nih.gov/pmc/articles/PMC2219897/','Doping in sports and its spread to at-risk populations: an ...','Doping became so prevalent in Olympic sport that some argued that all records should be discarded or put on hold until all forms of doping could be detected and stopped. Through the 1980s and 1990s, clandestine doping programs spread from sport to sport guided by modern, albeit unethical, pharmacists and sports medicine professionals.','English'),(3813,128,5,'