at you will increasingly face: you could be tested for drugs; some of your competitors will be cheating by using drugs; you may even be tempted to do so yourself.','English'),(3819,128,11,'https://www.youtube.com/watch?v=MmqXcQW2BEI','The Disturbing Truth About Doping in Sports - YouTube','Athletes have looked for a chemical edge for centuries -- dating all the way back to the ancient Greeks who used alcoholic concoctions and hallucinogenic mushrooms. Thanks to newer technologies ...','English'),(3820,128,12,'https://www.theguardian.com/sport/drugs-in-sport','Drugs in sport | Sport | The Guardian','Drugs in sport . October 2019. ... The response of the IAAF president and the athletics commentariat to the doping ban of Alberto Salazar, Mo Farah’s former coach, is little short of nauseating ...','English'),(3821,128,13,'https://healthresearchfunding.org/doping-sports-pros-cons/','Doping in Sports Pros and Cons - HRF','The Pros of Doping in Sports. Physical Abilities Improvements Doping in sports can enhance your physical abilities in a short period of time. Performance enhancing drugs or steroids can increase muscle mass and provide large amount of stamina to enhance your athletic abilities and endurance.','English'),(3822,128,14,'https://sportsscientists.com/sports-science/doping/','Doping | The Science of Sport','Welcome to the Science of Sport where we bring you the second, third, and fourth level of analysis you will not find anywhere else.. Be it doping in sport, hot topics like Caster Semenya or Oscar Pistorius, or the dehydration myth, we try to translate the science behind sports and sports performance.Consider a donation if you like what you see here!','English'),(3823,128,15,'https://www.slideshare.net/drcorp/doping-in-sports','Doping in sports - SlideShare','Doping in sports 1. Dr. Abhijit Salvi MBBS, Masters in Sports Medicine (U.K) BCCI Anti-Doping and Age-Verification Officer 2. “Dope” – from Dutch word ‘Dop’ – an alcoholic beverage from grape skins, used by Zulu warriors to enhance their power in battle. 3.','English'),(3824,128,16,'https://www.sportsmedtoday.com/doping-va-119.htm','DOPING | Sports Medicine Today','The frequency and type of testing varies between sport based upon a variety of factors including history of doping in the sport, type of sports (e.g., endurance, strength/power), substances being taken, and duration of the season. Penalties for a doping violation vary greatly between sports.','English'),(3825,128,17,'https://journalofethics.ama-assn.org/article/physicians-and-sports-doping-epidemic/2014-07','Physicians and the Sports Doping Epidemic | Journal of ...','Doping in Sport. Physicians dope athletes for a variety of reasons that can range from unethical service to the state to the gratifying of their own immature emotional needs. The East German doctors who participated in the doping of thousands of young athletes, including the administration of anabolic steroids to pubescent girls, functioned ...','English'),(3826,128,18,'https://healthresearchfunding.org/35-surprising-doping-sports-statistics/','35 Surprising Doping in Sports Statistics - HRF','In the United Kingdom, rugby is the #1 sport for doping. Between rugby league and rugby union, 27 players have been banned, almost all due to a banned stimulant. 6. Cycling and boxing are with 0.2% of weightlifting for the most doping within their sport. 7. Many sports have seen improvements since 2004, especially cycling.','English'),(3827,128,19,'https://speedypaper.com/essays/doping-in-sports','Doping in Sports | SpeedyPaper.com','Doping as sports has been a serious issue since 1988 following the stripping of the gold medal of Johnson Ben. Johnson was banned for life in 1993 (Keim, 2014). Though the Olympics committee first investigated doping, there has been good government will in the banning of doping in sports.','English'),(3828,128,20,'https://www.medscape.com/features/slideshow/history-of-doping-in-sports','Faster, Higher, Stronger: A History of Doping in Sports','Doping and Modern Medicine. With the advent of modern medicine in the 19th century, taking stimulants to enhance energy use, production, and recovery in sport competition grew in popularity.','English'),(3829,128,21,'https://www.drugs.com/wada/','Drugs Banned in Sport: World Anti-Doping Prohibited List','World Anti-Doping Code Prohibited List. The World Anti-Doping Code Prohibited List is an International Standard. The List groups substances and methods by those that are banned at all times (in and out of competition), those that are banned in-competition only, and those that are banned by a particular sport.','English'),(3830,128,22,'http://www.academia.edu/Documents/in/Doping_in_Sport','Doping in Sport Research Papers - Academia.edu','Results: The participants sharing in the study by using social networking sites for sport doping information used the site to check knowledge for sport doping from friends and relatives not from the specialists in this field, in that case the information in sport doping were not enough, so they were skeptical about the quality of information.','English'),(3831,128,23,'https://thesisleader.com/essays/doping-in-sports/','Negative Effects of Doping in Sports (essay sample ...','Unfortunately, the world of sports is very often related with the word doping, since respectful and famous athletes have been tested positive for banned pills and substances. Undoubtedly, the level of these ingredients is increased annually due to the desire to be the first no matter what.','English'),(3832,128,24,'https://www.youtube.com/watch?v=4rUpX3QSPmw','What Do Performance-Enhancing Drugs Do To Your Body?','The Olympics are upon us, and unfortunately, many athletes use performance enhancing drugs to boost their ability. What exactly does doping and steroids do to your body? Watch More: Check out ...','English'),(3833,128,25,'https://www.verywellfit.com/epo-and-blood-doping-in-sports-3120522','Erythropoietin (EPO) in Blood Doping in Sports - Verywell Fit','Blood doping is in violation of standards set by the World Anti-Doping Agency (WADA) and is banned in professional sports. Even with rigorous testing among athletes, that hasn\'t stopped some from doing it anyway.','English'),(3834,128,26,'https://sportsanddrugs.procon.org/view.resource.php?resourceID=002352','Top 10 Pro & Con Arguments - Drug Use in Sports - ProCon.org','Furthernore, legalisation of doping, we believe, would encourage more sensible, informed use of drugs in amateur sport, leading to an overall decline in the rate of health problems associated with doping. Finally, by allowing medically supervised doping, the drugs used could be assessed for a clearer view of what is dangerous and what is not...','English'),(3835,128,27,'https://addictionresource.com/drugs-in-sports/','Drugs in Sports: Statistics, Side Effects, Prevention ...','On August 26th, 1960, doping in sports became an international topic when Knut Jensen died during the Olympic games in Rome. His death was linked to the use of amphetamines. In 1967, after a high-profile Tour de France doping death, the International Olympic Committee established a commission to fight doping in sports.','English'),(3836,128,28,'https://sportsanddrugs.procon.org/view.timeline.php?timelineID=000017','Historical Timeline - Drug Use in Sports - ProCon.org','\"The use of drugs to enhance performance in sports has certainly occurred since the time of the original Olympic Games [from 776 to 393 BC]. The origin of the word \'doping\' is attributed to the Dutch word \'doop,\' which is a viscous opium juice, the drug of choice of the ancient Greeks.\"','English'),(3837,128,29,'https://www.livescience.com/55779-biggest-doping-scandals-in-olympics-history.html','10 Biggest Doping Scandals in Olympics History | Live Science','Live Science is supported by its audience. When you purchase through links on our site, we may earn an affiliate commission. Learn more 10 Biggest Doping Scandals in Olympics History','English'),(3838,129,0,'https://en.wikipedia.org/wiki/Human_cloning','Human cloning - Wikipedia','Human cloning is the creation of a genetically identical copy (or clone) of a human.The term is generally used to refer to artificial human cloning, which is the reproduction of human cells and tissue.It does not refer to the natural conception and delivery of identical twins.The possibility of human cloning has raised controversies.These ethical concerns have prompted several nations to pass ...','English'),(3839,129,1,'https://www.genome.gov/about-genomics/fact-sheets/Cloning-Fact-Sheet','Cloning Fact Sheet | NHGRI','The term cloning describes a number of different processes that can be used to produce genetically identical copies of a biological entity. The copied material, which has the same genetic makeup as the original, is referred to as a clone.','English'),(3840,129,2,'https://www.medicaldaily.com/science-human-cloning-how-far-weve-come-and-how-far-were-capable-going-340006','The Science Of Human Cloning: How Far We\'ve Come And How ...','The body of the world\'s first cloned sheep, Dolly, is now stuffed and on display at the Museum of Scotland Neil Turner CC BY-NC-ND 2.0. We Can Do It, But Is It Safe? It would be theoretically possible to clone humans, but, to date, there are no records of an actual fully developed human ever being cloned, Live Science reported. The closest we have come to this is the 1997 cloning of our closet ...','English'),(3841,129,3,'https://humancloning.org/','Human cloning','Human Cloning Ancestry Quality resources from cloning to DNA and ancestors','English'),(3842,129,4,'https://www.geneticsandsociety.org/topics/human-cloning','Human Cloning | Center for Genetics and Society','Gallup released its annual Values and Beliefs survey on June 4th. This is the 18th year in which Gallup has conducted its poll about the moral acceptability of various topics, including human cloning, animal cloning, and (since 2002) medical research using stem cells obtained from human embryos.','English'),(3843,129,5,'https://cbhd.org/content/human-cloning','Human Cloning | The Center for Bioethics & Human Dignity','We live in a brave new world in which reproductive technologies are ravaging as well as replenishing families. Increasingly common are variations of the situation in which \"baby\'s mother is also grandma-and sister.\"[1] Sometimes extreme measures are necessary in order to have the kind of child we want.','English'),(3844,129,6,'https://biologywise.com/human-cloning-pros-cons','Human Cloning: The Pros and Cons Highlight Its Risk','Human cloning is the practice of creating genetically identical copy/copies of a person, or cells and tissues of the person. The process is quite similar to the process in which identical twins are born.','English'),(3845,129,7,'https://futurism.com/human-cloning-whats-stopping','Ethical Implications of Human Cloning | Futurism','The technology for successful human cloning is within our reach. But the legal, ethical, and social implications keep us from using it.','English'),(3846,129,8,'https://www.healthline.com/health-news/research-for-human-cloning','How Close Are We to Cloning a Human? - healthline.com','Researchers in China have cloned two monkeys. However, there are a number of medical and ethical hurdles to overcome before this can be tried in humans. Share on Pinterest A pair of cloned monkeys ...','English'),(3847,129,9,'https://www.sciencedaily.com/terms/human_cloning.htm','Human cloning - sciencedaily.com','Human cloning is the creation of a genetically identical copy of an existing, or previously existing, human being or growing cloned tissue from that individual. The term is generally used to refer ...','English'),(3848,129,10,'https://www.theguardian.com/commentisfree/2018/jan/25/afraid-cloning-humans-macaque-monkeys-reality','How afraid of human cloning should we be? | Philip Ball ...','T he cloning of macaque monkeys in China makes human reproductive cloning more conceivable. At the same time, it confirms how difficult it would be to clone a random adult – Adolf Hitler, say ...','English'),(3849,129,11,'https://humancloning.org/allthe.html','All the Reasons to Clone Human Beings | Human Cloning ...','Medical breakthroughs – Human cloning technology is expected to result in several miraculous medical breakthroughs.We may be able to cure cancer if cloning leads to a better understanding of cell differentiation. Theories exist about how cloning may lead to a cure for heart attacks, a revolution in cosmetic surgery, organs for organ transplantation, and predictions abound about how cloning ...','English'),(3850,129,12,'https://healthresearchfunding.org/pros-cons-human-cloning/','Pros and Cons of Human Cloning - HRF','The Cons of Human Cloning. Here are the primary issues associated with human cloning: There is a possibility of faster aging. Because an older cell is often being used to create a human clone, there is the possibility that this imprinted age could be placed on the growing embryo.','English'),(3851,129,13,'https://www.cbsnews.com/news/human-cloning-13-03-2001/','Human Cloning - CBS News','At the headquarters of the Human Cloning Foundation, in the corner of a Greenwich Village lamp shop, more than a half a million people have logged on to the Web site to exchange information. Women ...','English'),(3852,129,14,'https://science.howstuffworks.com/life/genetic/human-cloning.htm','How Human Cloning Will Work | HowStuffWorks','Human cloning has been an ethical issue ever since the first sheep was cloned in 1997. Learn about the science behind human cloning.','English'),(3853,129,15,'https://thenextgalaxy.com/12-disadvantages-and-advantages-of-human-cloning/','12 Disadvantages and Advantages of Human Cloning | Samsung ...','Human cloning is possibly one of the most heated and relevant ethical debates of our time. Cloning is the process of taking genetic material from one organism, and creating an identical copy of it by growing it artificially.','English'),(3854,129,16,'https://www.genome.gov/','National Human Genome Research Institute','About the National Human Genome Research Institute. At NHGRI, we are focused on advances in genomics research. Building on our leadership role in the initial sequencing of the human genome, we collaborate with the world\'s scientific and medical communities to enhance genomic technologies that accelerate breakthroughs and improve lives.','English'),(3855,129,17,'https://www.thoughtco.com/should-human-cloning-be-banned-721486','Should Human Cloning Be Banned? - ThoughtCo','Human cloning is illegal in some states, and institutions that receive U.S. federal funding are prohibited from experimenting with it, but there is no federal ban on human cloning in the United States.','English'),(3856,129,18,'http://www.cbc-network.org/issues/faking-life/human-cloning/','Human Cloning — The Center for Bioethics and Culture','Cited by Science magazine as the “breakthrough of 1997,” the world’s media flocked to cover the story of a cloned sheep named Dolly by scientists at Scotland’s Roslin Institute. While scientists had been cloning animals since 1952, when a tadpole was cloned, the creation of Dolly was significant because it was the first time a mammal had been successfully cloned.','English'),(3857,129,19,'https://medical-dictionary.thefreedictionary.com/human+cloning','Human cloning | definition of human cloning by Medical ...','The percentage of Americans who say they find human cloning morally acceptable has increased, but the overwhelming majority still find it morally unacceptable.','English'),(3858,129,20,'https://greengarageblog.org/16-important-pros-and-cons-of-cloning-humans','16 Important Pros and Cons of Cloning Humans – Green Garage','List of Cons of Cloning Humans. 1. It risks the possibility of faster aging. As older cells are often used to create human clones, it is possible that their imprinted age could be adopted by the growing embryos, which can then create some premature aging issues and, potentially, even premature death.','English'),(3859,129,21,'https://futurism.com/how-close-are-we-to-successfully-cloning-the-first-human','How Close Are We to Successfully Cloning the First Human?','Human cloning may be one of the go-to science fiction tropes, but in reality we may be much closer to achieving it than our fictional heroes might imply','English'),(3860,129,22,'https://www.youtube.com/watch?v=7tbxN5uwaqA','Human Cloning - YouTube','dsc.discovery.com/videos/tech-human-cloning.html We\'ve cloned sheep, mice, dogs and more. So are humans next? Bioethicists talk to Discovery News\' Jorge Ribas about ...','English'),(3861,129,23,'https://science.howstuffworks.com/life/genetic/human-cloning1.htm','Creating a Human Clone - How Human Cloning Will Work ...','­If human reproductive cloning proceeds, the primary method scientists will likely use is somatic ce­ll nuclear transfer (SCNT), which is the same procedure that was used to create Dolly the sheep.Somatic cell nuclear transfer begins when doctors take the egg from a female donor and remove its nucleus, creating an enucleated egg.A cell, which contains DNA, is taken from the person who is ...','English'),(3862,129,24,'https://www.britannica.com/science/cloning','cloning | Definition, Process, & Types | Britannica.com','Cloning, the process of generating a genetically identical copy of a cell or an organism. Cloning happens often in nature, as when a cell replicates itself asexually without genetic alteration or recombination. Learn more about cloning experiments, cloning techniques, and the ethics of human reproductive cloning.','English'),(3863,129,25,'https://www.livescience.com/topics/cloning','Cloning - 2019 News and Scientific Articles on Live Science','Find out everything there is to know about cloning and stay updated on the latest cloning news with the comprehensive articles, interactive features and pictures at LiveScience.com. Learn more ...','English'),(3864,129,26,'https://sciencing.com/pros-cons-cloning-5453902.html','The Pros & Cons of Cloning | Sciencing','The advantages and disadvantages of human cloning raise moral, ethical, scientific and safety questions. Though genetically identical, cloned humans are technically due the same rights of any human. Many countries disallow reproductive cloning because of these questions, but some do allow research.','English'),(3865,129,27,'https://io9.gizmodo.com/9-unexpected-outcomes-of-human-cloning-1606556772','9 Unexpected Outcomes Of Human Cloning - io9.gizmodo.com','Human cloning is currently illegal in virtually all parts of the world, but that doesn\'t mean it will stay that way. Here are some surprising things we can expect once we\'re finally allowed to ...','English'),(3866,129,28,'https://www.pbs.org/wgbh/pages/frontline/shows/fertility/etc/cloning.html','Human Cloning | Making Babies | FRONTLINE | PBS','Silver is a Professor of Genetics at Princeton University where his laboratory is attempting to identify genes that influence personality and behavior.','English'),(3867,129,29,'https://www.youtube.com/watch?v=u8alnE7KA6U','Scientists Take Step Towards Human Cloning - YouTube','Scientists have used cloning technology to transform human skin cells into embryonic stem cells, an experiment that may revive the controversy over human cloning. WSJ\'s Gautam Naik reports.Photo ...','English'),(3868,130,0,'https://en.wikipedia.org/wiki/List_of_Nobel_laureates_in_Chemistry','List of Nobel laureates in Chemistry - Wikipedia','The Nobel Prize in Chemistry (Swedish: Nobelpriset i kemi) is awarded annually by the Royal Swedish Academy of Sciences to scientists in the various fields of chemistry.It is one of the five Nobel Prizes established by the 1895 will of Alfred Nobel, who died in 1896.These prizes are awarded for outstanding contributions in chemistry, physics, literature, peace, and physiology or medicine.','English'),(3869,130,1,'https://www.nobelprize