mation about YEAR 1 Comprehensive Online ...','English'),(3927,131,29,'http://www.zebrakeys.com/','Zebra Keys','Free online piano lessons, interactive tools, sheet music, articles, links, and product reviews. Learn how to play piano using beginner, intermediate and advanced level lessons accompanied by flash animation.','English'),(3928,132,0,'https://www.webmd.com/allergies/food-allergy-intolerances','Food Allergy and Food Intolerance - Causes, Symptoms ...','Continued Treatment for Food Allergies. The main way to deal with food allergies is to avoid them. For highly allergic people, even tiny amounts of an allergen (as little as 1/44,000 of a peanut ...','English'),(3929,132,1,'https://www.foodallergy.org/','Food Allergy Research & Education','Food Allergy Research & Education (FARE) works on behalf of the 32 million Americans with food allergies, including all those at risk for life-threatening anaphylaxis. Learn More. FInd a Support Group. It helps to know you are not alone. Find a support group in your area. Learn More.','English'),(3930,132,2,'https://www.mayoclinic.org/diseases-conditions/food-allergy/symptoms-causes/syc-20355095','Food allergy - Symptoms and causes - Mayo Clinic','Overview. Food allergy is an immune system reaction that occurs soon after eating a certain food. Even a tiny amount of the allergy-causing food can trigger signs and symptoms such as digestive problems, hives or swollen airways.','English'),(3931,132,3,'https://acaai.org/allergies/types/food-allergy','Food Allergies | Causes, Symptoms & Treatment | ACAAI ...','A food allergy reaction occurs when your immune system overreacts to a food or a substance in a food, identifying it as a danger and triggering a protective response. While allergies tend to run in families, it is impossible to predict whether a child will inherit a parent’s food allergy or whether siblings will have a similar condition.','English'),(3932,132,4,'https://en.wikipedia.org/wiki/Food_allergy','Food allergy - Wikipedia','A food allergy is an abnormal immune response to food. The symptoms of the allergic reaction may range from mild to severe. They may include itchiness, swelling of the tongue, vomiting, diarrhea, hives, trouble breathing, or low blood pressure.','English'),(3933,132,5,'https://www.healthline.com/health/allergies/common-food-allergies','Common Food Allergies: Peanuts, Milk, and More - Healthline','The way food allergies are diagnosed usually depends on the severity of symptoms. If your symptoms are mild, a doctor may recommend keeping a food diary to record all of the foods you eat or drink ...','English'),(3934,132,6,'https://www.fda.gov/Food/ResourcesForYou/Consumers/ucm079311.htm','Food Allergies: What You Need to Know - fda.gov','Food Facts for consumers on food allergies, labeling of foods that contain major food allergens, symptoms of an allergic reaction, and reporting a problem with a food\'s labeling.','English'),(3935,132,7,'https://www.foodallergy.org/life-with-food-allergies/food-allergy-101/what-is-a-food-allergy','What is a Food Allergy? | Food Allergy Research & Education','Food allergy is a serious and potentially life-threatening medical condition affecting 32 million Americans. One in every 13 children has a food allergy—that’s about 2 in every U.S. classroom. And every 3 minutes, a food allergy reaction sends someone to the emergency room. Food allergy is among ...','English'),(3936,132,8,'https://medlineplus.gov/foodallergy.html','Food Allergy | Anaphylaxis | Food Allergies | MedlinePlus','Food allergy is an abnormal response to a food triggered by your body\'s immune system.. In adults, the foods that most often trigger allergic reactions include fish, shellfish, peanuts, and tree nuts, such as walnuts. Problem foods for children can include eggs, milk, peanuts, tree nuts, soy, and wheat.','English'),(3937,132,9,'https://www.aaaai.org/conditions-and-treatments/allergies/food-allergies','Food Allergies Symptoms, Diagnosis & Treatment | AA