ounds and natural radioactivity.','English'),(4109,138,2,'https://www.eartheclipse.com/pollution/primary-causes-of-air-pollution.html','5 Primary Causes of Air Pollution | Earth Eclipse','Closer look at the activities that cause air pollution include: 1. Emissions From Industrial Plants and Manufacturing Activities. With the current rate of industrialization and increased manufacturing activities, high levels of smoke, sulfur dioxide, and particulate matter are emitted into the air.','English'),(4110,138,3,'https://phys.org/news/2016-04-air-pollution.html','What causes air pollution? - Phys.org','Whereas some causes of pollution are entirely natural – being the result of sudden changes in temperature, seasonal changes, or regular cycles – others are the result of human impact (i.e ...','English'),(4111,138,4,'https://www.nationalgeographic.com/environment/global-warming/pollution/','Air Pollution Causes, Effects, and ... - National Geographic','Air pollution is a mix of particles and gases that can reach harmful concentrations both outside and indoors. Its effects can range from higher disease risks to rising temperatures.','English'),(4112,138,5,'https://healthfully.com/causes-air-pollution-5436713.html','10 Causes of Air Pollution | Healthfully','Air pollution is caused by a wide variety of things. The earth is great at cleaning the air on its own. However, air pollution has grown so much, the earth can no longer clean all of it. This is starting to have adverse effects on the environment such as causing acid rain, smog and a wide variety of health problems.','English'),(4113,138,6,'https://sciencing.com/10-causes-air-pollution-6890.html','10 Causes of Air Pollution | Sciencing','Sometimes people think of air pollution as entirely man-made. In fact, natural processes release lots of substances into the air that are classed as pollution. Sulfur dioxide is a major modern air pollutant, and according to National Geographic, volcanoes can release enough sulfur dioxide into the air to influence global cooling.','English'),(4114,138,7,'http://opishposh.com/10-biggest-causes-of-air-pollution/','10 Biggest Causes Of Air Pollution - O, Pish Posh!','These fumes can cause a variety of health problems for its homeowners, tenants, or visitors. While technological advancements have paved the way for innovations in transportation, agriculture, and energy production, the fact of the matter is they have become the biggest causes of air pollution.','English'),(4115,138,8,'https://www.reference.com/science/main-causes-air-pollution-1bc986eff16b144c','What Are the Main Causes of Air Pollution? | Reference.com','Some of the major causes of air pollution include burning of fossil fuels, agricultural activities, exhaust from industries, vehicle fumes, mining operations and indoor pollutants. Air pollution has...','English'),(4116,138,9,'https://www.nrdc.org/stories/air-pollution-everything-you-need-know','Air Pollution Facts, Causes and the Effects of Pollutants ...','Air pollution refers to the release of pollutants into the air that are detrimental to human health and the planet as a whole. The Clean Air Act authorizes the U.S. Environmental Protection Agency ...','English'),(4117,138,10,'http://www.gogreenacademy.com/causes-and-effects-of-air-pollution/','Causes and Effects of Air Pollution | Go Green Academy','Causes of Air Pollution. Air pollution is caused when air in the atmosphere is filled with particulate matter. The largest source air of pollution in cities is from vehicle exhaust fumes. Carbon monoxide is the largest air pollutant in the United States, and it’s number one source is from vehicle exhausts.','English'),(4118,138,11,'https://savetheair.in/causes-of-air-pollution/','Causes of Air Pollution | What Causes Air Pollution | 10 ...','Top 10 Causes of Air Pollution The word ‘Air Pollution’ itself is not a very pleasing one. The word air pollution is surrounded by pangs of concern and clouds of worry. The health of humans, well being of other animals and the natural balance in the ecosystem, everything its and bits of life is threatened by air pollution.','English'),(4119,138,12,'https://www.universetoday.com/81977/causes-of-air-pollution/','What Causes Air Pollution? - Universe Today','Human activity is a major cause of air pollution, much of which results from industrial processes. Credit: cherwell.org. In addition, air pollution can be divided into Primary and Secondary types ...','English'),(4120,138,13,'https://en.wikipedia.org/wiki/Air_pollution','Air pollution - Wikipedia','Indoor air pollution and poor urban air quality are listed as two of the world\'s worst toxic pollution problems in the 2008 Blacksmith Institute World\'s Worst Polluted Places report. Outdoor air pollution alone causes 2.1 to 4.21 million premature deaths annually.','English'),(4121,138,14,'http://cleanerandgreener.org/resources/air-pollution.html','Air Pollution - cleanerandgreener.org','We cause air pollution directly through our use of electricity, fuels, and transportation. We also cause air pollution indirectly, when we buy goods and services that use energy in their production and delivery. Most of this air pollution we cause results from the burning of fossil fuels, such as coal, oil, natural gas, and gasoline to produce ...','English'),(4122,138,15,'https://www.reference.com/science/causes-pollution-3a853793adb33a9c','What Are the Causes of Pollution? | Reference.com','The causes of pollution are excessive use of natural resources, over industrialization, increase in global population and globalization. The use of chemicals, such as pesticides and weedicides, cause soil pollution. The introduction of pollutants into the air, water or soil is called pollution.','English'),(4123,138,16,'https://www.conserve-energy-future.com/PollutionTypes.php','Various Types and Effects of Pollution - Conserve Energy ...','Major Types of Pollution. Air Pollution is the most prominent and dangerous form of pollution. It occurs due to many reasons. Excessive burning of fuel which is a necessity of our daily lives for cooking, driving and other industrial activities; releases a huge amount of chemical substances in the air every day; these pollute the air.','English'),(4124,138,17,'https://climatekids.nasa.gov/air-pollution/','What Causes Air Pollution? | NASA Climate Kids','What else causes air pollution? Certain gases in the atmosphere can cause air pollution. For example, in cities, a gas called ozone is a major cause of air pollution. Ozone is also a greenhouse gas that can be both good and bad for our environment.','English'),(4125,138,18,'https://www.renewableresourcescoalition.org/air-pollution-causes-effects-solutions/','Air Pollution Causes, Effects & Solutions: The Definitive ...','Air pollution is known to cause irritation in the eyes, lungs, nose, and throat. It creates respiratory problems and exacerbates existing conditions such as asthma and emphysema. When continually exposed to air pollution, humans become at higher risk for cardiovascular disease. Air filled with toxins can have a number of adverse effects on the ...','English'),(4126,138,19,'https://www.niehs.nih.gov/health/topics/agents/air-pollution/index.cfm','Air Pollution - niehs.nih.gov','Air Pollution. Air pollution is a mixture of natural and man-made substances in the air we breathe. It is typically separated into two categories: outdoor air pollution and indoor air pollution. Outdoor air pollution involves exposures that take place outside of the built environment. Examples include:','English'),(4127,138,20,'https://www.who.int/airpollution/en/','WHO | Air pollution','Air pollution – a leading cause of NCD deaths Most air pollution-related deaths are from noncommunicable diseases (NCDs). In terms of global disease burden, air pollution is the cause of over one-third of deaths from stroke, lung cancer, and chronic respiratory disease, and one-quarter of deaths from ischaemic heart disease.','English'),(4128,138